INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(59174, 'ptBR', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59173, 'ptBR', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59019, 'ptBR', 'Chamado às Armas: Uldum', 'Mate integrantes da Horda em Uldum.', 'Nossa missão em Uldum foi comprometida pela incursão da Horda. \n\nEntre em Uldum e mate o máximo que conseguir.', '', '', '', '', '', '', 33528),
(59018, 'ptBR', 'Chamado às Armas: Vale das Flores Eternas', 'Mate integrantes da Horda no Vale das Flores Eternas.', 'Nossa missão no Vale das Flores Eternas foi comprometida pela incursão da Horda. \n\nEntre no Vale e mate o máximo que conseguir.', '', '', '', '', '', '', 33528),
(59017, 'ptBR', 'Chamado às Armas: Vale das Flores Eternas', 'Mate integrantes da Aliança no Vale das Flores Eternas.', 'Nossos objetivos no Vale das Flores Eternas estão sendo atrapalhados pelo influxo da escória da Aliança.\n\nElimine o máximo deles pela região, depois volte aqui.', '', '', '', '', '', '', 33528),
(59016, 'ptBR', 'Chamado às Armas: Uldum', 'Mate integrantes da Aliança em Uldum.', 'Nossos objetivos em Uldum estão sendo atrapalhados pelo influxo da escória da Aliança.\n\nElimine o máximo deles pela região, depois volte aqui.', '', '', '', '', '', '', 33528),
(59000, 'ptBR', 'Elementos de corrupção', 'Fale com a M.A.D.R.E. para aprender sobre itens corrompidos.', 'A corrupção age de forma misteriosa. Ela se espalha para além de Azeroth, tocando nossos pensamentos mais íntimos e às vezes corrompendo várias relíquias, como você viu em primeira mão.\n\nEmbora eu não saiba explicar diretamente as implicações desse problema, tenho certeza que a M.A.D.R.E. tem mais informações sobre os chamados itens de corrupção.', '', '', '', '', '', '', 33528),
(58991, 'ptBR', 'Corrupção curiosa', 'Procure respostas sobre o item corrompido na Câmara do Coração.', '<Parece haver algo de incomum neste item. Talvez alguém na câmara saiba dizer qual a origem.>', '', '', '', '', '', '', 33528),
(58990, 'ptBR', 'Ovo de titanus', '', '', '', '', '', '', '', '', 33528),
(58989, 'ptBR', 'Forja rúnica para principiantes', 'Use a habilidade de forjar runas no seu grimório para gravar uma runa na sua arma.\n\nVocê pode trocar a gravação a qualquer momento, bastando para isso estar próximo a uma Forja Rúnica.', 'Como cavaleiros da Lâmina de Ébano, precisamos estar sempre preparados para diversas situações marciais. Para isso, a arte sombria de forjar runas está à sua disposição. Com ela, runas de grande poder podem ser gravadas em suas armas.\n\nExistem forjas rúnicas acima de nós, no Coração de Áquerus. Visite uma delas e use seu poder para imbuir uma runa de poder em sua arma.', 'Arma brasonada', '', '', '', '', '', 33528),
(58981, 'ptBR', 'Colmeia endurecida', '', '', '', '', '', '', '', '', 33528),
(58974, 'ptBR', 'Colonos emboscados', '', '', '', '', '', '', '', '', 33528),
(58961, 'ptBR', 'Colonos emboscados', '', '', '', '', '', '', '', '', 33528),
(58952, 'ptBR', 'Chamas purgatórias', '', '', '', '', '', '', '', '', 33528),
(58904, 'ptBR', 'Estilhaços da Corrupção', 'Colete $0oa Estilhaços da Corrupção.', '<Você sente a pressão de algo sombrio e inumano em sua mente, cujos penetrantes cipós serpentiformes enrodilham sua sanidade. Você se sente compelid$Go:a; a coletar mais estilhaços... todos eles.>', '', '', '', '', '', 'Localize o Ídolo da Iniquidade.', 33528),
(58903, 'ptBR', 'Defesa de Azeroth', 'Fale com o Grão-lorde Dárion Mograine. Depois, use o portão da morte do grão-lorde para viajar até Orgrimmar. Chegando lá, faça uma escolha no Mural de Ordens do Chefe Guerreiro.', 'Excelente escolha.\n\nTempos turbulentos virão. Você está entre os poucos escolhidos e, por isso, tem o privilégio e a obrigação de defender nosso mundo. É uma grande honra.\n\nMas você também vai enfrentar a corja dos ignorantes. Muitas vezes, os mortais são incapazes de enxergar além de nossa aparência assustadora. Ignore esses tolos e faça o que precisa ser feito.\n\nFale com o seu comandante. Depois, use esse portão da morte para viajar até a terra dos vivos e escolha o seu destino.', '', '', '', '', '', '', 33528),
(58902, 'ptBR', 'Defesa de Azeroth', 'Fale com o Grão-lorde Dárion Mograine. Depois, use o portão da morte do grão-lorde para viajar até Ventobravo. Chegando lá, faça uma escolha no Mural do Chamado ao Heroísmo.', 'Excelente escolha.\n\nTempos turbulentos virão. Você está entre os poucos escolhidos e, por isso, tem o privilégio e a obrigação de defender nosso mundo. É uma grande honra.\n\nMas você também vai enfrentar a corja dos ignorantes. Muitas vezes, os mortais são incapazes de enxergar além de nossa aparência assustadora. Ignore esses tolos e faça o que precisa ser feito.\n\nFale com o seu comandante. Depois, use esse portão da morte para viajar até a terra dos vivos e escolha o seu destino.', '', '', '', '', '', '', 33528),
(58887, 'ptBR', 'Alpaca pacas', '', '', '', '', '', '', '', '', 33528),
(58881, 'ptBR', 'Missão de Rastreamento', '', '', '', '', '', '', '', '', 33528),
(58879, 'ptBR', 'Alpaca papa', '', '', '', '', '', '', '', '', 33528),
(58877, 'ptBR', 'Cresce o poder da morte', 'Jura lealdade ao Lich Rei.', 'Ouça com atenção, $n. Um tempo de grande destruição, que vai pôr em risco nossa existência, está se aproximando. Agora, mais do que nunca, precisamos defender Azeroth.\n\nFoi por isso que engrossei minhas fileiras de campeões com a sua raça. Seu sacrifício fez você se destacar de todos. Mantenha sua altivez. Mais do que nunca, você será $Gum Cavaleiro da Morte:uma Cavaleira da Morte; da Lâmina de Ébano.\n\nAgora, jure lealdade.', '', '', '', '', '', '', 33528),
(58876, 'ptBR', 'Voo perdido', 'Leve a Cria de Vexiona para Wrathion na Câmara do Coração.', '<Um pequeno dragão emerge de uma das câmaras laterais encontradas dentro da grande carapaça de N\'Zoth, aparentando estar confuso.\n\nVocê deduz que as câmaras devem ter sido usadas para corromper os dragões, expondo-os diretamente aos sussurros sombrios de N\'Zoth. Os mais jovens eram os mais propensos à loucura, mais do que qualquer outro membro da revoada crepuscular que você já tenha encontrado antes.\n\nUma loucura praticamente irreversível.\n\nAinda assim, talvez não seja tarde demais para este...>', '', '', '', '', '', '', 33528),
(58866, 'ptBR', 'Meu próprio zangão', 'Leve a Sela Sobrenatural para H\'partho Ardoros em Ramkahen.', 'A sela ficou pronta. Não vou mentir que gostei de trabalhar esse metal corrompido, mas no fim das contas foi fácil-fácil a melhor sela que eu já fiz.\n\nSei que ela parece... agressiva, mas garanto que o seu aqir vai achar muito confortável.\n\nTomara que lhe sirva bem.', '', '', '', '', '', '', 33528),
(58865, 'ptBR', 'Armamentos de outro mundo', 'Recolha $1oa Armamentos do Império Negro de sectários do Império Negro em Uldum e no Vale das Flores Eternas.', 'Para confeccionar uma sela para esse bicho, vou precisar de peças especiais. Serão principalmente peças de metal mais leves do que as que temos disponíveis.\n\nEu reparei que os sectários do Império Negro portam armas feitas de materiais sobrenaturais, de uma força e leveza impossíveis. \n\nSe você trouxer umas armas para mim, eu posso derreter o metal e moldá-lo em forma de sela para o aqir.', '', '', '', '', '', '', 33528),
(58863, 'ptBR', 'Pedido sob encomenda', 'Fale com o Ferreiro Abasi em Ramkahen.', 'Já podemos dizer que nosso camaradinha não é mais filhote, mas um aqir crescido! Cresceu tanto, aliás, que é capaz de levar-te às costas na próxima batalha.\n\nEspera, que ideia maravilhosa!\n\nTu devias pedir ao Ferreiro Abasi que te confeccione uma sela.', '', '', '', '', '', '', 33528),
(58862, 'ptBR', 'O pequeno defensor', 'Derrote o Defensor de Pedra Baruk em uma batalha de mascotes com o Filhote de Farpassombra no seu grupo.', 'Os mogus Baruk são famosos por animar estátuas ancestrais, que colocam para defender seu território. São adversários resilientes, e há muita coisa a se aprender ao enfrentar um inimigo com defesas tão rígidas.\n\nPor sorte, parece que um dos Moldapedras animou uma estatuetazinha por engano. Ela foi descartada por não ter serventia para eles, mas pode ser uma oportunidade valiosa de treinamento para o nosso filhotinho.\n\nEncontra esse minidefensor no Vale das Flores Eternas.', '', '', '', '', '', '', 33528),
(58861, 'ptBR', 'A manha do mantídeo', 'Derrote o Filhote de Vil\'thik em uma batalha de mascotes com o Filhote de Farpassombra no seu grupo.', 'Observar as técnicas de combate dos mantídeos pode vir a ser útil no treinamento do filhotinho. Ele aprenderá outras formas de usar suas armas naturais de inseto.\n\nEncontrei um oponente mantídeo que nosso filhotinho pode enfrentar no Vale das Flores Eternas. Leva-o lá para ver como se sai.', '', '', '', '', '', '', 33528),
(58860, 'ptBR', 'Besourão do Mal', 'Derrote o Rastejareia Aqir em uma batalha de mascotes com o Filhote de Farpassombra no seu grupo.', 'Acho que vai fazer bem para o nosso filhotinho se ele enfrentar outro aqir, para aprender as coisas de que a sua espécie é capaz.\n\nEncontrei um oponente que vai proporcionar uma bela de uma briga.', '', '', '', '', '', '', 33528),
(58859, 'ptBR', 'Encara alguém do seu tamanho', 'Derrote Retinus, o Obstinado, numa batalha de mascotes com seu Filhote de Farpassombra no seu grupo.', 'Por mais que lutar ao teu lado seja um treinamento excelente para o filhotinho, às vezes também é bom que ele encare alguém do próprio tamanho.\n\nEu sei que há um bicho assim por perto, observando os Amatet perto do Obelisco das Estrelas. Tu deverias ir atrás dele.', '', '', '', '', '', '', 33528),
(58858, 'ptBR', 'Mais filés fétidos', 'Recolha $1oa peças de Carne Corrompida das criaturas que estão nas áreas sob ataque dos lacaios de N\'Zoth.', 'Nosso camaradinha já está com fome outra vez. \n\nPodes arranjar um lanchinho para ele?', '', '', '', '', '', '', 33528),
(58831, 'ptBR', 'O aperfeiçoamento dos instintos', 'Use o Apito de H\'partho para evocar seu Filhote de Aqir e enfrentar inimigos em Uldum ou no Vale das Flores Eternas. Enfrentar inimigos mais difíceis e raros vai ajudar o filhote a crescer mais rápido.', 'Parece que nosso camaradinha está ansioso para as próximas brigas.\n\nTu te importas de lhe mostrar o básico?', '', '', '', '', '', '', 33528),
(58830, 'ptBR', 'Instintos aqir', 'Use o Apito de H\'partho para evocar seu Filhote de Aqir e enfrentar inimigos em Uldum ou no Vale das Flores Eternas. Enfrentar inimigos mais difíceis e raros vai ajudar o filhote a crescer mais rápido.', 'Ao observar os aqir enfrentando os Errantes, eu vi que os filhotes se juntavam imediatamente aos ataques. Parece que essas criaturas têm uma necessidade inata de guerrear.\n\nTemos que exercitar os instintos do nosso filhotinho, sob a tua supervisão, é claro. Leve-o para dar umas voltas e mostre-lhe como enfrentar seus inimigos. \n\nEle não deve ter energia para lutar por muito tempo, então não o chames até que tu estejas pront$go:a; para treinar.\n\nSe dermos sorte, ele passará a nos considerar como parte da colmeia.', '', '', '', '', '', '', 33528),
(58829, 'ptBR', 'Eles crescem tão rápido', 'Ajude a Larva de Aqir a sair do casulo em Ramkahen.', 'Olha! Nossa larvinha já entrou no estágio de pupa! \n\nEspera... parece que já vai sair. \n\nVai lá, dá uma mãozinha para ele!', '', '', '', '', '', '', 33528),
(58826, 'ptBR', 'Um petisco sangrento', 'Recolha $1oa Ampolas de Ânima Purificada dos mogus Dokani no Vale das Flores Eternas.', 'Ouvi dizer que o clã mogu dos Dokani dominou a arte de manipular a força vital por meio de uma substância que eles chamam de \"ânima\".\n\nSe esse negócio for mesmo vida condensada em forma líquida, pode ser que gere efeitos espetaculares se aplicado à nossa larva de aqir.\n\nTenta conseguir um punhado dessa tal ânima numa forma que seja utilizável. Vejamos se nosso camaradinha gosta disso!', '', '', '', '', '', '', 33528),
(58825, 'ptBR', 'Supergeleia', 'Recolha $1oa porções de Geleia Real Concentrada no Vale das Flores Eternas.', 'Meus amigos do Lótus Dourado vêm me contando dados interessantes sobre o novo enxame dos mantídeos. Parece que desenvolveram uma geleia real que acelera o crescimento dos filhotes. \n\nSe tem esse efeito nos mantídeos, o mais lógico é que tenha o mesmo efeito nos aqir!\n\nVeja se consegue uma amostra generosa dessa geleia para espichar nossa larvinha.', '', '', '', '', '', '', 33528),
(58818, 'ptBR', 'Irmãos insetos', 'Capture $1oa Filhotes de Arenito Dóceis em Uldum.', 'É impressão minha ou nosso camaradinha parece muito sozinho? Faz sentido os aqir serem bichos sociáveis, sendo que moram numa colmeia. Deve ser difícil para ele não ter amigo da mesma espécie.\n\nQuem sabe tu não encontra amigos para ele? Não podem ser criaturas assustadoras, por certo, mas talvez aqueles escaravelhozinhos sirvam-lhe de companhia.\n\nO que acha?', '', '', '', '', '', '', 33528),
(58817, 'ptBR', 'Bonequinhos', 'Colete $1oa Estatuetas Amatet de criaturas Amatet em Uldum.', 'Ocorreu-me que nossa larva vem levando uma vidinha assaz tediosa. O bichinho precisa divertir-se.\n\nAfinal, larva feliz é larva saudável!\n\nAcho que os Amatet têm estatuetas usadas para adorar os deuses. Darão ótimos bonequinhos para o nosso camaradinha. Tenta conseguir algumas!', '', '', '', '', '', '', 33528),
(58813, 'ptBR', 'Filés fétidos', 'Recolha $1oa peças de Carne Corrompida das criaturas que estão nas áreas sob ataque dos lacaios de N\'Zoth.', 'Eu tive uma ideia: já que esse bicho tem energia do caos, talvez ele prefira uma alimentação... mais corrompida.\n\nEu estava pensando nos lacaios de N\'Zoth, é lógico.\n\nÉ só um palpite, mas não custa tentar.', '', '', '', '', '', '', 33528),
(58812, 'ptBR', 'Carnes alternativas', 'Colete $1oa peças de Carne de Insetoide dos Aqir, Mantídeos ou outros insetos em Uldum ou no Vale das Flores Eternas.', 'Na natureza é muito comum os insetos comerem outros da sua espécie. Será que é o caso do nosso aqir?\n\nPoderias tu trazer carne de aqir ou de mantídeo? Veremos se é mais palatável para o nosso camaradinha.', '', '', '', '', '', '', 33528),
(58811, 'ptBR', 'Uma dieta balanceada', 'Recolha $1oa Nacos de Carne de animais de Uldum e do Vale das Flores Eternas.', 'Agora que a larva nasceu, temos que descobrir o que dar de comer para ela crescer bem forte. \n\nTudo indica que os aqir são carnívoros, mas a única coisa que já os vimos comer foi... bom... nós.\n\nDecerto não podemos alimentar nosso camaradinha com gente. Teremos que achar alternativa. E se substituirmos por carne de animais?', '', '', '', '', '', '', 33528),
(58810, 'ptBR', 'O ovo ou o aqir', 'Veja o Ovo de Aqir chocar em Ramkahen.', 'Parece que o ovo já vai chocar! Não é tudo?\n\nVenha cá, vamos dar as boas-vindas ao nosso camaradinha.', '', '', '', '', '', '', 33528),
(58809, 'ptBR', 'Uma técnica chocante', 'Recolha $1oa Peças de Para-raio no Vale das Flores Eternas.', 'Ouvi histórias de que os mogus usariam raios para acelerar o crescimento das serpentes das nuvens. Será que o mesmo princípio se aplicaria ao nosso camaradinha aqir?\n\nHaverá apenas um jeito de descobrir! Vê no Vale das Flores Eternas se consegues as peças para criar um para-raio. \n\nSe eles forem iguais às serpentes das nuvens, o ovo chocará bem mais rápido.', '', '', '', '', '', '', 33528),
(58808, 'ptBR', 'Câmara de âmbar', 'Marque uma Incubadora de Âmbar para que H\'partho a transporte pelo ar até o Vale das Flores Eternas.', 'Sabes quem saberia como incubar esse ovo? Os mantídeos!\n\nO problema é que eles estão ocupados demais tentando matar-nos para compartilhar seus conhecimentos, mas certamente haverá outro jeito de beneficiarmo-nos desse conhecimento!\n\nTalvez tenhamos como apropriarmo-nos de uma câmara de incubação. Isso acelerará o processo, sem dúvida!\n\nSe puderes encontrar e marcar-me um deles, eu poderia tirá-lo de lá por via aérea.', '', '', '', '', '', '', 33528),
(58807, 'ptBR', 'Na teia do aqir', 'Colete $1oa Teias de Aqir de aqir lançadores em Uldum.', 'Um fato curioso que observei é a ausência, neste ovo, da teia protetora que se encontra a torto e a direito nas colmeias aqir. \n\nCreio que ela possua qualidades protetoras, de forma que nosso ovo beneficiar-se-ia de tal teia.\n\nSeria formidável se pudesses, em tuas incursões de combate aos insetos, procurar a famigerada teia para que criemos um casulo adequado ao nosso ovo.', '', '', '', '', '', '', 33528),
(58806, 'ptBR', 'O calor do Sol', 'Obtenha um Coletor Solar Amatet em Uldum', 'As noites desérticas em Uldum podem ser muito frias. Temo que nosso ovinho não seja páreo para tais temperaturas enregelantes.\n\nSoube que os Amatet do leste lograram êxito em canalizar a energia solar. Se usarmos a sabedoria deles, podemos aquecer o ovo.\n\nConvém ficar de olhos bem abertos para o caso de veres algo que nos possa ser útil.', '', '', '', '', '', '', 33528),
(58805, 'ptBR', 'Incubação prolongada', 'Obtenha $1oa Caos Cristalizados em áreas atacadas pelas forças de N\'Zoth.', 'O ovo está vingando, mas careço de mais cristais de caos para zelar pela saúde dele.\n\nPodes buscar mais?', '', '', '', '', '', '', 33528),
(58804, 'ptBR', 'Incubação caótica', 'Obtenha $1oa Caos Cristalizados em áreas atacadas pelas forças de N\'Zoth.', 'O que posso dizer-te com certeza é que este ovo carece de uma quantidade imensa de energia caótica para vingar. \n\nÉ muito conveniente para nós que um Deus Antigo esteja atacando Azeroth neste exato momento, não?\n\nNão? Oh...\n\nDe todo modo, onde quer que os lacaios de N\'Zoth ataquem, lá haverá energia caótica em abundância. Vai e traz um pouco.', '', '', '', '', '', '', 33528),
(58803, 'ptBR', 'Pisando em ovos', 'Investigue $1oa Ovos Maculados pelo Caos em Uldum.', 'Não temas, nenhum mal advirá da eclosão do ovo. Afinal, a perfídia não há de ser inata aos aqir, sim?\n\nReconheço, contudo, que o cuidado adequado a tal tipo de ovo nos é estranho, de modo que cabe a ti investigar.\n\nVolta à colmeia aqir e procura outros ovos da mesma natureza. Observa o trato que recebem, para que possamos fazer o mesmo aqui.', '', '', '', '', '', '', 33528),
(58802, 'ptBR', 'O ovo incrível', 'Leve o Ovo Maculado pelo Caos para H\'partho Ardoros, em Ramkahen.', '<Parece que os aqir estão energizando este ovo com magia do caos.\n\nParece ainda estar longe de eclodir, então ainda deve dar tempo de tentar descobrir o que eles estão tramando. \n\nAlguém na Liga dos Exploradores pode se interessar.>', '', '', '', '', '', '', 33528),
(58801, 'ptBR', 'Entrar no caos', 'Sem morrer ou deixar a forma de Aparição do Caos, sacrifique 10 jogadores a N\'Zoth.', '<À medida que você se aproxima do ídolo, os estilhaços sombrios parecem derreter em suas mãos. Você é imediatamente tomad$Go:a; por uma angústia indizível, mas ela rapidamente cede lugar a um sentimento de alegria, serenidade e a um imperioso... desejo de matar.\n\nUma voz sibilante penetra em sua mente.>\n\n$gMeu servo:Minha serva; fiel. Vou conceder a você apenas uma pequena amostra do meu poder inimaginável, tudo o que peço de volta é uma tarefa simples. Mate todos que se opuserem a mim, não poupe ninguém. Não me decepcione...', '', '', '', '', '', '', 33528),
(58782, 'ptBR', 'O que ficou para trás', 'Obtenha $1oa Suprimentos Errantes nos Depósitos Infestados, em Uldum.', 'Por causa dos invasores aqir, muitos Errantes tiveram que abandonar com pressa nossos assentamentos em Uldum, deixando muita coisa para trás.\n\nSoube que você vai atacar as feras. Pode também ficar de olho para ver se acha os nossos suprimentos? \n\nVocê pode ficar com o que quiser, é claro.', '', '', '', '', '', '', 33528),
(58781, 'ptBR', 'Terrores das profundezas', 'Derrote 3 inimigos Aqir raros em Uldum.', 'A cada dia, os Aqir são uma ameaça maior aos Errantes, mas dizem que, com eles, emergiram terrores ainda maiores.\n\nTemos bons guerreiros, mas temo o que pode acontecer caso um desses terrores antigos se abata sobre nós. \n\nSei que você tem experiência em lidar com inimigos grandes e gostaria que você usasse suas habilidades para nos ajudar. \n\nAfinal, não temos como proteger a forja se formos dizimados por um monstro gigantesco das profundezas.', '', '', '', '', '', '', 33528),
(58780, 'ptBR', 'Arautos da colmeia', 'Mate $1oa Dominadores Aqir em Uldum.', 'Parece que os aqir que atacaram nosso acampamento são, no geral, tropas de choque, mas nossos batedores foram além das linhas deles e avistaram um tipo diferente de inimigo — criaturas altas e magras que usavam magia caótica perigosa.\n\nAlgo me diz que são a liderança por trás dessa invasão. Essas criaturas agora são alvos de oportunidade e deve ser abatidas sempre que houver chance.\n\nVocê está à altura da tarefa?', '', '', '', '', '', '', 33528),
(58779, 'ptBR', 'Céu limpo', 'Mate $1oa Aqir voadores em Uldum.', 'Seria bom mandar decolar uns voadores pra combater os aqir, mas é quase impossível voltar ao Obelisco do Sol com tanto inseto no ar.\n\nSe a gente quiser superioridade aérea, acho que vamos ter quer desfalcar as forças deles daqui do chão mesmo.\n\nPosso contar com você?', '', '', '', '', '', '', 33528),
(58778, 'ptBR', 'Vê se não perde a cabeça', 'Obtenha $1oa Troféu de Golias de Golias Aqir em Uldum.', 'A moral anda meio em baixa no acampamento. Estar cercado de insetos carnívoros faz isso com as pessoas.\n\nMas eu tenho uma ideia para animar o pessoal. Precisamos de um troféu!\n\nTraz pra mim a cabeça de um daqueles bichos maiorzões pra gente deixar bem à mostra. Aí esses insetos vão ver que a gente não tá pra brincadeira! Só cuidado pra não danificar muito a cabeça, hein?', '', '', '', '', '', '', 33528),
(58777, 'ptBR', 'Pisa no inimigo', 'Esmague $1oa Larvas de Aqir em Uldum.', '<Enquanto você se aproxima, Zahra pisoteia uma criatura larviforme>.\n\nTá vendo isso? Pode não parecer grande coisa, mas aqueles insetos surgem a partir dessas larvas aí.\n\nElas estão em todos os lugares conquistados pelos aqir, comendo nossos mortos e virando aquelas bestialidades.\n\nSe passar por essas larvas, faça um favor ao mundo e pisoteie todas elas sem dó.', '', '', '', '', '', '', 33528),
(58776, 'ptBR', 'Ovos fritos', 'Destrua $1oa Aglomerados de Ovos de Aqir em Uldum.', 'Não estamos conseguindo dar conta da multiplicação dos aqir. Se continuar assim, logo os números deles vão superar os nossos.\n\nO único jeito de conter a investida deles é atacar as colmeias e destruir os ovos, mas ainda não tivemos sucesso nessa empreitada.\n\nÉ por isso que eu gostaria de contar com os seus serviços.\n\nPode ajudar?', '', '', '', '', '', '', 33528),
(58765, 'ptBR', 'Rompe-cerco', 'Sabote $1oa Carroças de Guerra Vil\'thik no Vale das Flores Eternas.', 'Não há dúvida que o Lótus Dourado é capaz de bater de frente com os guerreiros mantídeos. Já as carroças de guerra deles... elas podem dizimar um esquadrão inteiro em uma única salva contra nossos guerreiros.\n\nPara conservar nossa vantagem nesse batalha, precisamos de alguém que se infiltre no território deles e sabote as máquinas de cerco.\n\nQuero que você seja esse alguém.', '', '', '', '', '', '', 33528),
(58764, 'ptBR', 'Estandartes do enxame', 'Queime $1oa Estandartes Zara\'thik no Vale das Flores Eternas.', 'Esses mantídeos descarados acham que já venceram. Já estão exibindo seus estandartes pelo Espinhaço da Serpente, proclamando sua dominância.\n\nEstá na hora de aprenderem que Pandária pertence aos pandarens.\n\nQueime todos os estandartes.', '', '', '', '', '', '', 33528),
(58763, 'ptBR', 'Produção suspensa', 'Destrua $1oa Recipientes de Âmbar no Vale das Flores Eternas.', 'Os mantídeos usam âmbar em todos os aspectos da vida, desde as estruturas que habitam até as armas que usam. Eu, é claro, me interesso mais pelas armas.\n\nSe a gente tirar a matéria-prima deles, estaremos impedindo o inimigo de criar artefatos de guerra.\n\nDescubra onde eles guardam o âmbar e inutilize tudo.', '', '', '', '', '', '', 33528),
(58762, 'ptBR', 'Levados pelo enxame', 'Liberte $1oa prisioneiros do Lótus Dourado nas Jaulas de Âmbar Endurecido, no Vale das Flores Eternas.', 'Tem algo diferente nesse enxame de mantídeos. Em vez de destruir tudo à volta como eles costumam fazer, esses mantídeos estão capturando nossos defensores com vida.\n\nNão sei e nem quero saber o que planejam fazer com eles. \n\nSe você for lá resgatar os prisioneiros, não teremos que esperar para ver.', '', '', '', '', '', '', 33528),
(58761, 'ptBR', 'Pisando em larvas', 'Esmague $1oa Larvas Vil\'thik no Vale das Flores Eternas.', 'Os mantídeos costumavam guardar seus filhotes em uma incubadora até que eles estivessem prontos para serem testados no enxame. \n\nMas os Vil\'thik são descuidados e deixam suas larvas ao relento.\n\nNão seria uma pena se alguém fosse lá e esmagasse todas elas?\n\nEu acho que não.', '', '', '', '', '', '', 33528),
(58760, 'ptBR', 'Lâminas de âmbar', 'Obtenha $1oa Lâminas de Âmbar dos mantídeos Vil\'thik, no Vale das Flores Eternas.', 'Mantídeos são frágeis e são derrotados com facilidade, mas usam lâminas de âmbar bem formidáveis.\n\nCom um pouquinho de trabalho, posso adaptá-las para os mogus usarem.\n\nMe traga umas lâminas e vou dar um jeito de criar armas a serviço dos Rajani.', '', '', '', '', '', '', 33528),
(58759, 'ptBR', 'A guarda da imperatriz', 'Mate $1oa mantídeos Zara\'thik no Vale das Flores Eternas.', 'Os Zara\'thik são a guarda de elite da imperatriz. Eles se fortalecem com a azerita roubada e não vão parar até conquistarem toda a Pandária.\n\nSe permitirmos que passem do espinhaço da Serpente, o Lótus Dourado não vai dar conta.\n\nVocê tem que contê-los na muralha, $c.', '', '', '', '', '', '', 33528),
(58758, 'ptBR', 'Destruição descontrolada', 'Mate $1oa Destruidores Kunchongs no Vale das Flores Eternas.', 'A lembrança do último enxame mantídeo ainda está bem fresca na memória do Lótus Dourado. Antes do avanço do enxame, os mantídeos mandavam seus imensos kunchongs para amaciar as linhas defensivas.\n\nParece que essa tática não mudou.\n\nTemos que segurar aqueles kunchongs para dar ao Lótus Dourado uma chance de armar a defesa contra o enxame. Estou contando com você.', '', '', '', '', '', '', 33528),
(58757, 'ptBR', 'O teste das crias', 'Mate $1oa Enxameadores Vil\'thik no Vale das Flores Eternas.', 'Em seus ataques, os mantídeos juntam os mais novos em grandes grupos e mandam-nos enfrentar o inimigo, para testar suas crias. Quem sobrevive pode se juntar ao enxame como verdadeiro guerreiro mantídeo.\n\nTemos que fazer de tudo para que eles não passem no teste.', '', '', '', '', '', '', 33528),
(58756, 'ptBR', 'Artesãos nefastos', 'Mate $1oa Magiâmbares Mantídeos no Vale das Flores Eternas.', 'Os magiâmbares são uma das castas mais altas na sociedade mantídea. Eles moldam e dobram o âmbar usando magia, recuperando as forças mantídeas com mais rapidez após a batalha.\n\nSão alvos estratégicos que nós devemos priorizar. \n\nNão quer se juntar a nós?', '', '', '', '', '', '', 33528),
(58755, 'ptBR', 'Suprimentos escondidos', 'Obtenha $1oa Suprimentos do Lótus Dourado em Depósitos Ambáricos, no Vale das Flores Eternas.', 'Os mantídeos invasores têm tomado os suprimentos do Lótus Dourado. Devem estar tentando nos fazer passar fome.\n\nE é isso mesmo o que vai acontecer se não conseguirmos recuperar alguns mantimentos. \n\nQuando você for atacar o enxame, fique de olho vivo para o caso de topar com nossos suprimentos. Se você recuperar alguma coisa, fará um grande favor ao Lótus Dourado.', '', '', '', '', '', '', 33528),
(58754, 'ptBR', 'Campeões do enxame', 'Derrote 3 inimigos mantídeos raros no Vale das Flores Eternas.', 'Fica claro que Shek\'zara está muito comprometida com a invasão. Nossos batedores viram alguns campeões dela no campo de batalha.\n\nUm único mantídeo já seria demais para os soldados do Lótus Dourado, então nós é que temos que caçar essas feras e dar cabo delas.\n\nEstá dentro?', '', '', '', '', '', '', 33528),
(58749, 'ptBR', 'O voo do Vil\'thik', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58748, 'ptBR', 'Estátuas vivas são duras na queda', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58747, 'ptBR', 'Cosquinha no cérebro', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58746, 'ptBR', 'Loucurinha', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58745, 'ptBR', 'Cuidado onde pisa', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58744, 'ptBR', 'Eu sou aquele que sussurra', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58743, 'ptBR', 'Dano danado na duna', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58742, 'ptBR', 'Retinus, o Obstinado', 'Derrote Grixis Espoquito em uma batalha de mascotes.', '', '', '', '', '', '', '', 33528),
(58741, 'ptBR', 'Em pedra dura', 'Obtenha $1oa Armamentos Mogus no Vale das Flores Eternas.', 'Um dos problemas de lutar com outros mogus é que, contra inimigos de pedra e de metal, as armas se embotam e se quebram muito rápido. \n\nComo único ferreiro dentre os Rajani, às vezes é difícil suprir todas as necessidades dos nossos guerreiros.\n\nQuando lutar contra os mogus, se por acaso você encontrar alguma arma, seria de grande valia para mim.', '', '', '', '', '', '', 33528),
(58740, 'ptBR', 'Serpentes subjugadas', 'Mate $1oa Serpentes-guerreiras de Ônix no Vale das Flores Eternas.', 'Aonde os Zan-Tien vão, as serpentes-guerreiras vão atrás.\n\nNão tenho nem palavras para dizer como essas feras são perigosas. É uma pena ver esses bichos subjugados pelos mogus, mas não podemos deixar barato.\n\nPreciso que você acabe com as serpentes antes que elas criem o caos nas nossas linhas.', '', '', '', '', '', '', 33528),
(58737, 'ptBR', 'As descobertas de Magni', 'Informe-se sobre as descobertas de Magni.', 'O conserto da Forja já foi um baita avanço, mas acho que encontramos nos arquivos das Galerias Mogu\'shan o jeito de derribar N\'Zoth de uma vez por todas!\n\nÉ melhor se abancar pra ouvir essa, campe$Gão:ã;.', '', '', '', '', '', '', 33528),
(58708, 'ptBR', 'Em busca de autognomia', 'Fale com o Mestre-faz-tudo Superchispa em Boralus.', 'O Mestre-faz-tudo Superchispa solicita sua assistência em uma importante expedição de pesquisa. \n\nTrabalhar com o estimado Mestre-faz-tudo certamente será bom para sua carreira. Para a minha, pelo menos, foi ótimo!', '', '', '', '', '', '', 33528),
(58705, 'ptBR', 'Grã-imperatriz Shek\'zara', '', '', '', '', '', '', '', '', 33528),
(58679, 'ptBR', 'Destruidor Adormecido', '', '', '', '', '', '', '', '', 33528),
(58675, 'ptBR', 'O preço da paz', 'Ouça o discurso do Rei Wrynn.', 'O rei vai nos transmitir as notícias de sua missão diplomática na Horda daqui a pouco.\n\nOs demais líderes da Aliança já chegaram. Decerto estão ansiosos para ouvir o que o Rei Wrynn tem a dizer.\n\nFale comigo quando estiver pront$go:a;, e nós vamos encontrar o rei juntos.', '', '', '', '', '', '', 33528),
(58674, 'ptBR', 'Uma reunião de campeões', 'Fale com o Mestre Mathias Shaw em Ventobravo.', 'O Rei Wrynn convocou uma audiência com os líderes da Aliança em Ventobravo.\n\nSua presença foi solicitada na reunião. Ela vai acontecer na embaixada.\n\nMe procure assim que chegar a Ventobravo, eu estarei esperando com o resto do pessoal.\n\nAnde logo, $n. Não é de bom tom deixar o rei esperando...', '', '', '', '', '', '', 33528),
(58673, 'ptBR', 'Chefe Guerreiro da Horda', 'Contemple a reunião dos campões.', 'A reunião para decidir quem será o próximo Chefe Guerreiro da Horda está prestes a começar.\n\nOs demais líderes da Horda já chegaram e aguardam você na embaixada.\n\nFale comigo quando estiver pront$Go:a;, e nós vamos encontrá-los juntos.', '', '', '', '', '', '', 33528),
(58672, 'ptBR', 'Um reunião de campeões', 'Fale com Valira Sanguinar em Orgrimmar.', 'Os líderes da Horda se reuniram em Orgrimmar para nomear seu novo Chefe Guerreiro.\n\nVocê é $Gum herói:uma heroína; na Horda, e sua presença foi solicitada na reunião. Ela vai acontecer na embaixada de Orgrimmar.\n\nEu vou na frente. Me procure assim que chegar a Orgrimmar, eu estarei esperando com o resto do pessoal.\n\nAnde logo, campe$Gão:ã;. O futuro da Horda está prestes a ser decidido.', '', '', '', '', '', '', 33528),
(58667, 'ptBR', 'Extração de Obsidiana', '', '', '', '', '', '', '', '', 33528),
(58662, 'ptBR', 'Terrores entocados', '', '', '', '', '', '', '', '', 33528),
(58661, 'ptBR', 'Terrores entocados', '', '', '', '', '', '', '', '', 33528),
(58660, 'ptBR', 'Terrores entocados', '', '', '', '', '', '', '', '', 33528),
(58646, 'ptBR', 'Engole essa!', 'Mate $1oa Corredunas de Rapina em Uldum.', 'Essas hienas esganadas metem tudo que encontram na boca, até os artefatos mais preciosos!\n\nNão podemos deixar esses cuscos acabarem com a história de Uldum!\n\nTu vai ter que matar um bocado desses bichos.', '', '', '', '', '', '', 33528),
(58645, 'ptBR', 'Um mundo digno de salvação', 'Impeça os Amatet de tomar os Salões Primordiais.', 'Não conseguimos detê-los. Aqueles guerreiros... encobertos pelos raios do sol...\n\nEles querem a forja... para pôr fim em tudo...\n\nAndem logo... eu me viro...', '', '', '', '', '', '', 33528),
(58643, 'ptBR', 'Destruição mútua assegurada', 'Alerte os defensores dos Salões Primordiais dos planos dos Amatet.', 'Os Amatet foram retomar a Forja Primordial a fim de exterminar toda a vida da face de Azeroth, com ou sem Deus Antigo! \n\nPodem atacar a qualquer momento. Temos que alertar os defensores da Forja!', '', '', '', '', '', '', 33528),
(58642, 'ptBR', 'Objetivos compartilhados', 'Defenda a Alta-exploradora Dellorah enquanto ela decifra as Tabuletas Amatet na Câmara das Estrelas.', 'O decreto que tu encontrou mencionava um plano para voltear os Deuses Antigos. \n\nAcho difícil os Amatet cooperarem com a gente pra atingir esse objetivo, mas se eles têm um plano para derribar N\'Zoth, acho que vale a pena conferir.\n\nO decreto falava de um tal Engenho da Ascensão. Deve ser o nome daquela fonte de energia solar que nós vimos. Vamos dar uma espiada para ver se descobrimos o que eles estão planejando!', '', '', '', '', '', '', 33528),
(58641, 'ptBR', 'Caçadores de corrupção', 'Recolha o Decreto do Rei Sol dos Amatet Tocados pelo Sol em Uldum.', 'Se tem alguém que vai saber mais sobre a \"corrupção\" de que falava a tabuleta, são os Tocados pelo Sol que foram encarregados de cortá-la pela raiz.\n\nMas duvido muito que liberem essas informações de boa vontade.\n\nMas bah, não é tu $go:a; especialista em investigar na base da força bruta?', '', '', '', '', '', '', 33528),
(58640, 'ptBR', 'Uma rachadura na armadura', 'Defenda a Alta-exploradora Dellorah enquanto ela decifra o Monumento Amatet em frente aos Salões Primordiais.', 'Os artefatos que você ajudou a escavar mostram que proteger a obra dos titãs era motivo de orgulho na tribo dos Amatet. \n\nAlém de confirmar nossas hipóteses, é um indício de que algo drástico deve ter acontecido para levá-los a danificar a mesma obra que haviam jurado proteger.\n\nTemos que ir atrás de mais inscrições. Acho que vi um monumento mais recente em frente aos Salões Primordiais.', '', '', '', '', '', '', 33528),
(58639, 'ptBR', 'História enterrada', 'Desenterre e recolha $1oa Artefatos Amatet em Uldum.', 'Mas bah, se os Amatet vieram dessas plagas, o mais lógico é que os artefatos da civilização deles tenham ficado por aqui, soterrados pela areia.\n\nO jeito vai ser apostar na boa e velha escavação!\n\nAs dunas nessa região devem ter encoberto uma larga faixa do antigo território dos Amatet. Vamos ver se conseguimos desenterrar alguma coisita daqui!', '', '', '', '', '', '', 33528),
(58638, 'ptBR', 'Um mergulho profundo', 'Defenda a Alta-exploradora Dellorah enquanto ela decifra o Monumento Amatet no Terraço da Pedra Solar.', 'Alguma coisa não bate nessa história dos Amatet. Por que cargas d\'água os protetores das obras titânicas atacariam e danificariam a Forja Primordial?\n\nVamos dar uma olhada nisso. Acho que vi um monumento naquele terraço. Vai ver as inscrições nos dizem alguma coisa sobre os tais Tol\'vir.', '', '', '', '', '', '', 33528),
(58636, 'ptBR', 'De olho nos Amatet', 'Faça o reconhecimento do território Amatet com a Alta-exploradora Dellorah em Uldum.', 'Em nome da Liga dos Exploradores, eu gostaria de dizer gracias por fechar o Acordo de Uldum e conseguir um pouquinho de cooperação por parte dos Ramkahen.\n\nNo intuito de compreender melhor nossos adversários, eles nos permitiram explorar as tumbas dos Amatet. Infelizmente, o exército deles está desfalcado demais para cuidar da nossa proteção.\n\nPensei em ti para fazer isso. \n\nTu tem um tempinho pra espiar a situação? Podemos empeçar com uma visão aérea.', '', '', '', '', '', '', 33528),
(58634, 'ptBR', 'A abertura do portal', 'Fale com a M.A.D.R.E. para abrir o Portal Tenebroso na Câmara do Coração.', 'O tecido da realidade se rasgou... mas isso tu já sabe, $n. Tu viu com os próprios olhos. \n\nÉ só questão de tempo pra essas duas realidades se tornarem uma só, sob o véu da escuridão infinda. Em vez de a gente se esconder, talvez seja o caso de pelejar com a escuridão de frente.\n\nCom a ajuda do nosso camarada titânico, vamos furar o tecido da outra dimensão com uma agulha, criando uma ponte, por assim dizer.\n\nQue jeito melhor de descobrir as fraquezas do inimigo do que descobrindo suas intenções?', '', '', '', '', '', '', 33528),
(58632, 'ptBR', 'Ny\'alotha, a Cidade Desperta: o fim do Corruptor', 'Derrote N\'Zoth em Ny\'alotha, a Cidade Desperta.', 'Com a pesquisa dos mogus, a M.A.D.R.E. e Ra-den descobriram um jeito de executar o Protocolo Primordial da forja na Câmara do Coração. Só faltava saber onde disparar.\n\nMas agora não falta nada, tchê.\n\nPegue as âncoras e atravesse o portal. Enquanto tu procura os pontos certos pra deixar as âncoras, nós vamos preparar a arma. Quando elas estiverem de jeito, nós estaremos prontos pra disparar.\n\nTu só vai ter uma chance. Não vai desperdiçar!', '', '', '', '', '', '', 33528),
(58631, 'ptBR', 'Sonho adentro', 'Fale com a M.A.D.R.E. na Câmara do Coração para rastrear Ra-den.', 'Não acredito que Ra-den se sacrificou pra salvar a gente. Não podemos desistir dele!\n\nTem que ter um jeito de descobrir pra onde ele foi. \n\nVamos ver se a M.A.D.R.E. consegue localizar o sujeito!', '', '', '', '', '', '', 33528),
(58615, 'ptBR', 'Sussurros no escuro', 'Descubra de onde vêm os sussurros de N\'Zoth na Câmara do Coração.', 'Tu ouviu isso? Mas que bicheira!\n\nSe N\'Zoth ganhar acesso à câmara, a gente tá mais ferrado que casco de alazão! \n\nTemos que descobrir por onde ele vem entrando e fechar à sete chaves, antes que ele passe dos sussurros pra coisa pior!', '', '', '', '', '', '', 33528),
(58606, 'ptBR', 'Investigação de miudezas', 'Recolha $1oa Miúdos de Aqir.', '$p, essa pode ser a descoberta da sua vida!\n\nNão tenho como dar certeza, mas suspeito que esses insetos sejam os chamados aqir.\n\nAinda constam alguns registros intactos na Liga: a última menção dessas criaturas foi na grande guerra travada entre os C\'Thraxxi, os aqir e as primeiras civilizações trólicas.\n\nNós deduzimos que eles tinham sido extintos, mas pelo jeito eles estavam só... se reerguendo.\n\nVocê pode recolher algumas amostras para eu examinar?', '', '', '', '', '', '', 33528),
(58595, 'ptBR', 'Pilares do oblívio', 'Destrua $1oa Obeliscos do Império Negro no Vale das Flores Eternas.', 'Eras atrás, o obelisco negro dos Deuses Antigos anunciava a vinda das forças deles. Os conjuradores sombrios dos K\'thir e N\'raqi usavam esses monumentos para ganhar terreno em nosso mundo e trazer anda mais lacaio dos Deuses Antigos.\n\nHoje, esses mesmos obeliscos atulham os campos de batalha. Enquanto estiverem de pé, não haverá fim para as forças de N\'Zoth.\n\nResolva essa situação.', '', '', '', '', '', '', 33528),
(58583, 'ptBR', 'É onde fica o coração', 'Encontre-se com Magni Barbabronze na Câmara do Coração.', 'O Mensageiro pediu que eu mandasse você ir ajudar ele e Wrathion.\n\nVocê se mostrou $Gum grande aliado:uma grande aliada; de Azeroth, e suspeito que vá desempenhar um papel importante nas batalhas que estão por vir.\n\nTomara que o resto da Horda e da Aliança consiga pôr as picuinhas de lado para enfrentar um inimigo em comum.', '', '', '', '', '', '', 33528),
(58582, 'ptBR', 'A volta ao Príncipe Negro', 'Fale com Valira Sanguinar no Grande Selo, em Dazar\'alor.', 'Acabei de voltar da reunião com o Rei Wrynn em Ventobravo.\n\nNós temos muito o que discutir.\n\nMe encontre no Grande Selo sem demora.', '', '', '', '', '', '', 33528),
(58506, 'ptBR', 'Diagnóstico de rede', 'Acione os Consoles Titânicos na Câmara do Coração para verificar o status das forjas titânicas espalhadas por Azeroth.', 'Infelizmente, não fazemos ideia de onde N\'Zoth se meteu desde que escapou. Por outro lado, temos uma noção de onde ele pode atacar.\n\nNa época em que os guardiões aprisionaram os Deuses Antigos, eles armaram mecanismos de defesa contra a corrupção nas forjas titânicas. Se quiser corromper Azeroth, N\'Zoth vai ter que passar pelas defesas primeiro.\n\nPor sorte, nós já estamos conectados a elas e podemos monitorar tudo daqui. Vai na frente dar uma olhada.', '', '', '', '', '', '', 33528),
(58502, 'ptBR', 'É onde fica o coração', 'Volte à Câmara do Coração.', 'É hora de botar o plano de Wrathion adelante. \n\nEle vai voltar pra Câmara do Coração, vamos encontrar ele lá.', '', '', '', '', '', '', 33528),
(58498, 'ptBR', 'O retorno do rei guerreiro', 'Acompanhe Anduin e recolha o Quebra-medo na Bastilha Ventobravo.', 'Tu já fez muito por Azeroth, $Gherói:heroína;, mas infelizmente vou ter que te pedir um pouquinho mais. N\'Zoth está à solta, e ninguém sabe quando ou onde ele vai atacar.\n\nEssa peleja, não dá pra encarar solito. Quando chegar a hora, tu vai ter meu martelo do teu lado!\n\nMas antes vamos ter que buscar ele.', '', '', '', '', '', '', 33528),
(58496, 'ptBR', 'Um conselheiro indesejado', 'Fale com o Rei Anduin Wrynn na Bastilha Ventobravo.', 'Mesmo as forças da Horda e da Aliança trabalhando juntas, ainda não achamos nenhum traço dos exércitos de N\'Zoth. Desde que foi libertado, o Deus Antigo vem nos ludibriando.\n\nSó a Luz sabe o que ele reserva para Azeroth.\n\nMe encontre na Bastilha Ventobravo. Temos que traçar um plano para acabar com os ardis de N\'Zoth antes que seja tarde!', '', '', '', '', '', '', 33528),
(58487, 'ptBR', 'Ladrão que rouba ladrão', 'Saqueie $1oa Butins Mogus no Vale das Flores Eternas.', 'Nossas incursões no tesouro de Lei Shen contribuíram para a queda do Rei Trovão. A gente tem que adotar a mesma estratégia agora.\n\nEncontre o butim que os mogus pilharam e tome-o. \n\nTemos que fazer tudo ao nosso alcance para impedir o avanço deles.', '', '', '', '', '', '', 33528),
(58485, 'ptBR', 'Iconoclasta', 'Destrua $1oa Estátuas Mogus no Vale das Flores Eternas.', 'Os Baruk usam as artes proibidas da necromancia para aprisionar almas dos mogus derrotados em estátuas que, então, passam a lutar por eles. \n\nTemos que pôr um fim a essa tática que é uma desonra para o nosso povo.\n\nQuebre as preciosas estátuas deles para que não tenham mais onde guardar os espíritos roubados.', '', '', '', '', '', '', 33528),
(58481, 'ptBR', 'Rituais de sangue', 'Destrua $1oa Fontes de Sangue no Vale das Flores Eternas.', 'Como Anji e eu já lutamos muitas batalhas, conseguimos lidar com alguns mogus, mas a magia de sangue que esses Dokani usam é sinistra demais!\n\nNão bastasse sair matando quem entrar no caminho deles, agora estão usando cadáveres para alimentar seus rituais profanos? É demais para mim!\n\nMe faz um favor, se você topar com esses rituais, acabe com eles! Nem nossos inimigos merecem ser conspurcados pela magia negra deles.', '', '', '', '', '', '', 33528),
(58479, 'ptBR', 'Parem os para-raios!', 'Destrua $1oa Para-raios no Vale das Flores Eternas.', 'Os Zan-Tien alegam dominar o poder das tempestades, mas recorrem a máquinas para extrair os raios do céu.\n\nMostre a esses falsários que o verdadeiro poder da tempestade e do trovão tem que vir de dentro. Quebre os brinquedinhos deles e vamos ver como se viram.', '', '', '', '', '', '', 33528),
(58478, 'ptBR', 'Pedra sobre pedra', 'Mate $1oa mogus Baruk no Vale das Flores Eternas.', 'Quando os clãs em guerra vieram para o Vale, os Baruk se acharam dignos das terras ancestrais de Guo-Lai.\n\nPois eles não são.\n\nPonha esses usurpadores no devido lugar e você ganhará algum respeito entre os Rajani.', '', '', '', '', '', '', 33528),
(58477, 'ptBR', 'Em meio ao sangue, à terra e aos ossos', 'Recolha $1oa Glóbulos de Ânima dos mogus Dokani e de seus aliados no Vale das Flores Eternas.', 'Os Dokani acham que são dignos de manipular a magia ancestral da ânima, porém suas manifestações e golens contêm apenas uma reles fração desse poder mágico.\n\nVá confiscar a substância de que eles tanto gostam, os Rajani vão fazer melhor proveito dela.', '', '', '', '', '', '', 33528),
(58476, 'ptBR', 'A convocação do trovão', 'Mate $1oa mogus Zan-Tien no Vale das Flores Eternas.', 'Todos os clãs mogus são formidáveis, não resta dúvida, mas o Zan-Tien é o que apresenta maior perigo ao Lótus Dourado. \n\nNesse exato instante, eles se agrupam diante do Pagode Dourado. Muitos dos nossos guerreiros são jovens e inexperientes. Não vão resistir a um ataque mogu por muito tempo.\n\n$gUm:Uma; $c experiente que nem você pode segurá-los por um bom bocado. \n\nQuer ajudar?', '', '', '', '', '', '', 33528),
(58471, 'ptBR', 'Anotações agressivas', 'Use o Caderno do Andarilho das Lendas para fazer anotações sobre os sem-rosto, os k\'thir e as carníferas no Vale das Flores Eternas.', 'A origem dos Shas está ligada aos Deuses Antigos, mas além disso sabemos muito pouco sobre eles aqui em Pandária.\n\nQuero aproveitar a oportunidade para trazer o máximo de informações possível para o arquivo dos Andarilhos das Lendas. É uma questão um pouco problemática, considerando que estão tentando matar a gente.\n\nMas parece que para você isso não é problema. Você me faria o favor de trazer anotações sobre as coisas que encontrar? Isso pode ajudar bastante a entender contra o que estamos lutando.', '', '', '', '', '', '', 33528),
(58470, 'ptBR', 'Curiosidades corrompidas', 'Obtenha $1oa Artefatos do Império Negro de Depósitos do Império Negro no Vale das Flores Eternas.', 'Entendo que o Império Negro representa uma séria ameaça a Pandária, mas também podemos ver isso como uma oportunidade!\n\nJá os enfrentamos várias vezes, mas pouco sabemos dos Deuses Antigos e de Ny\'alotha, o reino misterioso de N\'Zoth.\n\nAo estudar civilizações antigas, é comum que usemos artefatos para desvendar os mais profundos mistérios perdidos no tempo. Talvez possamos encontrar algum desses artefatos entre as forças do Deus Antigo.\n\nNão custa tentar, não é?', '', '', '', '', '', '', 33528),
(58469, 'ptBR', 'Rasgos no Vale', 'Feche $1oa Rasgos do Caos no Vale das Flores Eternas.', 'Conforme a influência de N\'Zoth se espalha pelo Vale, nossa realidade começa a se fragmentar. \n\nO poder do Deus Antigo criou rasgos no tecido do nosso mundo, permitindo que os lacaios do reino sombrio dele nos invadam.\n\nEnquanto houver rasgos, nunca estaremos livres do jugo de N\'Zoth. Feche todos para conter a maré de corrupção!', '', '', '', '', '', '', 33528),
(58468, 'ptBR', 'Uma escuridão crescente', 'Destrua $1oa Incubadoras Corrompidas na Mina Florescer Perene, que fica no Vale das Flores Eternas.', 'Batedores Shado-Pans acharam evidências de uma nova chocadeira de mantídeos na Mina Florescer Perene. Parece que esses mantídeos da Colmeia-funda querem criar uma prole corrompida para servir a N\'Zoth.\n\nSe os ovos eclodirem, um novo enxame energizado pelo Deus Antigo periga escurecer os céus do Vale e lançar Pandária na escuridão.\n\nNão podemos permitir que isso aconteça, não é?', '', '', '', '', '', '', 33528),
(58467, 'ptBR', 'Prisioneiros de corpo e alma', 'Resgate $1oa pandarens cativos no Vale das Flores Eternas.', 'As forças de N\'Zoth atacaram o Vale de repente. Quando eu e meus Shado-Pans chegamos, muitos do Lótus Dourado já tinham sido capturados pelas forças dos Deuses Antigos.\n\nMesmo unindo forças, tudo que conseguimos foi impedir os invasores de levar mais prisioneiros. Os que já foram capturados, por outro lado, continuam nas garras do Deus Antigo.\n\nEstou ciente das nossas diferenças, $n, mas se você puder nos ajudar a resgatá-los, os Shado-Pans ficarão em dívida com você.', '', '', '', '', '', '', 33528),
(58466, 'ptBR', 'Tormentos do além', 'Liberte $1oa Espíritos Pandarênicos Ancestrais no Vale das Flores Eternas.', 'Não bastasse N\'Zoth querer dominar cada alma viva no Vale, meus batedores relataram que ele agora quer dominar os mortos também!\n\nOs Shado-Pans estão ocupados defendendo os vivos. Podemos contar com você para pôr fim nessa desgraça?', '', '', '', '', '', '', 33528),
(58465, 'ptBR', 'Corrupção manifesta', 'Mate $1oa Icores Pútridos no Vale das Flores Eternas.', 'A corrupção dos Deuses Antigos é tão nefasta que às vezes se manifesta de forma física. \n\nNós já vimos isso no episódio dos Shas. Dessa vez não é diferente.\n\nTrate de expurgar a corrupção que vem se espalhando. Não podemos deixá-la florescer.', '', '', '', '', '', '', 33528),
(58464, 'ptBR', 'Dizimação da Colmeia-funda', 'Destrua $1oa mantídeos da Colmeia-funda na Mina Florescer Perene, que fica no Vale das Flores Eternas.', 'Um secto do enxame mantídeo autodenominado \"Colmeia-funda\" se apossou da Mina Florescer Perene. Esses mantídeos se entregaram totalmente à corrupção dos Deuses Antigos e se tornaram especialmente perigosos.\n\nNão podemos permitir que a Colmeia-funda faça o que quer com o Vale. Faça o que for preciso.', '', '', '', '', '', '', 33528),
(58463, 'ptBR', 'Rebentos da loucura', 'Mate $1oa carníferas no Vale das Flores Eternas.', 'Ver o Vale das Flores Eternas pervertido pelos Deuses Antigos, logo depois de tê-lo visto se recuperar em todo o esplendor depois dos Shas, é de fazer o sangue ferver!\n\nTemos que cortar o mal dos Deuses Antigos pela raiz antes que corrompam tudo. Eu vi as carníferas que acompanham as forças de N\'Zoth, espalhando corrupção por onde passam.\n\nFaça com que elas passem dessa para melhor.', '', '', '', '', '', '', 33528),
(58462, 'ptBR', 'Janelas para a alma', 'Mate $1oa Olhos do Império no Vale das Flores Eternas.', 'Não bastasse o inimigo possuir uma força colossal, seus lacaios atacam nossos soldados bem no fundo do coração.\n\nEstou falando dos olhos, é óbvio. Eles conseguem ver a alma dos nossos guerreiros, fazem eles enfrentarem seus piores medos.\n\nSe quisermos derrotar o adversário, vamos ter que destruí-los.', '', '', '', '', '', '', 33528),
(58461, 'ptBR', 'Tomos da loucura antiga', 'Recolha $1oa Tomos da Loucura Antiga de inimigos K\'thir no Vale das Flores Eternas.', 'São tempos difíceis, todos que moram no Vale têm que fazer a sua parte. Infelizmente, eu nunca levei jeito para briga, não sirvo para muita coisa em tempos de guerra.\n\nMas ainda posso ajudar um pouco. Pense bem, nós não sabemos quase nada sobre os invasores que enfrentamos, e o conhecimento pode ser uma arma poderosíssima.\n\nEu tenho a impressão de ter visto tomos com alguns k\'thir. Se você me trouxer uns tomos, pode ser que eu descubra algo de útil nos textos.', '', '', '', '', '', '', 33528),
(58460, 'ptBR', 'Marechais da loucura', 'Mate $1oa lacaios sem-rosto de N\'Zoth no Vale das Flores Eternas.', 'Há tempos que os n\'raqi servem como comandantes e capatazes nos exércitos dos Deuses Antigos. Sua presença no campo de batalha é prova de que a invasão é um esforço coordenado, e não um surto acidental de corrupção.\n\nLideradas por esses mestres sem-rosto, as forças caóticas dos Deuses Antigos se transformam em um exército mais do que capaz.\n\nEliminar essas criaturas tem que ser nossa prioridade. Só depois disso vamos conseguir ganhar vantagem sobre N\'Zoth.', '', '', '', '', '', '', 33528),
(58458, 'ptBR', 'Desafio de Batalha de Mascotes: Abismo Rocha Negra', 'Detenha os Vultos Sombrios.', 'Aqueles vultos sombrios estão armando outra. Tem certeza de que quer enfrentá-los? Se quiser voltar lá, eu é que não vou segurar você.', '', '', '', '', '', '', 33528),
(58457, 'ptBR', 'Os vultos da Rocha Negra', 'Detenha os Vultos Sombrios.', 'Finalmente conseguimos rastrear aquelas pestes dos vultos sombrios, devem estar todos aí. Parece que eles são um tanto habilidosos, você vai precisar de uma equipe de ponta se quiser ter chance de vitória.\n\nMe avise quando estiver tudo pronto.', '', '', '', '', '', '', 33528),
(58456, 'ptBR', 'Acerto sombrio', 'Encontre-se com o Coronel Cintra na entrada do Abismo Rocha Negra, na Montanha Rocha Negra.', 'Chegou a nossa hora! Nós descobrimos onde os vultos sombrios vêm se escondendo, é hora de confrontá-los e pôr um basta nos seus planos. A base de operações deles fica no Abismo Rocha Negra. Agora é com você.', '', '', '', '', '', '', 33528),
(58455, 'ptBR', 'Acerto sombrio', 'Encontre-se com o Coronel Cintra na entrada do Abismo Rocha Negra, na Montanha Rocha Negra.', 'Chegou a nossa hora! Nós descobrimos onde os vultos sombrios vêm se escondendo, é hora de confrontá-los e pôr um basta nos seus planos. A base de operações deles fica no Abismo Rocha Negra. Agora é com você.', '', '', '', '', '', '', 33528),
