(58439, 'ptBR', 'Gorja devoradora', '', '', '', '', '', '', '', '', 33528),
(58438, 'ptBR', 'Gorja devoradora', '', '', '', '', '', '', '', '', 33528),
(58436, 'ptBR', 'Tradição dos gnomecânicos', 'Fale com o Príncipe Erazmin em Gnomecan.', '$n, nós não poderíamos estar mais contentes com o seu trabalho. Você nos representou bem na Aliança.\n\nVolte para Gnomecan assim que puder. Aren inventou uma coisinha para você.', '', '', '', '', '', '', 33528),
(58435, 'ptBR', 'Tradição dos vulperas', 'Encontre Hagashi no Esconderijo Vulpera, em Vol\'dun.', 'A Horda passou a valorizar muito os vulperas, graças aos seus esforços. \n\nVocê é $Go:a; vulpera mais.. vulperin$Go:a; que eu conheço!\n\nVenha me visitar no Esconderijo Vulpera, em Vol\'dun. Kiro preparou uma pequena recordação em reconhecimento aos seus feitos.', '', '', '', '', '', '', 33528),
(58423, 'ptBR', 'Os mais fortes entre todos', 'Derrote 3 lacaios de N\'Zoth raros no Vale das Flores Eternas.', 'Você demonstrou muita força em suas conquistas, mas o Vale é assolado por novas ameaças todos os dias.\n\nProcure os guerreiros mais fortes dos inimigos e acabe com eles diante dos olhos de seus aliados.', '', '', '', '', '', '', 33528),
(58422, 'ptBR', 'Marca dos conquistadores', 'Queime $1oa Estandartes do Império Negro no Vale das Flores Eternas.', 'Os lacaios invasores de N\'Zoth reivindicaram para si terras que não lhes pertencem. \n\nEnquanto houver um Rajani vivo, o Vale não vai ser conquistado.\n\nQueimem os estandartes para que os invasores se lembrem disso.', '', '', '', '', '', '', 33528),
(58420, 'ptBR', 'Um incômodo sórdido', 'Mate $1oa hozens Rabo-de-lula no Vale das Flores Eternas.', 'Os hozens são fracos e oportunistas. Não me surpreende que alguns deles tenham apostado tudo nos Deuses Antigos.\n\nPrecisamos dar um jeito neles antes que passem de incômodo a ameaça.', '', '', '', '', '', '', 33528),
(58375, 'ptBR', 'Ny\'alotha: proteção da M.A.D.R.E.', 'Colete 4 Núcleos Titânicos de Ra-den, 4 Corações de Dragão de Vexiona e 4 Olhos Proféticos de Il\'gynoth em Ny\'alotha, a Cidade Desperta, em modo Mítico.', 'Ny\'alotha não obedece às regras do espaço-tempo, e talvez possamos usar isso a nosso favor.\n\nSegundo a M.A.D.R.E., se obtivermos determinados objetos escolhidos por N\'Zoth, poderemos usá-los para torcer o espaço e agilizar nossa passagem aqui no futuro. O problema é que eles não vão abrir mão desses itens facilmente.', '', '', '', '', '', '', 33528),
(58374, 'ptBR', 'Ny\'alotha: proteção da M.A.D.R.E.', 'Colete 4 Núcleos Titânicos de Ra-den, 4 Corações de Dragão de Vexiona e 4 Olhos Proféticos de Il\'gynoth em Ny\'alotha, a Cidade Desperta, no modo Heroico.', 'Ny\'alotha não obedece às regras do espaço-tempo, e talvez possamos usar isso a nosso favor.\n\nSegundo a M.A.D.R.E., se obtivermos determinados objetos escolhidos por N\'Zoth, poderemos usá-los para torcer o espaço e agilizar nossa passagem aqui no futuro. O problema é que eles não vão abrir mão desses itens facilmente.', '', '', '', '', '', '', 33528),
(58373, 'ptBR', 'Ny\'alotha: proteção da M.A.D.R.E.', 'Colete 4 Núcleos Titânicos de Ra-den, 4 Corações de Dragão de Vexiona e 4 Olhos Proféticos de Il\'gynoth em Ny\'alotha, a Cidade Desperta, no modo Normal.', 'Ny\'alotha não obedece às regras do espaço-tempo, e talvez possamos usar isso a nosso favor.\n\nSegundo a M.A.D.R.E., se obtivermos determinados objetos escolhidos por N\'Zoth, poderemos usá-los para torcer o espaço e agilizar nossa passagem aqui no futuro. O problema é que eles não vão abrir mão desses itens facilmente.', '', '', '', '', '', '', 33528),
