(58321, 'ptBR', 'Núcleo incomum', 'Colete o Núcleo Titânico de um Vigia de Marfim em Uldum.', 'Nossos batedores relataram que os Amatet estão construindo novos vigilantes titânicos. \n\nPensávamos que essa arte havia se perdido nas areias do tempo. Pelo jeito, estávamos errados.\n\nDesnecessário dizer o quanto seria valioso para nós contar com a ajuda de vigilantes nas batalhas de Uldum. Precisamos descobrir como são construídos!\n\nO poder do vigilante titânico está em seu núcleo, por isso, peço que me traga um desses núcleos para que nossos artífices possam providenciar a construção.', '', '', '', '', '', '', 33528),
(58318, 'ptBR', 'A Máscara Sem-rosto da Noite Longa', 'Devolva a Máscara Sem-rosto da Noite Longa ao altar em uma Visão Horrenda.', 'A determinação necessária para chegar até aqui é extraordinária, fruto da longa experiência de $Gum aventureiro:uma aventureira;. Ainda assim, a noite mais longa está próxima e traz com ela sua maior conquista. Quem luta contra a chegada do crepúsculo eterno só conhece a futilidade, pois na Noite Mais Longa estarão para sempre no limiar da sanidade.', '', '', '', '', '', '', 33528),
(58317, 'ptBR', 'A Máscara Sem-rosto dos Aflitos', 'Devolva a Máscara Sem-rosto dos Aflitos ao altar em uma Visão Horrenda.', 'Comercializar segredos, comercializar mentiras, operar nas fronteiras, isso é tudo que o Espião Mestre sabe. As paixões perdidas, os amores perdidos, tudo se foi, esmagado sob o peso do dever e da lealdade à coroa. Nada sobrou, somente a aflição. A aflição é uma tutora competente, uma ferramenta que o caos conhece na intimidade. Devolva minha máscara se tiver coragem de sentir as muitas formas da aflição.', '', '', '', '', '', '', 33528),
(58316, 'ptBR', 'A Máscara Sem-rosto da Imaginação Sombria', 'Devolva a Máscara Sem-rosto da Imaginação Sombria ao altar em uma Visão Horrenda.', 'Os magus distorcem a magia para manipular e conquistar o mundo. Imaginam um poder maior que perpassa as linhas do domínio do caos. Nessa busca, os magus perceberam que as profundezas da imaginação de cada um guardam coisas terríveis, verdadeiramente sombrias.', '', '', '', '', '', '', 33528),
(58314, 'ptBR', 'A Máscara Sem-rosto da Ponte Destruída', 'Devolva a Máscara Sem-rosto da Ponte Destruída ao altar em uma Visão Horrenda.', 'Guerreiros deslocados se inquietam a cada passo, principalmente aqueles que são arrancados de seu mundo natal. O caos transforma o desequilíbrio em uma realidade onde cada passo pode levar ao abismo ou drenar todas as suas forças.', '', '', '', '', '', '', 33528),
(58297, 'ptBR', 'A Máscara Sem-rosto do Audacioso', 'Devolva a Máscara Sem-rosto do Audacioso ao altar em uma Visão Horrenda.', 'O caçador nunca quis ser líder, mas queria que a vida tivesse um desafio a cada curva do caminho. Ele conduziu seus aliados com destreza e nunca se esquivou do corpo a corpo. Com tanta habilidade em batalha, ele e meus outros lacaios ficaram ainda mais letais. Devolva a máscara ao altar do Audacioso e desafie sua própria determinação em batalha à medida que os ataques inimigos se tornam mais perigosos.', '', '', '', '', '', '', 33528),
(58291, 'ptBR', 'Larápios envolventes', 'Colete $1oa Pelagens Irregulares de Hiena de Caçadores Amatet ou esfolando hienas em Uldum.', 'Os Errantes usaram a pelagem das hienas da região para construir nossa armadura. Infelizmente, desde que chegaram, os caçadores Amatet tomaram de assalto nossa zona de caça.\n\nPrecisamos das pelagens e pagamos regiamente por elas. Você pode roubar as pelagens dos caçadores ou esfolar as hienas por conta própria, se souber como.', '', '', '', '', '', '', 33528),
(58290, 'ptBR', 'Campeões dos Amatet', 'Mate $1oa inimigos Amatet de elite em Uldum.', 'Os soldados de Ramkahen são valentes e confiáveis.\n\nEu confio neles contra qualquer soldado raso dos Amatet, mas nem mesmo nossos homens mais fortes são capazes de enfrentar os lutadores das castas mais altas do inimigo.\n\nMas em você eu aposto sem medo. Seria um alívio para nossos esforços de defesa se você cuidasse deles enquanto meus soldados enfrentam as fileiras dos Amatet.', '', '', '', '', '', '', 33528),
(58289, 'ptBR', 'Segredos guardados', 'Saqueie $1oa Depósitos Amatet em Uldum.', 'Pelo que sabemos, os Amatet devem ter ficado trancados na tumba durante milhares de anos. Pense só em tudo que podemos aprender com eles!\n\nClaro que seria mais fácil se eles não estivessem tentando nos matar. \n\nSe você topar com depósitos de relíquias Amatet em suas viagens, me avise. Eu adoraria descobrir que tipo de mistérios elas contêm!', '', '', '', '', '', '', 33528),
(58288, 'ptBR', 'Os escolhidos do Rei Sol', 'Derrote 3 inimigos Amatet raros em Uldum.', 'Os Amatet podem até parecer inabaláveis, mas seus soldados com certeza têm um ponto fraco. Precisamos deixar claro para eles que não estamos para brincadeira.\n\nProcure os homens mais fortes nas fileiras inimigas e mate-os diante de todos. \n\nVamos mostrar a esses infelizes a força de Uldum!', '', '', '', '', '', '', 33528),
(58287, 'ptBR', 'Um plano de arrebentar', 'Destrua $1oa Ídolos Amatet e $2oa Obeliscos Tocados pelo Sol em Uldum.', 'Recebi relatos de batedores que mencionam vários ídolos e monumentos que os Amatet usam para canalizar a magia solar. \n\nNão sei o propósito deles, mas precisamos acabar com qualquer vantagem que eles possam ter. Por isso, quero que você vá lá e quebre tudo que pareça remotamente mágico.\n\nMas não conte nada à Liga dos Exploradores. Eles iriam me encher a paciência.', '', '', '', '', '', '', 33528),
(58286, 'ptBR', 'Longe de casa', 'Liberte $1oa Tol\'vir Escravizados em Uldum.', 'A conquista do leste de Uldum pelos Amatet foi repentina, e não conseguimos chegar a alguns de nossos acampamentos mais distantes a tempo. \n\nFelizmente, muitos dos tol\'vir que moravam nos territórios conquistados não foram mortos, mas postos em trabalhos forçados sob a chibata dos Amatet. \n\nPrecisamos aproveitar qualquer oportunidade de libertá-los e levá-los para casa.', '', '', '', '', '', '', 33528),
(58285, 'ptBR', 'Artefatos desenterrados', 'Colete $1oa Artefatos Titânicos in Uldum.', 'Desde que saíram das tumbas, os Amatet se ocuparam em escavar relíquias titânicas das áreas próximas. \n\nNão sei se pretendem fazer alguma coisa com elas, ou se simplesmente vão escondê-las para que não as encontremos. Por ora, basta dizer que a Liga dos Exploradores adoraria estudar o que eles encontraram!\n\nClaro que não dá para chegar mais perto sem que os Amatet tentem cravar um machado na gente, mas isso não é problema, certo? \n\nPode nos ajudar?', '', '', '', '', '', '', 33528),
(58284, 'ptBR', 'Éditos do Rei Sol', 'Colete $1oa Éditos do Rei Sol dos Amatet Tocados pelo Sol em Uldum.', 'Sabe-se muito pouco sobre o Rei Sol que lidera os Amatet. Nossas observações sugerem que os mais próximos a ele são os \"Tocados pelo Sol\", uma casta de praticantes de magia solar.\n\nEu gostaria muito de saber mais sobre o Rei Sol, mas, ao contrário de outros membros da Liga dos Exploradores, não pretendo arriscar as vidas dos meus pesquisadores para isso. \n\nVocê, no entanto, me parece muito capaz de se virar sozinh$Go:a;. Se topar com registros sobre o Rei Sol, eu tenho muito interesse neles.', '', '', '', '', '', '', 33528),
(58283, 'ptBR', 'Cego guiando cego', 'Mate $1oa sacerdotes Amatet em Uldum.', 'Os Sacerdotes do Sol são uma ordem antiga dos tol\'vir que circulava por todas as tribos. \n\nOs que seguem Amatet, no entanto, distorceram e armaram nossas crenças para justificar a cruzada contra Ramkahen. Os soldados os seguem cegamente, sem questionar.\n\nEles precisam ser detidos.', '', '', '', '', '', '', 33528),
(58282, 'ptBR', 'Caindo do Céu', 'Mate $1oa Arqueiros Amatet em Uldum.', 'Os arqueiros de Ramkahen são excelentes, mas os arcos dos Amatet têm um alcance maior. Por isso, nossas incursões ao território deles são muito perigosas.\n\nVocê tem talento para a luta atrás das linhas inimigas. Se conseguisse reduzir as fileiras do inimigo, teríamos uma chance de fazê-los recuar de vez.\n\nPode nos ajudar?', '', '', '', '', '', '', 33528),
(58281, 'ptBR', 'Armamentos antigos', 'Colete $1oa peças de Armadura Amatet dos tol\'vir Amatet de armadura em Uldum.', 'Lutar uma guerra em muitos fronts prejudicou nossa capacidade de fornecer suprimentos. Nossos ferreiros não conseguem consertar e substituir as armaduras dos soldados a tempo, o que nos deixa mal equipados diante de tantos inimigos.\n\nPor mais antiga que seja, a armadura dos Amatet veio da Forja Titânica e é poderosíssima. Se você conseguir recuperar algumas, vai ajudar demais na nossa defesa.\n\nPode ajudar?', '', '', '', '', '', '', 33528),
(58279, 'ptBR', 'Recompensa do intendente', '', '', '', '', '', '', '', '', 33528),
(58277, 'ptBR', 'Enganadores sombrios', 'Mate $1oa lacaios de K\'thir em Uldum.', 'Os Deuses Antigos têm muitos lacaios sem rosto à disposição, mas os mais insidiosos são os chamados k\'thir.\n\nEmbora não sejam tão intimidadores quanto seus pares, os k\'thir manipulam pelas sombras, dobrando as vontades dos homens e da própria realidade.\n\nNão podemos permitir que suas maquinações passem incólumes.', '', '', '', '', '', '', 33528),
(58276, 'ptBR', 'Mar\'at em Chamas', '', '', '', '', '', '', '', '', 33528),
(58275, 'ptBR', 'Evocação Monstruosa', '', '', '', '', '', '', '', '', 33528),
(58274, 'ptBR', 'Servo de N\'Zoth', 'Use N\'lyeth, Estilha de N\'Zoth, para alterar sua facção da Aliança e se devotar a N\'Zoth. Depois mate 10 jogadores da Aliança sem morrer.', '$C...\n\nFiquei observando você... Senti sua sede de sangue. \n\nMas você serve a falsos profetas... a Aliança é uma ilusão... A divindade está em mim!\n\nProve ser merecedo$Gr:ra; dos meus favores... Mate aqueles que vão lhe trair...\n\nMate... a Aliança!', '', '', '', '', '', '', 33528),
(58273, 'ptBR', 'Servo de N\'Zoth', 'Use N\'lyeth, Estilha de N\'Zoth, para alterar sua facção da Horda e se devotar a N\'Zoth. Depois mate 10 jogadores da Horda sem morrer.', '$C...\n\nFiquei observando você... Senti sua sede de sangue. \n\nMas você serve a falsos profetas... a Horda é uma ilusão... A divindade está em mim!\n\nProve ser merecedo$Gr:ra; dos meus favores... mate aqueles que vão lhe trair...\n\nMate... a Horda!', '', '', '', '', '', '', 33528),
(58271, 'ptBR', 'Ritual igniocaótico', '', '', '', '', '', '', '', '', 33528),
(58257, 'ptBR', 'Gorja devoradora', '', '', '', '', '', '', '', '', 33528),
(58256, 'ptBR', 'Gorja devoradora', '', '', '', '', '', '', '', '', 33528),
(58239, 'ptBR', 'Lições dos salteadores', 'Saqueie $1oa Depósitos do Império Negro em Uldum.', 'Houve muitas gerações de Errantes salteadores, seja na terra, seja no mar. Mesmo depois de abrir mão desse tipo de vida em busca de uma existência mais pacífica, nunca nos esquecemos as lições que aprendemos.\n\nUma delas, particularmente relevante nos dias de hoje, é que, ao encontrar um adversário mais forte, a melhor coisa a fazer é usar a arma dele contra ele mesmo.\n\nEncontre os depósitos e traga tudo que conseguir carregar. Quem sabe você encontre algo que possa virar a maré a nosso favor.', '', '', '', '', '', '', 33528),
(58238, 'ptBR', 'Perdidos e atormentados', 'Liberte $1oa Cidadãos de Ramkahen das Celas de Tormento dentro da Cidade Perdida dos Tol\'vir em Uldum.', 'Nossos cidadãos de Ramkahen conseguiram escapar ao grosso do ataque de N\'Zoth. \n\nNossos irmãos da Cidade Perdida não tiveram a mesma sorte. Os que não foram mortos instantaneamente foram mantidos em cativeiro só para serem torturados pelos lacaios de N\'Zoth.\n\nSei que você vai enfrentar as forças de N\'Zoth. Se conseguir libertar nossos aliados também, Ramkahen estará em dívida com você.', '', '', '', '', '', '', 33528),
(58237, 'ptBR', 'A purificação de Uldum', 'Destrua $1oa Tumores de Corrupção em Uldum.', 'A corrupção se entranha cada vez mais na terra a cada instante que as forças de N\'Zoth permanecem em Uldum.\n\nMesmo que a gente consiga expulsar os lacaios, o dano causado a Uldum já pode ter se tornado irreversível. \n\nPrecisamos encontrar os pontos em que a corrupção brota e eliminá-los.', '', '', '', '', '', '', 33528),
(58236, 'ptBR', 'Destruição simbólica', 'Destrua $1oa Estandartes do Império Negro em Uldum.', 'Os sectários que seguem a legião sombria macularam nossas terras com símbolos dos tiranos que eles seguem. \n\nSeus seguidores descerebrados correm para esses estandartes, adorando-os como ídolos profanos.\n\nIncendeie todos e limpe a mácula de nossas terras.', '', '', '', '', '', '', 33528),
(58235, 'ptBR', 'Âncoras do Império Negro', 'Destrua $1oa Obeliscos do Império Negro em Uldum.', 'A invasão nos pegou totalmente de surpresa, com estruturas provenientes do Império Negro se materializando do nada, das quais brotaram forças dos Deuses Antigos. Não fazemos ideia de como isso aconteceu, nem de onde eles vêm.\n\nSó sabemos que, sempre que aparece, uma nova estrutura é precedida por obeliscos maléficos, que servem de âncoras para o surgimento de mais forças dos Deuses Antigos.\n\nPara determos a invasão, precisamos destruir os obeliscos.', '', '', '', '', '', '', 33528),
(58234, 'ptBR', 'Fonte questionável', 'Colete $1oa Corrupções Aglutinadas nos visgos de Uldum.', 'Minha clarividência garante uma enorme vantagem estratégica ao povo de Ramkahen, mas, ultimamente, a potência das minhas visões vem afetando a minha saúde.\n\nDescobri que existe um tônico que pode anular o mal que as visões causam, mas a formulação precisa de essência coalescida da corrupção dos Deuses Antigos.\n\nSe você conseguisse trazer algumas amostras para mim, seria uma ajuda inestimável.', '', '', '', '', '', '', 33528),
(58233, 'ptBR', 'Corruptores pervertidos', 'Mate $1oa carníferas em Uldum.', 'As carníferas que acompanham as forças invasoras não passam de uma chateação, mas carregam consigo uma profunda conexão com as forças corruptoras dos Deuses Antigos. \n\nComo vetores da peste, eles espalham a corrupção de N\'Zoth por onde quer que passem, pervertendo lentamente a terra.\n\nPrecisamos erradicá-los.', '', '', '', '', '', '', 33528),
(58232, 'ptBR', 'Ordem em meio ao caos', 'Mate $1oa lacaios sem rosto de N\'Zoth em Uldum.', 'Já faz muito tempo desde que os tol\'vir se uniram para enfrentar as forças de um Deus Antigo, logo, nosso conhecimento tático sobre as forças inimigas é limitado.\n\nPorém, uma doutrina de combate nunca muda: derrubar quem dá as ordens enfraquece muito mais inimigos do que qualquer baixa na infantaria. \n\nPercebi que os maiores lacaios sem rosto agem como comandantes das forças dos Deuses Antigos. Silencie-os para semear o caos nas fileiras inimigas.', '', '', '', '', '', '', 33528),
(58231, 'ptBR', 'Sabedoria da loucura', 'Encontre $1oa Escritos Enlouquecidos dos Sectários do Império Negro em Uldum.', 'Em minhas visões eu ouço... vozes...\n\nAs palavras não fazem sentido, mas, com o tempo, os padrões começaram a aparecer. Acredito que por trás do que as vozes dizem exista algo muito importante, mas ainda preciso decifrar uma palavra.\n\nPrecisamos aprender na fonte. Encontre escritos dos sectários que viajam com essas criaturas sombrias. Os garranchos deles podem ser a chave para entender a mensagem por trás da loucura.', '', '', '', '', '', '', 33528),
(58230, 'ptBR', 'Cegar os olhos', 'Mate $1oa Observadores Pútridos nos Campos Akhenet em Uldum.', 'Forças estranhas têm interferido nas minhas visões ultimamente. Os olhos sempre em vigia atravessam o véu, destruindo minha clarividência.\n\nOs olhos do inimigo olham dentro de nossas almas e perfuram nossas mentes. Para nos livrarmos da maldição sobre esta terra, precisamos arrancá-los.', '', '', '', '', '', '', 33528),
(58229, 'ptBR', 'Um brado de convocação', 'Mate 3 lacaios raros de N\'Zoth em Uldum.', 'Nossas terras estão infestadas por lacaios dos Deuses Antigos. Eles estão em todos os fronts, atacando as mentes de nossos soldados.\n\nNossas forças não aguentar durante muito tempo. Precisamos lançar um ataque decisivo para levantar um pouco o moral da tropa.\n\nEncontre os maiores caras de tentáculo melequentos que puder e acabe com a raça deles. Meus homens vão seguir o seu exemplo.', '', '', '', '', '', '', 33528),
(58216, 'ptBR', 'Gorja devoradora', '', '', '', '', '', '', '', '', 33528),
(58214, 'ptBR', 'Caso de urgência', 'Procure Kelsey Fagulhaço no Porto de Boralus.', 'Que timing perfeito, $n.\n\nKelsey Fagulhaço mandou várias mensagens às capitais pedindo ajuda.\n\nMekkatorque não está nada bem. O tempo urge.\n\nVá correndo até o Porto de Boralus, ela vai estar esperando por você.', '', '', '', '', '', 'Procure Kelsey Fagulhaço no Porto de Boralus.', 33528),
(58168, 'ptBR', 'Uma realidade claramente sombria', 'Derrote $1oa Vigilantes do Clarão Sombrio dentro da visão.', 'Eles estão de olhos em nós, $n, nas sombras, acompanhando cada passo. Não é à toa que todos os nossos esforços até agora foram... em vão.\n\nA culpa não é sua. Devíamos ter suspeitado do que estava acontecendo há tempos.\n\nSe quisermos que nossos esforços gerem frutos, precisamos passar desapercebidos.\n\nNosso velho amigo ofereceu um elixir que ajuda a expor nosso inimigo. Mesmo com a possibilidade de... efeitos colaterais desconhecidos, que bebe consegue enxergar perfeitamente a escuridão.', '', '', '', '', '', '', 33528),
(58167, 'ptBR', 'Medidas preventivas', 'Destrua $1oa Portais do Caos dentro da visão.', 'Ondas de escuridão continua a atacar o litoral do nosso mundo. Temo que as águas a nossos pés acabem nos engolfando. Acho que é hora de uma abordagem diferente.\n\nSiga até o reino distorcido e procure pelos portais sombrios. Se conseguirmos retardar o avanço deles, talvez tenhamos tempo de descobrir alguma fraqueza fatal.', '', '', '', '', '', '', 33528),
(58156, 'ptBR', 'Aniquilar as Trevas', 'Rechace a corrupção de N\'Zoth dentro da visão.', 'As trevas estão crescendo. O ciclo continua.\n\nFaça tudo o que puder para impedir os esforços de N\'Zoth. Se não enfrentarmos a corrupção, podemos acabar mergulhando nas trevas algum dia.', '', '', '', '', '', '', 33528),
(58155, 'ptBR', 'Uma mão na escuridão', 'Resgate $1oa almas da visão.', 'Imagine ficar pres$Go:a; em um mundo que você não sabia que existia, uma realidade desconhecida.\n\nPensamentos, medos e desejos sombrios obnubilam a mente e trazem uma irresistível tentação.\n\nMuitos se perdem nas trevas, incapazes de resistir à tentação, mas alguns resistem.\n\nFaça o que for possível para preservar quem luta contra as trevas. Não podemos deixar que caiam.', '', '', '', '', '', '', 33528),
(58151, 'ptBR', 'Lacaios de N\'Zoth', 'Derrote $1oa lacaios de N\'Zoth dentro da visão.', 'Talvez chegue o dia em que os ventos uivantes ao nosso redor se calem, mascarados por sussurros que, apesar de familiares, são cada vez mais sombrios.\n\nPrecisamos fazer alguma coisa\n\nEntre nas trevas, $n, e ataque o inimigo.', '', '', '', '', '', '', 33528),
(58147, 'ptBR', 'Estranho numa terra estranha', 'Encontre o Mural do Chamado ao Heroísmo em Ventobravo.', 'Bem-$gvindo:vinda; a Ventobravo, $c. O Rei Anduin Wrynn $go:a; convida a conhecer nossa bela cidade. Você parece alguém que curte a vida noturna. Temos muitas tabernas populares e uma cena musical vibrante! \n\nAh, mas isso pode esperar. Procure um Mural do Chamado ao Heroísmo pela cidade para saber onde estão as aventuras. Depois é só falar com seu emissário.\n\nTenha uma estadia agradável, $n. Ah, e um aviso amistoso... É melhor não tentar aprimorar as pessoas sem consentimento. Há quem não fique lá muito feliz com esse tipo de coisa.', '', '', '', '', '', 'Fale com Lulana no Distrito dos Anões.', 33528),
(58146, 'ptBR', 'Pela Aliança', 'Encontre o Embaixador Ancoreiro na Embaixada de Ventobravo.', 'Como Grão-faz-tudo e líder de gnomos e gnomecânicos, eu tenho o orgulho de lhe dar boas-vindas à Aliança!\n\nHá um mundo de aventuras à sua espera além dos muros de Gnomecan.\n\nQuando estiver pront$Go:a; é só entrar no teleportador. O Embaixador Ancoreiro estará à sua espera na Embaixada de Ventobravo.\n\nLá haverá muitas oportunidades de progresso para você.\n\nEscolha sabiamente, aprimore-se e lembre-se de compartilhar seus dados.', '', '', '', '', '', 'Encontre o Embaixador Ancoreiro na Embaixada de Ventobravo.', 33528),
(58124, 'ptBR', 'Estranho numa terra estranha', 'Encontre o Mural de Ordens do Chefe Guerreiro em Orgrimmar.', 'Olá. Sou o Embaixador Guardanegra.\n\n<Guardanegra olha o pedaço de papel na própria mão.>\n\nEm nome da chefe-guerreira, tenho a honra de lhe dar boas vindas a Orgrimmar, $r.\n\n<Ele olha para você, sorri de um jeito pouco convincente e olha de novo para o papel.>\n\nQuando uma vida de aventuras se descortina diante de você, esteja cert$go:a; de que... é...\n\nAh, quer saber? Eu estou aqui lendo essas mesmas boas-vindas o dia todo. Já deu.\n\nOlhe o Mural de Ordens do Chefe Guerreiro e descubra onde você pode se aventurar. Agora chispa.', '', '', '', '', '', 'Fale com Nilsa no Vale da Honra.', 33528),
(58122, 'ptBR', 'Pela Horda', 'Encontre o Embaixador Guardanegra na Embaixada de Orgrimmar.', 'Que aventura, $c!\n\nHá tanto a explorar... tanto a descobrir! São tempos emocionantes, os nossos.\n\nVamos mostrar aos nossos aliados da Horda o valor de ter uns vulperas sagazes por perto.\n\nProcure a nossa embaixada em Orgrimmar e saia em busca de oportunidades por toda a Azeroth e além.\n\nAté que nossos caminhos se cruzem outra vez, $n!', '', '', '', '', '', 'Encontre o Embaixador Guardanegra na Embaixada de Orgrimmar.', 33528),
(58097, 'ptBR', 'Suprimentos do Acordo de Uldum', 'Fale com a Fornecedora Qorra em Uldum para receber sua recompensa.', 'A Resistência agradece por toda a ajuda que você nos deu.\n\nAceite estes suprimentos como um símbolo do nosso reconhecimento e uma promessa de que há mais por vir, se você continuar a nos ajudar.', '', '', '', '', '', '', 33528),
(58096, 'ptBR', 'Suprimentos dos Rajani', 'Fale com Zhang Khu no Vale das Flores Eternas para receber sua recompensa.', 'A Resistência agradece por toda a ajuda que você nos deu.\n\nAceite estes suprimentos como um símbolo do nosso reconhecimento e uma promessa de que há mais por vir, se você continuar a nos ajudar.', '', '', '', '', '', '', 33528),
(58087, 'ptBR', 'Destruindo a fonte', 'Destrua $1oa Células de Energia Nazeshi no Baixio da Pérola Medonha.', 'A Chamaré Nezara está no comando. Se acabarmos com ela, as nagas remanescentes vão desertar, mas chegar até ela não vai se fácil. Ela se protege com uma barreira mágica alimentada por células de energia.\n\nSe conseguirmos destruir a barreira, vamos destruir Nezara.', '', '', '', '', '', '', 33528),
(58010, 'ptBR', 'Miúdos para dar e vender', 'Recolha $1oa Miúdos de Aqir.', 'Precisamos de mais amostras dos aqir, $p. Todas que conseguires!\n\nJá fiz algumas descobertas fascinantes, mas ainda há muito mais a aprender.\n\nCom mais estudo e alguma sorte, podemos descobrir as fraquezas deles aos poucos.', '', '', '', '', '', '', 33528),
(58009, 'ptBR', 'Até a Lua', 'Remover a ameaça Aqir do Obelisco da Lua', 'Certo! Hora de tirar a cauda daqui.\n\nTemos que voltar pro acampamento e contar pro Arik o que está acontecendo aqui o quanto antes.\n\nVamos pro bombardeiro abastecer o negócio.\n\nEu deixo você ficar de atirado$Gr:ra;, mas eu piloto. Vamos tentar explodir uns insetos na volta!', '', '', '', '', '', '', 33528),
(58008, 'ptBR', 'A todo vapor', 'Recolha $1oa Latas de Combustível.', 'Então. Eu tava aqui conferindo esses aviões todos e... você não vai acreditar, mas nenhum eles tem combustível!\n\nEu vi umas latas espalhadas aqui por perto. Parte delas deve ter algum resto de alguma coisa.\n\nEu mesma ia coletar, mas esses insetos malditos vieram do nada e invadiram tudo.\n\nAgora tem inimigos demais para eu enfrentar sozinha. Você acha que consegue dar uma ajuda?', '', '', '', '', '', '', 33528),
(57990, 'ptBR', 'Obelisco do Sol', 'Localize a Exterminadora Zahra no Obelisco do Sol.', 'Preciso lhe pedir mais uma coisa, $Gmeu amigo:minha amiga;. É uma tarefa crítica para a nossa sobrevivência aqui.\n\nNossa camarada Zahra se encarregou de escalar o platô ao leste para captar um dos velhos bombardeiros lá de cima.\n\nAté agora as nossas tentativas de contactar Arik falharam.\n\nMas se você conseguir nos ajudar a consertar aqueles aviões, podemos ter uma chance.\n\nCom sorte eles conseguirão mandar reforços antes que sejamos derrotados...', '', '', '', '', '', '', 33528),
(57974, 'ptBR', 'Heroico: Batalha pela Costa Negra', '', '', '', '', '', '', '', '', 33528),
(57973, 'ptBR', 'Heroico: Batalha pela Costa Negra', '', '', '', '', '', '', '', '', 33528),
(57971, 'ptBR', 'Ruínas de Ammon', 'Vá até as Ruínas de Ammon.', 'Essas coisas parecem estar sempre em tudo quanto é lugar!\n\nOu isso foi um ataque organizado ou o tamanho das forças deles está além da nossa compreensão.\n\nA coisa está ruim para nós de qualquer forma... bem ruim.\n\n$p, preciso que você vá às Ruínas de Ammon e avalie a situação.\n\nSe eles precisarem, dê uma ajuda por lá!', '', '', '', '', '', '', 33528),
(57970, 'ptBR', 'Xok\'nixx, o Arruinador', 'Mate Xok\'nixx, o Arruinador.', 'Ar\'kali e um grupo dos nossos guerreiros estão enfrentando um verdadeiro beemote no coração das ruínas.\n\nEla é páreo para qualquer adversário, mas receio que seja questão de tempo até o monstro desgastá-los.\n\nEmbora a criatura esteja ocupada por enquanto, se nossos soldados lá tombarem, as ruínas estarão perdidas.\n\nApresse-se, por favor! Com sua ajuda eles certamente abaterão esse inimigo titânico.', '', '', '', '', '', '', 33528),
(57969, 'ptBR', 'Cuidado dos feridos', 'Cure $1oa Operários Errantes.', '$gMeu amigo:Minha amiga;, como você pode ver, estamos cercados por essas criaturas terríveis.\n\nMuitos dos nossos camaradas caíram para os monstros, mas felizmente temos guerreiros suficientes para rechaçar a ameaça... por enquanto.\n\nSe conseguir nos ajudar, por favor cuide dos nossos feridos e ajude a abrir caminho para que eles escapem das ruínas.', '', '', '', '', '', '', 33528),
(57962, 'ptBR', 'Heroico: Batalha pela Costa Negra', '', '', '', '', '', '', '', '', 33528),
(57961, 'ptBR', 'Heroico: Batalha pela Costa Negra', '', '', '', '', '', '', '', '', 33528),
(57960, 'ptBR', 'Front de guerra heroico: a Batalha pela Costa Negra', 'Derrote a Horda na Batalha pela Costa Negra.', 'Não vamos tolerar mais agressões da Horda nos nossos territórios.\n\nOs elfos noturnos não lutarão sozinhos hoje. A Costa Negra será deles novamente.\n\nPela Aliança!', '', '', '', '', '', '', 33528),
(57959, 'ptBR', 'Front de guerra heroico: a Batalha pela Costa Negra', 'Derrote a Aliança na Batalha pela Costa Negra.', 'A Costa Negra pertence à Horda! Temos que defender o território para manter nossa dominância sobre Kalimdor.\n\nPreparem-se bem. A batalha aguarda!', '', '', '', '', '', '', 33528),
(57956, 'ptBR', 'Hospedeiros Errantes', 'Mate $2oa Hospedeiros Errantes.', 'Os insetos estão pondo ovos nos cadáveres dos nossos soldados! É absolutamente horripilante!\n\nAlguns deles estão se levantando como monstruosidades pútridas, inchadas, hediondas!\n\nTemos que detê-los antes que eles continuem a engrossar as fileiras com os nossos.\n\nTarefa desagradável... mas tenho que pedir que você me ajude a destrui-los. Completamente.\n\nPegue umas bombas ali atrás se quiser.', '', '', '', '', '', '', 33528),
(57955, 'ptBR', 'Ao porto Ankhaten', 'Encontre a Rastreadora Samara no Porto Ankhaten.', 'Receio que eu ainda não tenha forças para sair às areias e enfrentar aqueles monstros de novo.\n\nSiga para o sul e encontre a Rastreadora Samara no sítio do antigo Porto de Schnottz.\n\nDiga a ela para segurar todas as caravanas que venham nessa direção, antes que outros sejam emboscados e tenham o mesmo fim.\n\nPrecisamos alertar toda Uldum antes que nossas forças se fragmentem ainda mais!', '', '', '', '', '', '', 33528),
(57954, 'ptBR', 'Queime os corpos', 'Queime $1oa Cadáveres com Ovos.', 'Os insetos parecem estar botando ovos indiscriminadamente nos cadáveres aqui por perto.\n\nEstão usando os corpos como comida para ainda mais daquelas coisas horríveis. É asqueroso!\n\nPodemos lamentar pelos mortos depois, mas se mais insetos daqueles chocarem pode ser que não vivamos o suficiente para ficar de luto.\n\nQueime os corpos e destrua aqueles ovos!', '', '', '', '', '', '', 33528),
(57915, 'ptBR', 'Busca por sobreviventes', 'Examine $1oa Errantes em Orsis.', 'Os insetos vieram por todos os lados... não deu tempo de reagir.\n\nMuitos dos meus amigos morreram onde estavam, enquanto outros tentaram lutar com os nossos parcos meios.\n\nEu sou covarde. Fugi no meio da comoção em vez de tentar ajudar.\n\nE agora eu estou aqui, sem comida nem água, assustado demais para procurar por sobreviventes.\n\nPor favor, eu imploro. Ajude qualquer um que você achar com vida em Orsis...', '', '', '', '', '', 'Encontre o Pioneiro Lashan em Orsis.', 33528),
(57873, 'ptBR', 'Notícias de Orsis', 'Investigue a situação em Orsis.', 'Como você pode ver, $n, estamos fazendo de tudo para lidar com esses insetos nojentos.\n\nNossas caravanas do sul não chegaram mais, e ultimamente recebemos notícias preocupantes dos poucos que conseguiram chegar.\n\nEu mandei uma patrulha para Orsis a fim de investigar, mas ela já devia ter voltado.\n\nSerá que você pode ver o que aconteceu com eles?', '', '', '', '', '', '', 33528),
(57774, 'ptBR', 'Sete vidas', 'Destrua $1oa Habitantes de Neferset.', 'Batedores chegaram há pouco tempo, moribundos, com relatórios que me deixaram... confuso.\n\nAlguns Neferset foram avistados vagando nas ruas da cidade deles ao sul.\n\nIsso poderia ser considerado normal, se não fosse o fato de que os Neferset haviam sido totalmente dizimados.\n\nPeço que você investigue isso mais a fundo... E se houver alguma magia sinistra que explique esse fato, você tem que fazer o possível para conter essa ameaça!', '', '', '', '', '', '', 33528),
(57773, 'ptBR', 'Remendos caóticos', 'Encontre e feche $1oa Rasgos do Caos em Uldum.', 'Nossos guerreiros viram manifestações corruptas saindo de vários rasgos do caos na floresta em redor.\n\nMas são muito fracas, claramente com a intenção de testar nossas defesas antes da chegada das verdadeiras forças.\n\nSe não cuidarmos dessa ameaça agora, porém, acabaremos sendo sobrepujados pelo enorme contingente que está se criando.\n\nDê um jeito de fechar esses portais!', '', '', '', '', '', '', 33528),
