(57737, 'ptBR', 'Resgate de Ramkahen', 'Resgate $1oa Habitantes de Mar\'at.', 'Mar\'at foi invadida por aqueles K\'thir nojentos antes de evacuarmos nossos cidadãos. \n\nTemo que o destino deles tenha sido o pior possível.\n\nVeja se resta alguém vivo na cidade e mande que venha para Ramkahen.', '', '', '', '', '', '', 33528),
(57728, 'ptBR', 'Ataque: enxame infinito', 'Rechace o ataque dos mantídeos ao Vale das Flores Eternas.', 'O enxame mantídeo está crescendo! Não há como o Lótus Dourado conseguir lidar com uma força tão grande.\n\nPrecisamos fazer alguma coisa para rechaçá-los!', 'Fale novamente com Taoshi no Santuário Silencioso.', '', '', '', '', 'Fale novamente com Taoshi no Santuário Silencioso.', 33528),
(57721, 'ptBR', 'Espólios de Guerra', 'Derrote $1oa partes de Armadura Mogu Recuperada de inimigos mogus no Vale das Flores Eternas.', 'Os clãs simplesmente não param de guerrear, e nossos guerreiros estão gastando as armaduras mais rápido do que eu consigo consertar.\n\nSe você for enfrentar outros clãs, veja se consegue recuperar partes de armaduras intactas dos soldados inimigos. Não devemos desperdiçar recursos.', '', '', '', '', '', '', 33528),
(57720, 'ptBR', 'Campeões dos mogus', 'Derrote 3 inimigos raros enquanto os mogus estiverem invadindo o Vale das Flores Eternas.', 'Esses clãs menores guerreando entre si no vale precisam aprender uma lição.\n\nProcure os campeões deles e mate-os. Mostre a eles que os Rajani é que são os verdadeiros líderes aqui!', '', '', '', '', '', '', 33528),
(57718, 'ptBR', 'Pedra e cal', 'Obtenha Bastões de Moldapedra dos Moldapedras Baruk e use-os para libertar $1oa Guerreiros Petrificados nas Ruínas de Guo-Lai.', 'Nossos soldados estavam acampados no pequeno assentamento que fica perto de Guo-Lai quando os Baruk invadiram a área. Alguns conseguiram escapar, mas voltaram contando que seus irmãos e irmãs de armas foram petrificados pelos Moldapedras mogus!\n\nNão podemos deixar nossos guerreiros para trás! \n\nOs Moldapedras devem ter alguma forma de reverter o feitiço e libertar nossos soldados dessa prisão. Traga-os de volta!', '', '', '', '', '', '', 33528),
