(57524, 'ptBR', 'Acessando os arquivos', 'Fale com a M.A.D.R.E. para ativar o Arquivo de Pesquisa Titânico e examine-os.', 'As informações que você obteve nos permitiram entender melhor essas manifestações.\n\nCreio que a M.A.D.R.E. esteja esperando para compartilhar algumas das descobertas dela com você.', '', '', '', '', '', '', 33528),
(57522, 'ptBR', 'Chamado do Caos', '', '', '', '', '', '', '', '', 33528),
(57521, 'ptBR', 'Carroça de guerra potencializada', '', '', '', '', '', '', '', '', 33528),
