(57508, 'ptBR', 'Estandarte de Guerra Zara\'thik', '', '', '', '', '', '', '', '', 33528),
(57497, 'ptBR', 'Espalhar a notícia', 'Atualize Aysa Canta Nuvens em Ventobravo.', 'Queríamos salvar uma vida e conseguimos muito mais que isso!\n\nRealmente não teríamos conseguido sem você, $n. Estou tão empolgada com o futuro da gnomidade!\n\nVolte a Ventobravo e dê as boas notícias!', '', '', '', '', '', 'Atualize Aysa Canta Nuvens em Ventobravo.', 33528),
(57496, 'ptBR', 'Ascensão', 'Elimine os defensores remanescentes de Gnomecan.', 'Depois de tudo que os gnomecânicos fizeram por nós hoje, temos o dever de retribuir o favor.\n\nVamos limpar as criações descontroladas que ainda restam em Gnomecan.\n\nCom o lar deles de volta, o Príncipe Erazmin e o povo terão um caminho brilhante pela frente.\n\nCom essa equipe aqui, o nosso rescaldo do que resta das tropas leais ao Rei Gnomecan será um rolo compressor.\n\nÉ só me dizer quando estiver pront$Go:a;!', '', '', '', '', '', 'Fale com Gelbin Mekkatorque.', 33528),
(57495, 'ptBR', 'O futuro de Gnomecan', 'Vá até o Grão-faz-tudório em Gnomecan.', 'Agora que está livre de qualquer perigo, Gnomecan pode voltar a ser um lugar de paz e prosperidade para gnomos e gnomecânicos.\n\nPara mim, chegou a hora de discutir o futuro dos nossos povos com o Príncipe Erazmin. Espero sinceramente que consigamos forjar uma aliança que dure muitas e muitas gerações!\n\nQuando você estiver pront$Go:a;, junte-se a nós no Grão-faz-tudório para um discurso especial.', '', '', '', '', '', '', 33528),
(57494, 'ptBR', 'Coração forte', 'Obtenha o Reator de Faísca e conclua o procedimento de Mekkatorque.', 'Nós avistamos um sinalizador perto do Depósito Ferro Elétrico.\n\nA equipe de salvados conseguiu obter a fonte de energia. Agora estaremos a salvo do Aniquilotron do Rei Gnomecan para sempre, e o coração dele terá um novo propósito.\n\nÉ uma excelente notícia!\n\nContudo, o sinal quer dizer que eles estão com problemas. Precisaremos da sua ajuda para resgatar a equipe e trazer o Reator de Faísca.\n\nCeleridade, por favor. Falta muito pouco para terminarmos.', '', '', '', '', '', 'Encontre-se com o Príncipe Erazmin em Ferrúgia.', 33528),
(57493, 'ptBR', 'Harmonização mental', 'Ative o Sincroscópio quando Christy der a ordem.', 'Agora que eu tenho uma base para avaliar quem é Mekkatorque, parece haver oportunidades de melhoria.\n\nPrecisamos de sua ajuda para estabilizá-lo e sincronizá-lo antes de retirá-lo da cápsula.\n\nPor favor, tome posição no Sincroscópio. Vou fazer uns ajustes, e você vai precisar ligar a máquina quando eu falar.', '', '', '', '', '', '', 33528),
(57492, 'ptBR', 'Ele?', 'Colete dados de gnomos e gnomecânicos em Gnomecan.', 'Fale com alguns gnomos em Gnomecan, aprimorados ou não. Ao meu povo, pergunte o que eles esperam de um líder do nosso povo. Aos nossos novos amigos, pergunte o que eles mais apreciam no líder deles.\n\nPelo que eu soube até agora, o Grão Faz-tudo sempre liderou o próprio povo por necessidade. Ele jamais buscou nem quis a coroa.\n\nCreio que os gnomos devam se unir novamente, e busco uma solução que seja conveniente para todos. Você pode obter as informações de que eu preciso?', '', '', '', '', '', '', 33528),
(57491, 'ptBR', 'Melhor... Mais forte... Menos morto', 'Obtenha o Acelerador Neural, o Amplificador Eletromagnético Omni e os Servomecanismos Energizados por Fluxo das unidades erráticas.', 'O Rei Gnomecan podia ser maluco, mas os lacaios dele tinham uma capacidade de criação robótica exemplar.\n\nAinda há algumas criações residuais vagando por Gnomecan. Elas se recusam a aceitar a queda do rei.\n\nA conclusão lógica de uma derrota seria a retirada, caso algum robótico permaneça operacional. Mas a lógica não é o forte de alguns.\n\nHoje eles são o que há de mais avançado. Acho que salvados dessas unidades ajudariam imensamente na nossa empreitada.', '', '', '', '', '', 'Fale com Christy ao lado da Cápsula de Fuga de Mekkatorque.', 33528),
(57490, 'ptBR', 'Viagem rumo à segurança', 'Derrote os troggs sucateiros e recupere a Cápsula de Fuga de Mekkatorque.', 'Um dos nossos defensores viu os troggs abaterem o cóptero que estava com a cápsula do Mekkatorque.\n\nDesde que começamos a trazer mercadorias de Tiragarde, eles têm sido uma pedra no nosso sapato.\n\nO Pistônio, um jovem inventor muito promissor, tinha um veículo capaz de cuidar disso. Fale com a equipe dele lá no Ferro-velho do Bitola.\n\nPor favor, apresse-se e recupere a cápsula! Não sei o vai acontecer com o Gelbin se eles quebrarem a contenção.\n\nE... hã... e ninguém vai se incomodar se você fizer uma limpeza na praia enquanto estiver por lá.', '', '', 'Ferrujolho, o Esperto', '', '', 'Fale novamente com Aren Engrenália em Ferrúgia.', 33528),
(57488, 'ptBR', 'O diagrama atual', 'Obtenha $1oa porção de Gosma Tolerante ao Calor e $2oa Peças de Máquina Adquiridas.', 'Acho que posso modificar um dos nossos aparelhos para obter acesso a Gelbin Mekkatorque sem perturbar as funções de suporte de vida dele.\n\nHá alguns itens que eu preciso que você obtenha.\n\nNo vetor das Montoeiras aqui perto tem sucatinhos e sucatioros. Eles podem ser uma fonte boa de peças de reposição para o meu projeto.\n\nNo Efluxo vive um pessoal mais viscoso. Neles você deve achar ingredientes excelentes para um lubrificante resistente ao calor.', '', '', '', '', '', '', 33528),
(57487, 'ptBR', 'Quem possa ajudar', 'Ajude Kelsey a transportar a Cápsula de Fuga de Mekkatorque para Gnomecan.', 'Acho que há uma forma de ajudar Mekkatorque, mas pode ser que alguns não estejam... cem por cento de acordo...\n\nOs gnomecânicos têm técnicas avançadas de reparo e aprimoramento biomecânico.\n\nSe houver a mínima chance de que eles possam ajudá-lo, nós temos que tentar! Os gnomecânicos mandam suprimentos para a ilha em um ancoradouro na Ponta do Gancho. Ninguém vai notar uma carguinha a mais. Só precisamos redirecionar um dos cópteros teleguiados deles.\n\nVocê me ajuda a levar a cápsula de Mekkatorque para Gnomecan?', '', '', '', '', '', 'Fale com o Príncipe Erazmin na Ilha de Gnomecan.', 33528),
(57486, 'ptBR', 'Energia minguante', 'Encontre Kelsey Fagulhaço na Fortaleza Proudmore.', 'A cápsula de Mekkatorque está ficando sem energia.\n\nNão vamos mais conseguir ouvi-lo falar.\n\nO pulso dele desacelerou, a despeito do esforço dos curandeiros kultirenos.\n\nTenho uma ideia, mas vou precisar da sua ajuda.\n\nEncontre-me na Fortaleza Proudmore. Precisamos ir loguinho, loguinho.', '', '', '', '', '', '', 33528),
(57484, 'ptBR', 'Ritual de despertar', '', '', '', '', '', '', '', '', 33528),
(57476, 'ptBR', 'Campo de alimentação Vil\'thik', '', '', '', '', '', '', '', '', 33528),
(57464, 'ptBR', 'Mantendo a concentração', 'Obtenha $1oa Resquícios de Insanidade. Eles podem ser saqueados de chefes em Ny\'alotha e Chefes Mundiais, ou em Campos de Batalha, Arenas e Abates Honrosos.', 'Atualmente, o foco contém uma mera fração do real poder de N\'Zoth. Se ele ficasse mais poderoso, poderíamos criar armas ainda mais eficazes e usá-las contra o Deus Antigo.\n\nA influência de N\'Zoth está por toda parte, $n, e é mais concentrada em inimigos poderosos. Derrote-os e resgate quaisquer vestígios que restarem do poder do Deus Antigo.', '', '', '', '', '', '', 33528),
(57462, 'ptBR', 'Apanhador de sonhos', 'Obtenha $1oa Resquícios de Insanidade. Eles podem ser saqueados de chefes em Ny\'alotha e Chefes Mundiais, ou em Campos de Batalha, Arenas e Abates Honrosos.', 'Parece que o foco continua estável, e o campo de contenção permanece intacto. Ouso dizer que podemos potencializá-lo ainda mais.\n\nCace e derrote inimigos formidáveis para obter mais resquícios da influência de N\'Zoth. Desta vez, vamos infundir o foco em quantidades ainda maiores do poder do Deus Antigo. Tenho certeza de que o campo de contenção continuará firme.', '', '', '', '', '', '', 33528),
(57453, 'ptBR', 'Arauto do Enxame', '', '', '', '', '', '', '', '', 33528),
(57449, 'ptBR', 'Executor de N\'Zoth', '', '', '', '', '', '', '', '', 33528),
(57448, 'ptBR', 'Nossos novos aliados', 'Testemunhe as boas-vindas de Baine aos vulperas na Horda.', 'Mesmo em tempo de paz, a Horda ainda tem seus problemas.\n\nMesmo que às vezes pareçam grandes demais, nossas lutas não devem nos impedir jamais de lembrar o que significa fazer parte da Horda.\n\nNós não negamos ajuda em tempos difíceis. Nós nos unimos e resistimos.\n\nEu me esqueci disso por um momento. Com todos os problemas dos nossos novos aliados, eu desconsiderei precipitadamente os vulperas.\n\nMinha esperança é a de que eles ainda vejam na Horda o valor que eu vejo neles.', '', '', '', '', '', '', 33528),
(57445, 'ptBR', 'Carrinho de Macarrão de Chin', '', '', '', '', '', '', '', '', 33528),
(57429, 'ptBR', 'Pira do Amalgamado', '', '', '', '', '', '', '', '', 33528),
(57404, 'ptBR', 'Colmeia Assoladora', '', '', '', '', '', '', '', '', 33528),
(57403, 'ptBR', 'Reconstrução de \"Medo e Carne\"', 'Colete Páginas Rasgadas de \"Medo e Carne\" das áreas Corrompidas ou Perdidas nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'Talvez o elemento mais traiçoeiro dos sussurros dos Deuses Antigos é que eles contêm uma minúscula partícula de verdade. O prazer de sentir o sol na pele e o vento nos cabelos é inegável.\n\nSó que você desbravou as visões de N\'Zoth, viu até onde os desígnios deles nos levarão, no fim. A maldição da carne não tem nada a ver com o nosso prazer.\n\nContinue juntando as páginas deste livro, falta pouco para acabarmos de recompô-lo.', '', '', '', '', '', '', 33528),
(57402, 'ptBR', 'Reconstrução de \"A Maldição da Pedra\"', 'Colete Páginas Rasgadas de \"A Maldição da Pedra\" nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'N\'Zoth é acima de tudo sutil e traiçoeiro. Posso ver como uma mente impressionável poderia se voltar contra os Titãs com essas palavras. Que bom que não somos tão suscetíveis a essa manipulação, né?\n\nO livro está quase completo. Continue catando as páginas dentro das visões.', '', '', '', '', '', '', 33528),
(57399, 'ptBR', 'A reconstrução da \"verdade final\"', 'Recolha as Páginas Rasgadas de \"Verdade Final\" nas Áreas Perdidas, dentro de Visões Horrendas, para Wrathion, que está na Câmara do Coração.', 'Eu conheço esse livro. É um tomo sagrado para os adoradores dos Deuses Antigos, que contém os segredos mais bem guardados e os mistérios mais incompreensíveis do Caos. Só os sectários mais devotos têm permissão para contemplar suas páginas.\n\nMesmo incompleto, minha pele arrepia só de segurá-lo nas mãos. Tenho que tomar cuidado para não ler demais numa sentada só.\n\nIsto posto, temos que achar as páginas que faltam para continuar nossa pesquisa. Vá atrás delas nos confins mais sombrios das visões de N\'Zoth.', '', '', '', '', '', '', 33528),
(57398, 'ptBR', 'Caminhando nas trevas', 'Obtenha um exemplar de \"Verdade Final\" das Áreas Perdidas dentro de Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'O fim está próximo. O breu dessas visões $Go:a; aguardam.\n\nNosso trabalho fez com que você esteja bem-equipad$Go:a; para ir em busca das manifestações mais horrendas. As últimas respostas virão em seguida. Nossos preparativos para Ny\'alotha estão quase completos.', '', '', '', '', '', '', 33528),
(57397, 'ptBR', 'Reconstrução de \"Medo e Carne\"', 'Colete Páginas Rasgadas de \"Medo e Carne\" das áreas Corrompidas ou Perdidas nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'Talvez o elemento mais traiçoeiro dos sussurros dos Deuses Antigos é que eles contêm uma minúscula partícula de verdade. O prazer de sentir o sol na pele e o vento nos cabelos é inegável.\n\nSó que você desbravou as visões de N\'Zoth, viu até onde os desígnios deles nos levarão, no fim. A maldição da carne não tem nada a ver com o nosso prazer.\n\nContinue juntando as páginas deste livro, falta pouco para acabarmos de recompô-lo.', '', '', '', '', '', '', 33528),
(57396, 'ptBR', 'Reconstrução de \"Medo e Carne\"', 'Colete Páginas Rasgadas de \"Medo e Carne\" das áreas Corrompidas ou Perdidas nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'Seguidores dos Deuses Antigos insistem que a carne é uma dádiva, não uma maldição. O tomo reflete sobre a suposta benevolência dos Deuses Antigos em nos conceder uma bênção tão generosa.\n\nNaturalmente, ele omite qualquer menção do que acontece quando a corrupção deles corre solta.\n\nJunte mais dessas páginas para mim. Por mais horrendas que sejam as palavras, estudá-las me permitirá aumentar a eficiência do manto.', '', '', '', '', '', '', 33528),
(57395, 'ptBR', 'Reconstrução de \"Medo e Carne\"', 'Colete Páginas Rasgadas de \"Medo e Carne\" das áreas Corrompidas ou Perdidas nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'Seguidores dos Deuses Antigos insistem que a carne é uma dádiva, não uma maldição. O tomo reflete sobre a suposta benevolência dos Deuses Antigos em nos conceder uma bênção tão generosa.\n\nNaturalmente, ele omite qualquer menção do que acontece quando a corrupção deles corre solta.\n\nJunte mais dessas páginas para mim. Por mais horrendas que sejam as palavras, estudá-las me permitirá aumentar a eficiência do manto.', '', '', '', '', '', '', 33528),
(57394, 'ptBR', 'Reconstrução de \"Medo e Carne\"', 'Colete Páginas Rasgadas de \"Medo e Carne\" das áreas Corrompidas ou Perdidas nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'Mais um tomo escrito por alguém que se perdeu para N\'Zoth. Tenho pavor em pensar nas palavras abomináveis que nos aguardam dentro dele.\n\nPorém, se quisermos fortalecer seu manto, então teremos que saber mais sobre aquilo que ele rechaçará. Veja se você encontra as páginas que faltam para completarmos o livro e usarmos o conteúdo dele.', '', '', '', '', '', '', 33528),
(57393, 'ptBR', 'Desbravando a escuridão', 'Obtenha um exemplar de \"Medo e Carne\" das profundezas de uma Visão Horrenda para Wrathion, que está na Câmara do Coração.', 'A essa altura você já notou que a proteção de seu manto vacila mais conforme você vai mais a fundo nas visões.\n\nPara reforçar a sua resistência à influência de N\'Zoth, vamos precisar compreender o poder nefasto dele com ainda mais profundidade.\n\nBusque conhecimento com as manifestações mais profundas e logo teremos as nossas respostas.', '', '', '', '', '', '', 33528),
(57392, 'ptBR', 'Reconstrução de \"A Maldição da Pedra\"', 'Colete Páginas Rasgadas de \"A Maldição da Pedra\" nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'Até aqui o conteúdo do livro tem sido perturbador. Ainda assim, consegui vislumbrar informações valiosas sobre a natureza do poder de N\'Zoth e fiz as alterações correspondentes ao seu manto.\n\nEntretanto, ainda resta muito o que aprender. Continue sua busca por mais páginas em seus mergulhos nas visões.', '', '', '', '', '', '', 33528),
(57391, 'ptBR', 'Reconstrução de \"A Maldição da Pedra\"', 'Colete Páginas Rasgadas de \"A Maldição da Pedra\" nas Visões Horrendas para Wrathion, que está na Câmara do Coração.', 'Encontrei várias referências a esse livro quando pesquisava Ny\'alotha. Escrito por um sectário neófito, ele documenta as \"mentiras dos Titãs\" e as \"injustiças\" que eles perpetraram contra os habitantes de Azeroth.\n\nDesvarios insanos, criados para minar a aceitação de realidade do leitor.\n\nAinda assim, ao estudar o volume teremos melhor compreensão do poder do Deus Antigo, para assim adaptar o manto e oferecer uma proteção mais forte.\n\nTraga todas as páginas do tomo que você encontrar.', '', '', '', '', '', '', 33528),
(57384, 'ptBR', 'Monstruosidade da recomposição', '', '', '', '', '', '', '', '', 33528),
(57379, 'ptBR', 'Estátua de jade infestada', '', '', '', '', '', '', '', '', 33528),
(57378, 'ptBR', 'Vestígios de um Mundo Despedaçado', 'Obtenha um exemplar de \"A Maldição da Pedra\" de uma Visão Horrenda para Wrathion, que está na Câmara do Coração.', 'O conhecimento ganho a partir dessas visões nos proporciona uma oportunidade única de proteger a mente contra a corrupção. Para continuar nossa pesquisa precisamos investigar os mistérios mais profundos dessas experiências.\n\nBusque os poderosos nessas visões. Se vir qualquer coisa interessante, não hesite em compartilhar as suas descobertas.\n\nEnquanto isso eu e a M.A.D.R.E. continuaremos nossa pesquisa aqui na câmara.\n\nAguardamos a sua volta, $n.', '', '', '', '', '', '', 33528),
(57376, 'ptBR', 'Necessidade oculta', 'Fale com Lilian Voss nas Clareiras de Tirisfal.', 'Graças a Sylvana parte da Horda ainda desconfia dos Renegados. Precisamos reconquistar a confiança deles.\n\nNão podemos fazer isso sem aceitarmos a nós mesmos. Temos tantos que se sentem perdidos, solitários... abandonados...\n\nEu marquei uma reunião. Pode ser um grande avanço... ou dar terrivelmente errado. De qualquer forma, é bom que você seja testemunha.\n\nEncontre-me nas Clareiras de Tirisfal, na Propriedade Calston.', '', '', '', '', '', '', 33528),
(57375, 'ptBR', 'Cômoro pulsante', '', '', '', '', '', '', '', '', 33528),
(57374, 'ptBR', 'Nas profundezas sombrias', 'Entre em uma Visão Horrenda para descobrir quais manifestações sombrias aguardam em um mundo governado por N\'Zoth.', 'Com a ligação feita, é hora de romper o véu e descobrir o que está do outro lado.\n\nO que você descobrir pode ser a chave que abre as portas para o nosso sucesso.', '', '', '', '', '', '', 33528),
(57373, 'ptBR', 'A espiral da loucura', 'Procure uma Visão de N\'Zoth em meio à corrupção no Vale das Flores Eternas ou em Uldum para descobrir o que o futuro reserva para Azeroth.', 'Por mais lastimável que seja, a corrupção que se espalha permite que nos preparemos para o que está por vir.\n\nLocalize um dos pontos de invasão e vá espiar o que há do outro lado do véu para ver o que acontece.', '', '', '', '', '', '', 33528),
(57372, 'ptBR', 'O Bazar', '', '', '', '', '', '', '', '', 33528),
(57371, 'ptBR', 'Ataque: os aqir desenterrados', '', '', '', '', '', '', '', '', 33528),
(57370, 'ptBR', 'Ataque: o Império Negro', '', '', '', '', '', '', '', '', 33528),
(57362, 'ptBR', 'Escuridão adentro', 'Fale com a M.A.D.R.E. para voltar aos Salões Primordiais em Uldum e descobrir a fonte da anomalia.', 'Essa última reviravolta permitirá que levemos adiante a jornada para descobrir que poder sombrio é esse que jaz além das dunas.\n\nNão vai ser fácil, $n. Estamos à beira do precipício do desconhecido, só que agora o jogo virou.\n\n<Wrathion contempla sua nova vestimenta.>\n\nVocê já está arrumad$Go:a; para a festa. \n\nVamos ver se o seu regresso aos Salões Primordiais traz à tona alguma revelação.', '', '', '', '', '', '', 33528),
(57359, 'ptBR', 'Ritual de Evocação', '', '', '', '', '', '', '', '', 33528),
(57339, 'ptBR', 'Ritual de construção', '', '', '', '', '', '', '', '', 33528),
(57324, 'ptBR', 'Zarpar na maré alta', 'Fale com Calia Menethil e Derek Proudmore.', 'Oi, $p.\n\nEu recebi uma mensagem de Calia, pedindo que fôssemos nos encontrar com ela de novo. \n\nEla tem muito a oferecer a quem se sente perdido e está atrás de um caminho melhor. Depois que não lhe restarem mais dúvidas, ela saberá o que fazer.\n\nVocê vem comigo?', '', '', '', '', '', '', 33528),
(57323, 'ptBR', 'Vinculação serpentina', '', '', '', '', '', '', '', '', 33528),
(57299, 'ptBR', 'Sarcófago misterioso', '', '', '', '', '', '', '', '', 33528),
(57290, 'ptBR', 'O início da descida', 'Recolha a Escama de Dragão Negro Corrompida no Descenso do Asa Negra, que fica no topo da Montanha Rocha Negra, nas Estepes Ardentes.', 'Proteger a mente de alguém contra os deuses antigos exige um objeto de pura corrupção. Poucos o sabem, mas tal objeto existe... adormecido nas profundezas ardentes do Descenso do Asa Negra.\n\nAté pouco tempo, um dos meus agentes vigiava a área e registrava todas as atividades suspeitas em detalhes. Infelizmente, o agente não deu mais notícias. Já ficou claro que tem mais gente a par da situação.\n\nSe quisermos respostas, só há um lugar para procurar.\n\nNossa jornada continua, $n. A Rocha Negra nos aguarda.', '', '', '', '', '', 'Fale novamente com Wrathion na Câmara do Coração.', 33528),
(57282, 'ptBR', 'Distrito dos Magos', '', '', '', '', '', '', '', '', 33528),
(57276, 'ptBR', 'Mantendo a concentração', 'Obtenha $1oa Resquícios de Insanidade. Eles podem ser saqueados de chefes em Ny\'alotha e Chefes Mundiais, ou em Campos de Batalha, Arenas e Abates Honrosos.', 'Atualmente, o foco contém uma mera fração do real poder de N\'Zoth. Se ele ficasse mais poderoso, poderíamos criar armas ainda mais eficazes e usá-las contra o Deus Antigo.\n\nA influência de N\'Zoth está por toda parte, $n, e é mais concentrada em inimigos poderosos. Derrote-os e resgate quaisquer vestígios que restarem do poder do Deus Antigo.', '', '', '', '', '', '', 33528),
(57275, 'ptBR', 'Algo em sua mente', 'Leve o Foco do Caos para Wrathion na Câmara do Coração.', '<Ao contemplar o cristal, uma fumaça espessa vai tomando corpo à sua volta. Uma presença imponente e acachapante sussurra palavras no seu ouvido. Você procura e não vê ninguém, porém a sensação fica cada vez mais forte. É como se você estivesse flutuando, a escuridão se adensa e o barulho vai ficando ensurdecedor.\n\nVocê conjura toda sua força de vontade para não se deixar levar...\n\nA luz voltou, o barulho cessou e tudo que há é um simples cristal nas suas mãos.\n\nTalvez Wrathion saiba algo a respeito...>', '', '', '', '', '', '', 33528),
(57272, 'ptBR', 'Efígie Sanguina', '', '', '', '', '', '', '', '', 33528),
(57271, 'ptBR', 'Distrito Comercial', '', '', '', '', '', '', '', '', 33528),
(57243, 'ptBR', 'Campo de Escravos Amatet', '', '', '', '', '', '', '', '', 33528),
(57235, 'ptBR', 'Coletor solar', '', '', '', '', '', '', '', '', 33528),
(57234, 'ptBR', 'Coletor solar', '', '', '', '', '', '', '', '', 33528),
(57223, 'ptBR', 'Guardião Desenterrado', '', '', '', '', '', '', '', '', 33528),
(57222, 'ptBR', 'Investigando os Salões', 'Investigue a anomalia nos Salões Primordiais.', 'Seja lá o que for isso, deve estar vindo do fundo da câmara interna. Lá na forja, pode ser que encontremos algumas respostas.\n\nMas bah, é uma boa conferir os equipamentos antes de entrar, $n. Vai saber o que nos aguarda lá dentro...', '', '', '', '', '', '', 33528),
(57221, 'ptBR', 'Recriação', 'Fale com Magni Barbabronze na entrada dos Salões Primordiais, em Uldum.', 'Considerando que os Ramkahen não soaram nenhum alarme, a anomalia deve estar contida nos Salões Primordiais.\n\nÉ melhor irmos investigar, $n.', '', '', '', '', '', '', 33528),
(57220, 'ptBR', 'Iniciação do protocolo de força', 'Redirecione a força da Câmara do Coração, do Engenho de Nalak\'sha e dos sistemas auxiliares da Forja Primordial. Depois fale com a M.A.D.R.E. para ligar a Forja Primordial.', 'Barbaridade, nós chegamos é longe, $n.\n\nQuando os sistemas auxiliares estiverem funcionando, a M.A.D.R.E. vai conseguir fazer o diagnóstico.\n\nSó falta colocar as últimas peças.', '', '', '', '', '', '', 33528),
(57219, 'ptBR', 'Guardião Desenterrado', '', '', '', '', '', '', '', '', 33528),
(57218, 'ptBR', 'Guardião Desenterrado', '', '', '', '', '', '', '', '', 33528),
(57217, 'ptBR', 'Guardião Desenterrado', '', '', '', '', '', '', '', '', 33528),
(57216, 'ptBR', 'Cidade Velha', '', '', '', '', '', '', '', '', 33528),
(57215, 'ptBR', 'Engenho da Ascensão', '', '', '', '', '', '', '', '', 33528),
(57171, 'ptBR', 'Guardião Ramo d\'Ouro', '', '', '', '', '', '', '', '', 33528),
(57158, 'ptBR', 'Potencialização Elétrica', '', '', '', '', '', '', '', '', 33528),
(57157, 'ptBR', 'Ataque: o Império Negro', 'Rechace a ofensiva de N\'Zoth em Uldum.', 'É como previsto nas visões. Forças das trevas apareceram para reivindicar a Forja Primordial.\n\nPrecisamos detê-las, ou será o fim de Azeroth!', 'Fale novamente com o Sumo Sacerdote Amet em Ramkahen.', '', '', '', '', 'Fale novamente com o Sumo Sacerdote Amet em Ramkahen.', 33528),
(57155, 'ptBR', 'Cegando o olho', 'Fale com o Irmão Pique para se purificar de sua \"dádiva\".', 'Ah, $Go:a; $c que eu queria ver.\n\nAinda consigo sentir o toque dele, persistindo em você. Nossa vitória sobre o deus das profundezas não estará completa até removermos qualquer traço da infecção.\n\nGraças à minha pesquisa eu descobri uma forma menos dolorosa de removê-la.\n\nÉ só falar e daremos fim a esse pesadelo.', '', '', '', '', '', '', 33528),
(57153, 'ptBR', 'Distrito dos Anões', '', '', '', '', '', '', '', '', 33528),
(57146, 'ptBR', 'Rasgo de corrupção', '', '', '', '', '', '', '', '', 33528),
(57129, 'ptBR', 'Vale da Sabedoria', '', '', '', '', '', '', '', '', 33528),
(57112, 'ptBR', 'Testar Missão Compartilhada', '', 'Nada', 'Teste', '', '', '', '', '', 33528),
(57101, 'ptBR', 'Jaula de serpente de Zan-Tien', '', '', '', '', '', '', '', '', 33528),
(57089, 'ptBR', 'Incubadora Vil\'thik', '', '', '', '', '', '', '', '', 33528),
(57087, 'ptBR', 'Obliterador Baruk', '', '', '', '', '', '', '', '', 33528),
(57085, 'ptBR', 'Carroça de guerra potencializada', '', '', '', '', '', '', '', '', 33528),
(57080, 'ptBR', 'Recompensa adequada', '', 'O núcleo de força da Armadura Pessoal X-52 foi destruído na batalha contra o Gallywix, mas a invenção foi um sucesso!\n\nDuvido que qualquer um queira comprar os direitos da X-52 sem um núcleo de força que funcione, mas por que você não fica com a armadura? Ela é bem estilosa!\n\nAgora que Sucatópolis está salva e o Gallywix está convenientemente preso no próprio esbordoador mecânico, acho que eu vou renegociar aquele \"contrato\" dele.\n\nAfinal de contas, agora ele é \"público cativo\"!', '', '', '', '', '', '', 33528),
(57079, 'ptBR', 'Operação Sucatópolis', 'Complete o cenário de Sucatópolis.', 'Cara, você é um colírio! A chapa esquentou por aqui...\n\nEnquanto você estava entregando convite, Gallywix e o bonde dele tomaram Sucatópolis! Eles fizeram o Roberto Agarramalho de refém até ele entregar a Armadura Pessoal X-52!\n\nVocê tem que deter o Gallywix antes que seja tarde demais!', '', '', '', '', '', 'Fale com Roberto Agarramalho.', 33528),
(57078, 'ptBR', 'A lista VIP', 'Entregue os convites para o leilão particular de Agarramalho.', 'Enquanto você ficou ajudando o Agarramalho lá com a invenção dele, eu ralei aqui procurando compradores!\n\nVai ser um leilão privado. Só vamos convidar a elite, a nata, a creme de la creme, sacou?\n\nEu só deixei na lista os goblins mais ricos, mais classudos, mais influentes... menos o Gallywix, claro!\n\nEntrega esses convites pra mim enquanto eu termino os preparativos do leilão!', '', '', '', '', '', '', 33528),
(57077, 'ptBR', 'Procura-se compradores!', 'Fale com Espoleta Chaveforte na Selva do Espinhaço.', 'A Armadura Pessoal X-52 está pronta, finalmente, e o Gallywix saiu correndo com o rabo entre as pernas!\n\nE eu devo isso a você, $n!\n\nMas o nosso trabalho ainda não acabou. A melhor parte vem agora. Vamos leiloar a Armadura Pessoal X-52!\n\nA Espoleta Chaveforte deve ter uma lista dos compradores interessados. Dá uma passada lá no Esconderijo da Chaveforte pra avisar que está tudo pronto pro leilão!', '', '', '', '', '', '', 33528),
(57076, 'ptBR', 'Retorno ao Cair da Bruma', 'Fale novamente com o Voz da Tempestade Qian no Santuário Silencioso, que fica no Vale das Flores Eternas.', 'Já fizemos tudo que podíamos aqui. Sabemos o tamanho da ameaça que os mogus representam.\n\nA forja está em grade perigo, e cairá nas mãos deles se perdermos o controle do Vale.\n\nVoltemos ao Cair da Bruma para falar com os Rajani. É bom que eles saibam o que estamos enfrentando.', '', '', '', '', '', 'Fale novamente com o Voz da Tempestade Qian no Santuário Silencioso, que fica no Vale das Flores Eternas.', 33528),
(57075, 'ptBR', 'Coragem líquida', 'Monte em Mobi e derrote os exércitos mogus com o poder da cerveja.', 'Precisamos cuidar dos mogus. Pelo menos diminuir o número deles antes que eles invadam o Vale.\n\nPor mais que o Tio Chen seja apegado à cerveja, eu acho que podemos fazer melhor uso dela. Vamos subir no iaque e dar aos mogus alguma coisa para temer!', '', '', '', '', '', '', 33528),
(57074, 'ptBR', 'Ao portão', 'Vá em Mobi com Chen e Li Li até o Portão dos Celestiais Majestosos.', 'Mas que deveras fortuito que você tenha achado a cerveja e esse iaque para carregar!\n\nMas nós não podemos continuar aqui. Li Li já me curou o suficiente para a viagem. Podemos voltar para o portão no iaque e esperar que os mogus não notem a nossa passagem.\n\nMe avise quando estiver pront$Go:a; para partir.', '', '', '', '', '', '', 33528),
(57072, 'ptBR', 'Iaque multifuncional', 'Encontre algo para ajudar você a carregar a cerveja até Chen em Mogujia.', '<Os barris de cerveja são pesados e numerosos demais para você.\n\nTalvez você consiga achar alguma coisa, ou alguém, para ajudar.>', '', '', '', '', '', '', 33528),
(57071, 'ptBR', 'Nenhuma cerveja fica para trás', 'Localize os barris de cerveja abandonados no Monte Kun-Lai.', 'Que... dor de cabeça! Só há uma solução.\n\nVoamos por cima de uma caravana de cerveja abandonada. Você precisa encontrar a caravana e salvar a cerveja! Isso deve me devolver a força.\n\nE mais ainda, seria maravilhoso para o moral dos que lutam no Vale se você recuperasse a cerveja.', '', '', '', '', '', 'Localize os barris de cerveja abandonados no Monte Kun-Lai.', 33528),
(57070, 'ptBR', 'Massacre dos mogus', 'Mate mogus no Monte Kun-Lai.', 'Acho que isso é o que os meus amigos chamariam de \"ambiente rico em alvos\". É um eufemismo para \"estamos cercados e provavelmente vamos morrer\".\n\nVocê sabe o que isso quer dizer. Temos que matar o máximo de mogus possível! Não importa como, só se livre deles!', '', '', '', '', '', '', 33528),
(57069, 'ptBR', 'Cortem as cabeças', 'Mate comandantes mogus.', 'Certo. Estamos presos no meio de três exércitos mogus, e o Tio Chen ainda está ferido demais para andar.\n\nMas ainda há esperança. Temos uma chance de eliminar os líderes desses exércitos. Talvez isso os atrase ou distraia o suficiente para voltarmos para o portão!\n\nVeja se você consegue ir lá e derrubar o maior mogu, o mais malvado que você encontrar. Esses são os comandantes.', '', '', '', '', '', '', 33528),
(57068, 'ptBR', 'De butuca na pipa', 'Voe na Pipa de Chen para observar os exércitos mogus.', 'Soubemos que havia mogus atacando, mas eu não fazia ideia de que eram tantos!\n\nDeve haver um jeito de detê-los antes que eles varram o Vale. Rápido, vamos voar e fazer o reconhecimento.\n\nPor sorte temos uma pipa aqui para três pessoas. Geralmente cabe mais, mas eu comi bem no almoço.', '', '', '', '', '', '', 33528),
(57067, 'ptBR', 'Mogus nos portões', 'Fale com Chen e Li Li Malte do Trovão no Portão dos Celestiais Majestosos.', 'Chegou a hora. Os outros clãs mogus estão de olho no Vale das Flores Eternas.\n\nMas não o conquistarão.\n\nAlguns aliados seus já seguiram para o portão para fazer o reconhecimento da força inimiga. Se você se achar dign$Go:a; de tal missão, encontre-os lá.', '', '', '', '', '', 'Fale com Chen e Li Li Malte do Trovão no Portão dos Celestiais Majestosos.', 33528),
(57059, 'ptBR', 'Bora pro pau!', 'Derrote $1oa Biltres de Aluguel.', 'Que fita, $n! Maior fita!\n\nGallywix e os capangas dele estão lenhando minha oficina, mas ele pode tirar o triciclinho da chuva se acha que vou abrir mão da Armadura Pessoal X-52!\n\nVocê vai ter que dar um trato naqueles capangas antes que o lugar inteiro pegue fogo, junto com as minhas invenções!', '', '', '', '', '', '', 33528),
(57058, 'ptBR', 'Campo \"aminado\"', 'Pegue a Batida de Coco Refrescante no campo minado.', 'O protótipo da Armadura Pessoal X-52 está pronto para o teste final! \n\nBarulho alto, onda de choque, esse tipo de coisa não incomoda você, né, $n?\n\nNo teste final nós vamos botar você na Armadura Pessoal X-52 pra atravessar um campo minado!\n\nColoquei uma batida de coco refrescante lá no meio do campo. Considere a bebida uma recompensa adequada por chegar ao oásis... e sobreviver às explosões no caminho, claro!', '', '', '', '', '', '', 33528),
(57053, 'ptBR', 'Teste de força bruta', 'Conclua o experimento de Roberto Agarramalho.', 'Agora, com os termoplugues, nós estamos prontos para testar o protótipo da Armadura Pessoal X-52!\n\nInfelizmente, os meus assistentes no laboratório se demitiram ou foram pro saco. É uma pena mesmo! Pior pra eles, melhor pra você. $n... Agora VOCÊ vai poder usar a Armadura Pessoal X-52!\n\nQue empolgante!\n\nO próximo teste será conduzido pelo meu novo assistente do laboratório mecanizado. Vá lá na oficina principal e aperte o botãozão vermelho para começar.\n\nNão se preocupe. Eu vou dar instruções pelo comunicador do X-52!', '', '', '', '', '', '', 33528),
(57052, 'ptBR', 'Eu tenho o que você precisa', 'Entregue o pacote a Roberto Agarramalho.', 'Trato é trato, $n. Toma aqui os termoplugues que você pediu.\n\nMas diz lá pro velho Agarramalho que eu não tenho mais nenhuma amostra grátis. Se ele precisar de mais termoplugues, é bom se preparar pra pagar.\n\nDe qualquer forma, foi um prazer fazer negócio com você...\n\nAgora pode vazar. Vai lá.', '', '', '', '', '', '', 33528),
(57051, 'ptBR', 'Não consta para nós o pagamento desta fatura', 'Cobre $1oa dívidas não pagas.', 'Você precisa de termoplugues? Veio ao lugar certo, garot$Go:a;.\n\nMas eu não vendo fiado, não. Já tomei calote demais. Tá sendo fácil, não. Se não me pagarem logo... assim quebra a banca.\n\n<Cronk Graxafuso pensa por um instante.>\n\nOlha, vou lhe falar... Se você der uns pedalas por aí praqueles inúteis me pagarem, eu pago você com os termoplugues.\n\nNão tem oferta melhor na praça.', '', '', '', '', '', '', 33528),
(57049, 'ptBR', 'Cofre das Almas', '', '', '', '', '', '', '', '', 33528),
(57048, 'ptBR', 'Compras de peças', 'Fale com Cronk Graxafuso.', 'Vou precisar de mais componentes para completar a próxima fase de testes.\n\nNo momento, o mais urgente são os termoplugues e adaptadores de termoplugue! Vou explicar por que mais tarde...\n\nO Cronk Graxafuso tem uma loja perto da entrada da cidade. Vai lá e dá um jeito de ele entregar as peças.\n\nNão ligo para o preço, manda ele botar na conta! Não tenho tempo para negociar agora. Tenho que preparar as modificações da Armadura Pessoal X-52!', '', '', '', '', '', '', 33528),
(57047, 'ptBR', 'Um experimento simples', 'Ajude Roberto Agarramalho.', 'Agora que você entregou as peças necessárias, posso começar a testar meu último protótipo!\n\nBatizei de Armadura Pessoal X-52! Ela será praticamente indestrutível!\n\nGallywix sempre cobiçou minhas invenções e, agora que sabe da X-52, sei que vai querer armar alguma. Tenho que completar o protótipo antes que Gallywix invente algum jeito de roubar ela de mim!\n\nEu bem preciso de mais um par de mãos para ajudar nos experimentos.\n\nPosso contar com você, $n?', '', '', '', '', '', '', 33528),
(57045, 'ptBR', 'Entrega especial', 'Entregue o pacote a Roberto Agarramalho.', 'Que bom que você finalmente apareceu, $n. Tenho uma entrega importantona, e não tem goblin em quem eu confie mais do que você.\n\nTá bom, tá bom, sei que isso não é lá grande coisa, mas tá osso pra achar entregador que preste hoje em dia!\n\nO pacote é pro Roberto Agarramalho. Ele tem uma oficina lá em Sucatópolis, e preciso que você leve isso lá. Ele andou trabalhando num lance sinistro!\n\nEntrega o pacote e, pelo amor da grana... NÃO DEIXA CAIR!\n\nVocê não faz ideia do trabalho que deu pra achar esse treco!', '', '', '', '', '', '', 33528),
(57043, 'ptBR', 'Pequenos amigos, grandes negócios', 'Fale com Espoleta Chaveforte na Selva do Espinhaço.', 'Mas olha vejam só, se não é $n? Você é bem $go:a; $ggoblin:goblina; que a gente tava procurando!\n\nJá faz um tempão desde Kezan, né não? A gente se divertiu muito no rolé do bonde naqueles dias!\n\nEntão, não quero ficar de chororô contigo, mas a Espoleta Chaveforte me mandou pra te achar! Ela tá juntando o mulão todo de novo pra um serviço sinistro! SINISTRO!\n\nTipo assim, queria ter mais tempo pra ficar de lero, mas a gente tem que ralar. Tempo é dinheiro, tá ligad$go:a;?\n\nSe tu quiser chegar junto no serviço, acha a Espoleta. Ela vai te dar o papo reto!', '', '', '', '', '', '', 33528),
(57039, 'ptBR', 'Vale dos Espíritos', '', '', '', '', '', '', '', '', 33528),
(57023, 'ptBR', 'Artefato mogu sopesado', '', '', '', '', '', '', '', '', 33528),
(57022, 'ptBR', 'Ataque: avanço Amatet', '', '', '', '', '', '', '', '', 33528),
(57008, 'ptBR', 'Ataque: os clãs em guerra', 'Rechace o ataque dos mogus ao Vale das Flores Eternas.', 'Os clãs mogus são oportunistas, e pretendem tomar o Vale enquanto nossos defensores estão se recuperando da ofensiva de N\'Zoth.\n\nOs mogus são covardes. E tolos.\n\nMostre a eles o quanto.', 'Fale novamente com o Voz da Tempestade Qian no Santuário Silencioso.', '', '', '', '', 'Fale novamente com o Voz da Tempestade Qian no Santuário Silencioso.', 33528),
(57001, 'ptBR', 'Vale da Honra', '', '', '', '', '', '', '', '', 33528),
(56906, 'ptBR', 'Coroa da Boa Sorte', 'Colete botões em Hibérnia, Dun Morogh e no Contraforte de Eira dos Montes.', 'Essas flores me lembram da própria Eluna! Tenho comigo flores parecidas o ano inteiro, como um tributo à graciosidade vigilante dela.\n\nQuem sabe você gostaria de fazer o mesmo?\n\nSua coroa é feita de botões comuns que logo vão murchar e morrer. É um triste destino para belezas tão delicadas, só que a minha coroa é feita de flores semelhantes que eu fiz durar o ano inteiro! Se você me trouxer flores específicas que só desabrocham apenas durante o Festival da Lua, posso abençoá-las para que você possa curtir a sua coroa o ano inteiro.', '', '', '', '', '', 'Fale novamente com Myrael Lunaflor na Clareira da Lua.', 33528),
(56905, 'ptBR', 'Coroa de Flores Sombrias', 'Colete botões na Floresta do Crepúsculo, Floresta de Pinhaprata e Desolação.', 'Que flores mais sóbrias... mas elas têm uma beleza só delas, você não acha? Se ao menos elas durassem.\n\nPermita-me ajudar.\n\nTodo Festival da Lua, flores semelhantes às suas brotam pelo mundo. Elas têm uma conexão especial com Eluna, que eu posso potencializar. Se você as trouxer para mim, posso preservá-las para que enfeitem por muito mais tempo que uma flor comum.', '', '', '', '', '', 'Fale novamente com Myrael Lunaflor na Clareira da Lua.', 33528),
(56904, 'ptBR', 'Coroa da Prosperidade', 'Colete flores da Cratera Un\'Goro, Selva do Espinhaço e Sertões Setentrionais.', 'Sua coroa é tão colorida! Que rosas e amarelos e azuis tão lindos... pena que duram pouco.\n\nAinda que essas flores sejam fugazes, sei de outras que não são!\n\nFlores parecidas com essas brotam em todo Festival da Lua. Elas têm uma conexão especial com Eluna que eu posso potencializar, graças a você. Traga-as para mim, e faremos uma coroa que você poderá curtir o ano inteiro!', '', '', '', '', '', 'Fale novamente com Myrael Lunaflor na Clareira da Lua.', 33528),
(56903, 'ptBR', 'Coroa da Coragem', 'Colete flores na Floresta do Canto Eterno, nas Terras Agrestes e em Mulgore.', 'Vejo que você curte as flores cor-de-rosa. É uma pena que essas flores todas na sua coroa um dia perecerão.\n\nTalvez eu possa ajudar com isso.\n\nAinda que essas sejam flores comuns, conheço algumas parecidas que só brotam durante o Festival da Lua. Se você as trouxer para mim, posso imbuí-las no poder de Eluna para que durem o ano inteiro.', '', '', '', '', '', 'Fale novamente com Myrael Lunaflor na Clareira da Lua.', 33528),
(56889, 'ptBR', 'Errantes Feridos', 'Cure $1oa Operários Errantes.', 'Ah, $Gmeu amigo:minha amiga;! Voltou para nos ajudar mais um pouco?\n\nComo você pode ver, ainda estamos enfrentando essas criaturas, e parece que não vai acabar tão cedo.\n\nÉ uma guerra de atrito, e estamos em clara desvantagem: os nossos feridos só aumentam.\n\nPor favor, ajude os feridos que você encontrar nas ruínas.', '', '', '', '', '', '', 33528),
(56771, 'ptBR', 'Guerreiros perdidos para o tempo', 'Fale com os Rajani no Santuário Silencioso.', 'De acordo com o relatório de patrulha que tu encontrou, os Rajani estão entocados no Santuário Silencioso, defronte à Vila do Cair da Bruma. \n\nDiz aqui que eles são isolados e perigosos, então é melhor tomar cuidado ao se aprochegar.\n\nA gente se vê por lá.', '', '', '', '', '', '', 33528),
(56751, 'ptBR', 'Requisições de Ferrúgia: osso calcificado', 'Leve $1oa de Minério de Prata Procelosa para Gila Cruzalinha.', '', '', '', '', '', '', '', 33528),
(56750, 'ptBR', 'Requisições de Ferrúgia: osso calcificado', 'Leve $1oa de Minério de Prata Procelosa ao Skaggit.', '', '', '', '', '', '', '', 33528),
(56647, 'ptBR', 'A ameaça mantídea', 'Fale novamente com o Voz da Tempestade Qian no Santuário Silencioso.', 'Os mantídeos estão corrompendo as árvores kypari deles para imbuir o âmbar com o poder de N\'Zoth. O enxame já é ameaça suficiente. N\'Zoth os transformaria em algo ainda mais atroz.\n\nOs Shado-Pans precisam saber disso. Sugiro que você leve a informação aos outros aliados também.', '', '', '', '', '', 'Fale novamente com o Voz da Tempestade Qian no Santuário Silencioso.', 33528),
(56645, 'ptBR', 'Coração do enxame', 'Voe com Taoshi na Pipa Shado-Pan.', 'Precisamos saber o que vamos enfrentar. Antes de voltarmos ao Espinhaço da Serpente, deveríamos aproveitar para sondar o enxame.\n\nVamos voar sobre o Coração do Medo. De lá de cima, poderemos avaliar as forças da Imperatriz Shek\'zara. Assim será possível calcular até que ponto N\'Zoth reforçou as fileiras dela.', '', '', '', '', '', '', 33528),
(56617, 'ptBR', 'Enxame unificado', 'Infiltre Klaxxi\'vess.', 'Ao que parece, os mantídeos já estavam produzindo o âmbar corrompido há algum tempo antes da nossa... intervenção. É de se concluir que eles mantenham um estoque em algum lugar.\n\nOs batedores Shado-Pans andam relatando uma presença maior dos guerreiros do enxame em Klaxxi\'vess. Aposto que estão guardando o âmbar corrompido.\n\nMe encontre lá. Se temos uma chance de destruir o âmbar, temos que aproveitá-la.', '', '', '', '', '', '', 33528),
(56616, 'ptBR', 'Velhas caras, novos problemas', 'Mate o Vigia Vl\'thax.', 'Um dos lacaios de N\'Zoth parece ter percebido nossa presença.\n\nVamos fazer uma visitinha?', '', '', '', '', '', '', 33528),
(56580, 'ptBR', 'Segredos do âmbar', 'Colete $1oa pedaços de Âmbar Corrompido.', 'A Câmara do Porvir abriga uma pequena seção dos Zara\'thik, mantídeos sob o comando direto da nova imperatriz. Alguns deles podem ter recebido pedaços de âmbar como aquele que você encontrou.\n\nOs Shado-Pans estão interessados em quaisquer outros pedaços que pudermos obter.', '', '', '', '', '', '', 33528),
(56578, 'ptBR', 'Raízes podres', 'Acabe com a fonte da corrupção na Câmara do Porvir.', 'Debaixo de Kypari Vor há uma grande câmara onde os mantídeos cuidam da árvore. Lá deve ser a fonte da corrupção.\n\nTemos que entrar naquela câmara e acabar com isso. Não podemos deixar que N\'Zoth potencialize o enxame.', '', '', '', '', '', '', 33528),
(56577, 'ptBR', 'Colmeia aleijada', 'Mate $1oa mantídeos Kor\'thik em Kor\'vess.', 'Os mantídeos daqui trabalham febrilmente para colher o âmbar da árvore.\n\nTalvez matar uma patada deles vá atrapalhar os esforços.', '', '', '', '', '', '', 33528),
(56576, 'ptBR', 'Exterminação aqir', 'Mate $1oa Empaladores Aqir.', 'Tem bicho demais no céu para a gente conseguir escapar ileso. \n\nO enxame vai nos cercar assim que ligarmos o motor do avião!\n\nEsses insetos vão para debaixo da terra... de um jeito ou de outro. A gente pode acelerar o processo, se é que você me entende.', '', '', '', '', '', '', 33528),
(56575, 'ptBR', 'Kor\'vess 2, a missão', 'Investigue Kor\'vess.', 'Você achou isso junto com um membro do enxame? Escorre de corrupção... e poder. Se o restante do âmbar dos mantídeos estiver corrompido assim, teremos sérios problemas.\n\nBem a oeste, no Ermo do Medo, fica Kor\'vess, uma grande árvore kypari que fornece ao enxame a maior parte do âmbar. Dali poderemos determinar quanto dos estoques foi infundido com a energia dos Deuses Antigos.\n\nNos encontraremos mais perto da árvore.', '', '', '', '', '', '', 33528),
(56574, 'ptBR', 'Reflexões ambarinas', 'Leve o Âmbar Coberto de Gosma até os Shado-Pans no Espinhaço da Serpente.', '<Uma gosma escura e viscosa pinga desse grande pedaço de âmbar. Tentar limpá-la é inútil, pois a substância parece ser criada pelo próprio âmbar.\n\nEnquanto você o segura, sussurros ininteligíveis se infiltram na sua mente.\n\nOs Shado-Pans vão querer examiná-lo.>', '', '', '', '', '', 'Leve o Âmbar Coberto de Gosma até os Shado-Pans no Espinhaço da Serpente.', 33528),
(56550, 'ptBR', 'Limpeza de cadáver', 'Queime $1oa Cadáveres com Ovos.', 'Nossos amigos continuam tombando, com esses insetos saindo dos ninhos e atacando os nossos acampamentos.\n\nÉ um trabalho terrível para se pedir que alguém faça, mas precisamos nos livrar dos corpos o mais rápido possível.\n\nNão podemos permitir que os nossos mortos virem fertilizante daqueles ovos nojentos.', '', '', '', '', '', '', 33528),
(56542, 'ptBR', 'Esperança reanimada', 'Fale com Ra-den para voltar à Câmara do Coração.', 'Sua persistência me enche de esperança pelo futuro deste mundo.\n\nVamos voltar à sua \"Câmara do Coração\". Como guardião da Forja Primordial, creio que posso ajudar em seus esforços de restauração.\n\nFale comigo quando você estiver $gpronto:pronta;, e eu nos levarei até lá.', '', '', '', '', '', '', 33528),
(56541, 'ptBR', 'O Engenho de Nalak\'sha', 'Siga a passagem secreta no Palácio Mogu\'shan e reative o Engenho de Nalak\'sha.', 'Seu povo já provou que eu estava enganado no passado, então lhe darei uma chance de fazê-lo novamente.\n\nA estrutura titânica que contém o Engenho de Nalak\'sha se estende por toda Pandária. Há mais formas de alcançá-la, além das Galerias Mogu\'shan.\n\nExistem muitas rotas, mas a mais próxima seria pelo Palácio Mogu\'shan. As câmaras abaixo do palácio se conectam com as galerias. \n\nBusque lá o seu destino, $gcampeão:campeã;.', '', '', '', '', '', '', 33528),
(56540, 'ptBR', 'Prova de tenacidade', 'Obtenha um Troféu do Conquistador do comandante de um Ataque no Vale das Flores Eternas.', 'Se o Grão-guardião está tão convencido de que não temos a menor chance contra nossos inimigos, talvez uma demonstração de força o influencie.\n\nNão sei como você cuidaria disso, mas, se puder trazer prova de uma vitória contra aqueles que ameaçam o Vale, talvez isso o convença da necessidade de ação.', '', '', '', '', '', '', 33528),
(56539, 'ptBR', 'Em busca dos Rajani', 'Colete um Relatório de Patrulha Mogu de um mogu no Vale das Flores Eternas.', 'Agora que temos uma ideia do que estamos procurando, a próxima pergunta é: onde poderemos encontrar?\n\nCom os constantes conflitos internos dos mogus, é provável que cada clã guarde registros do paradeiro dos adversários. Se encontrarmos tais informações, elas podem nos levar aos Rajani.\n\nBusque os campeões dos mogus. São eles que provavelmente carregam relatórios das localizações dos inimigos.', '', '', '', '', '', '', 33528),
(56538, 'ptBR', 'Clãs dos mogus', 'Ajude o Andarilho das Lendas Cho a descobrir a origem do Signo Mogu Misterioso no Trono do Conhecimento.', 'Você diz que um mogu pediu sua ajuda? É bem incomum da parte deles. \n\nEu ficaria feliz em ajudar a desvendar a origem desse signo. Sinceramente, a possibilidade de encontrar um clã mogu que não é abertamente hostil me interessa muito. Pense nas possibilidades!\n\nVamos botar mãos à obra. Temos que consultar os volumes sobre os vários clãs mogus no vale para descartar alguns deles.', '', '', '', '', '', '', 33528),
(56537, 'ptBR', 'O signo misterioso', 'Leve o Signo Mogu Misterioso para o Andarilho das Lendas Cho no Trono do Conhecimento, que fica no Vale das Flores Eternas.', '<O mogu morto agarra um signo na mão — um símbolo do misterioso clã ao qual ele pertencia.\n\nTalvez, se rastrear o clã, você descubra mais sobre a invasão mantídea das Galerias Mogu\'shan e como eles podem ser derrotados.\n\nO Andarilho das Lendas Cho é famoso pelo conhecimento que tem de Pandária. Talvez ele saiba identificar a origem do signo mogu.>', '', '', '', '', '', '', 33528),
(56536, 'ptBR', 'Nunca é fácil', 'Fale com Magni Barbabronze diante das Galerias Mogu\'shan, no Monte Kun-Lai.', 'Até onde sei, as Galerias Mogu\'shan ainda estavam abandonadas. \n\nNão vai ser tão duro de alcançar o engenho, pois já derrotamos os guardiões mogus dali.\n\nBueno, o que estamos esperando? Vamos ligar o engenho!', '', '', '', '', '', '', 33528),
(56472, 'ptBR', 'O Acordo de Uldum', 'Aprenda sobre as ameaças a Uldum em Ramkahen.', 'Você busca assistência na defesa da Forja Primordial? Percebo que nossas metas estão alinhadas.\n\nOs Salões Primordiais são uma mera fração do verdadeiro escopo da forja. Qualquer ameaça a Uldum seria uma potencial ameaça à forja, e Uldum hoje enfrenta inúmeros inimigos.\n\nEstávamos prestes a convocar o Alto Conselho quando esses Errantes chegaram sem aviso. Você gostaria de aprender sobre essas ameaças conosco?', '', '', '', '', '', '', 33528),
(56402, 'ptBR', 'Moedas errantes', 'Recolha $1oa Moedas Errantes.', 'Pode ser tarde demais para os nossos irmãos e irmãs que caíram em batalha, mas ainda podemos oferecer algum consolo às famílias.\n\nTodo Errante carrega uma moeda única, símbolo de sua posição como integrante de nosso grupo.\n\nSe achar essas moedas, traga-as para mim, por favor, e eu cuidarei para que sejam entregues aos entes queridos.', '', '', '', '', '', '', 33528),
(56377, 'ptBR', 'Forjando um caminho', 'Fale novamente com Magni Barbabronze na Câmara do Coração e descubra o destino da Forja Primordial.', 'Sou grato pela ajuda lá na forja. Fico atucanado do N\'Zoth ter negaceado tudo tão rápido, mas chegamos a tempo de impedir que estragasse tudo!\n\nAgora tá na hora de botar ela de novo em força total. A M.A.D.R.E. tá trabalhando numa solução, e a gente acha que tem um plano.', '', '', '', '', '', '', 33528),
(56376, 'ptBR', 'Ameaças emergentes', 'Conclua um ataque a Uldum.', 'Os tol\'vir consideram a proteção dos constructos titânicos aqui em Uldum como um dever sagrado. Entretanto, há cada vez menos de nós, e enfrentamos ameaças cada vez maiores.\n\nMesmo com a força de nossos novos aliados, só conseguiremos rechaçar os inimigos por um tempo limitado. Caso algum deles tenha um surto de poder, poderão nos superar e colocar a forja em risco. É com isso que precisamos da sua ajuda.\n\nFale com o Alto-comandante Kamsés para avaliar nossa situação atual.', '', '', '', '', '', '', 33528),
(56375, 'ptBR', 'Rumo a Ramkahen', 'Fale com o Rei Phaoris em Ramkahen.', 'Parece que a gente vai ter que esperar um bocado enquanto a M.A.D.R.E. vê o que fazer com a forja. Para a gente não amorcegar, vamos pelear para nenhum abagualado vir se embretar por aqui.\n\nTu devia se aprochegar com os tol\'vir em Ramkahen. Sei que tu já deu uma força para eles no passado, então eles bem podem nos ajudar a manter a forja longe dos imprestáveis.', '', '', '', '', '', '', 33528),
(56374, 'ptBR', 'Um problema titânico', 'Encontre Magni Barbabronze nos Salões Primordiais, em Uldum.', 'A gente não pode dormir no ponto. \n\nSem a Forja Primordial, Azeroth fica facinha pra corrupção do N\'Zoth. Sem falar que lá tem uma arma capaz de arrasar tudo que é vivente em Azeroth!\n\nA gente tem que correr para a forja agora mesmo. A M.A.D.R.E. toma conta das coisas aqui.\n\nTe apruma, eu te encontro lá.', '', '', '', '', '', '', 33528),
(56308, 'ptBR', 'Ataque: os aqir desenterrados', 'Rechace a ofensiva aqir em Uldum.', 'Estamos perdendo nossa posição. Eu nunca vi tantos aqir na vida!\n\nNão sei quanto tempo vamos conseguir aguentar. Precisamos de você para forçá-los a recuar!', 'Fale novamente com Arik Escorpicada no Obelisco da Lua.', '', '', '', '', 'Fale novamente com Arik Escorpicada no Obelisco da Lua.', 33528),
(56209, 'ptBR', 'Os Salões Primordiais', 'Derrote as tropas Amatet e reative a forja nos Salões Primordiais.', 'Parece que os Salões Primordiais foram tomados por um bando de tol\'vir que se chamam de Amatet. Não sei muita coisa deles, só que acabaram de chegar e não querem muita conversa.\n\nVamos ter que entrar lá e reativar a forja, ou Azeroth já era!', '', '', '', '', '', '', 33528),
