(56075, 'ptBR', 'Poder roubado', 'Colete $1oa Pergaminhos de Shirakess.', 'É do caos que as nagas tiram seu poder. \n\nCada pergaminho escrito é conhecimento compartilhado... esse conhecimento é poder.\n\nOu seja: se roubarmos o conhecimento, nós roubamos o poder.\n\nÉ uma lógica meia-boca, mas vamos em frente assim mesmo!', '', '', '', '', '', '', 33528),
(56074, 'ptBR', 'Conduíte do Caos', '', '', '', '', '', '', '', '', 33528),
(56064, 'ptBR', 'Ataque: o Império Negro', 'Rechace o ataque de N\'Zoth ao Vale das Flores Eternas.', 'Não creio... O Império Negro está se materializando aqui no meio do Vale!\n\nTemos que agir agora!', 'Fale novamente com o Andarilho das Lendas Cho no Trono do Conhecimento.', '', '', '', '', 'Fale novamente com o Andarilho das Lendas Cho no Trono do Conhecimento.', 33528),
