(55350, 'ptBR', 'Ataque: avanço Amatet', 'Rechace a ofensiva Amatet em Uldum.', 'Os Amatet querem se apossar da Forja Primordial. Não podemos deixar que ela caia nas mãos deles de novo!\n\nNosso pessoal está defendendo a entrada, mas eles vão ser esmagados se os Amatet atacarem com força total.\n\nFaça o que puder para desbaratar as tropas inimigas antes que seja tarde demais.', 'Fale novamente com o Alto-comandante Kamsés em Ramkahen.', '', '', '', '', 'Fale novamente com o Alto-comandante Kamsés em Ramkahen.', 33528),
(55036, 'ptBR', 'Um lugar terrível', 'Conclua uma Visão de N\'Zoth.', 'Talvez você tenha notado todas as perturbações acontecendo em Azeroth. O Deus Antigo está em ascensão, o que é péssimo para todos nós.\n\nDe vez em quando, um desses Pilares da Verdade Infinita aparece. Que nome maravilhoso, né? Eu levo o maior jeito para dar nomes às coisas. \n\nOnde estávamos? Ah, sim, certo, esses pilares concedem acesso à mente do Deus Antigo. Eles lhe darão uma amostra do que talvez esteja por vir, como esse mundo ficará se não conseguimos derrotá-lo.\n\nVocê quer mesmo ver pessoalmente?', '', '', '', '', '', '', 33528),
(54990, 'ptBR', 'A nova guarda', 'Fale com Tess Greymane na Bastilha Ventobravo.', 'Tenho que falar com meus pais de novo. Acho que meu pai e eu temos assuntos a debater.\n\nVamos nos encontrar na Bastilha Ventobravo. Eu quero lhe agradecer mais formalmente.', '', '', '', '', '', '', 33528),
(54984, 'ptBR', 'O sono dos lobos', 'Entre no Portal Onírico e guie Tess.', 'A essência de Tess agora vagueia por uma região do Sonho Esmeralda que incuti nos pensamentos dela. E eu concedi a ela o meu dom, mas ela ainda precisa de alguém para guiá-la.\n\nEntre no Sonho pelo portal atrás de mim, e você chegará onde ela dorme. Veja se consegue mostrar a ela como a fúria pode cegar um mortal.', '', '', '', '', '', '', 33528),
(54983, 'ptBR', 'O despertar do sonhador', 'Defenda Vassandra Garrevolta enquanto ela evoca Goldrinn.', 'Com isso já poderei evocar o Antigo.\n\nAlguns visitantes indesejados talvez respondam ao chamado antes. Proteja-me enquanto executo o ritual!', '', '', '', '', '', '', 33528),
(54982, 'ptBR', 'O espírito do caçador', 'Obtenha os caninos dos lobos Presa-da-neblina.', 'A outra coisa que pode ser necessária para o ritual são os caninos de um lobo.\n\nUma matilha se instalou nos arredores do Casarão dos Brumanto. Traga-me os caninos deles. Aguardarei seu retorno no Bosque do Crepúsculo.', '', '', '', '', '', 'Fale com Vassandra Garrevolta no Bosque do Crepúsculo.', 33528),
(54981, 'ptBR', 'Um grito à lua', 'Colete um broto de Graça-de-eluna.', 'A Floresta do Crepúsculo tem uma conexão direta ao Sonho Esmeralda. Por meio dessa conexão, talvez eu consiga convocar Goldrinn, o Antigo. Ele vai dar à princesa um gosto da maldição que ela persegue, correndo tanto risco.\n\nUma rara planta viceja no oriente dessas matas, colete-a e vamos conversar no Bosque do Crepúsculo. Ela me ajudará com o ritual.', '', '', '', '', '', 'Fale com Vassandra Garrevolta no Bosque do Crepúsculo.', 33528),
(54980, 'ptBR', 'A noite dos Nocturnos', 'Capture Olhos Sangrentos e leve-a de volta ao Monte Corvo.', 'A Princesa Greymane me informou da situação, e eu tenho uma ideia do que fazer para ajudar.\n\nPorém, primeiro preciso de um favor em troca de um favor. Os moradores da Floresta do Crepúsculo têm sido acossados por uma integrante feroz da matilha Nocturno, chamada de \"Olhos Sangrentos\". Leve o sedativo do Mestre Espargosa e traga-me a worgen ainda viva. Ela será uma cobaia perfeita para o teste das curas.', '', '', '', '', '', '', 33528),
(54977, 'ptBR', 'Floresta do Crepúsculo', 'Fale com Vassandra Garrevolta na Floresta do Crepúsculo.', 'Tem uma elfa noturna que conheci em Teldrassil, Vassandra Garrevolta, que talvez possa educar Tess sem recorrer a uma medida tão extrema. Foi ela que ajudou nosso povo com nossa maldição, no começo.\n\nVassandra agora está na Floresta do Crepúsculo, tentando ajudar os habitantes do Monte Corvo a tentar curar os worgens selvagens da região. Se tem alguém que conhece a maldição, é ela.\n\nTenho um pedido mais pessoal: não deixe minha filha fazer nada impensado. Ela puxa o pai nessas coisas.', '', '', '', '', '', '', 33528),
(54976, 'ptBR', 'A sombra de Guilnéas', 'Fale com Tess Greymane na Bastilha Ventobravo.', '$gCampeão:Campeã; de Guilnéas!\n\nTenho uma carta da Princesa Tess Greymane endereçada a você. Ela solicita a sua presença na Bastilha Ventobravo.', '', '', '', '', '', '', 33528),
