(54036, 'ptBR', 'Um processo sistemático', 'Fale com Nomi.', 'Como você já deve ter reparado, o Vinheiro Iltheux é muito sistemático na produção do vinho, mas a receita dele é antiga e só levava os Filhos da Noite em consideração. \n\nPrecisamos de algo que apele aos diferentes paladares da Horda!\n\nFale com Nomi e veja se ele tem algo em mente para dar uma apimentada nas coisas.', '', '', '', '', '', '', 33528),
(54027, 'ptBR', 'Ameaça contida', 'Fale novamente com a Guarda-lâmina Sonji no Castelo Grommash, em Orgrimmar.', 'Isso vai dar um jeito nas nagas!\n\nVocê terá a honra de informar à Guarda-lâmina Sonji que a ameaça à costa de Zuldazar foi contida.', '', '', '', '', '', '', 33528),
(54026, 'ptBR', 'Tá feito', 'Fale novamente com o Comandante Dresh no Castelo Grommash, em Orgrimmar.', 'Eu vou ficar um pouquinho mais para ter certeza de que os peões vão voltar a trabalhar. \n\nVocê volta para Orgrimmar e avisa ao Comandante Dresh que não precisa mais se preocupar com esse posto avançado.', '', '', '', '', '', '', 33528),
(53908, 'ptBR', 'À nossa espera', 'Volte para o Castelo Grommash, em Orgrimmar.', 'Vamos voltar para Orgrimmar.\n\nKiro deve estar nos aguardando. \n\nNão vamos deixar ele esperando à toa.', '', '', '', '', '', '', 33528),
(53907, 'ptBR', 'Sentir o gostinho', 'Leve uma prova do Vinho de Nomi para ganhar a aprovação do Vinheiro Iltheux.', 'Acho que é vinho, isso que a gente fez, $p!\n\nVamos ver se o vinheiro vai aprovar nossa safra. \n\nLeve uma prova para ver o que o Iltheux acha.', '', '', '', '', '', '', 33528),
(53906, 'ptBR', 'Fermentando para a Horda', 'Recolha os ingredientes para criar um vinho digno da Horda.', 'A receita do Vinheiro Iltheux pode melhorar um pouquinho. \n\nAlguns ingredientes especiais, uns ajustezinhos no processo e pronto. \n\nAcho que se acrescentar ignídea fermentada já resolve. Depois, filtramos tudo com um tecido especial, feito a partir da fibra de sedasa. \n\nTem sedasa de sobra voando pelo vinhedo, e a Chefe Mida consegue essas flores sem a menor sombra de dúvida, mas vai ter um preço...', '', '', '', '', '', '', 33528),
(53905, 'ptBR', 'Funções condizentes', 'Atribua novas funções a Micah Casco Largo, à Chefe Mida e a Nomi.', 'Iltheux não está sabendo tirar proveito dos ajudantes.\n\nVamos consertar a situação.\n\nAtribua novas funções aos assistentes, funções mais condizentes.\n\nSe quiser, eu posso dar umas sugestões.', '', '', '', '', '', '', 33528),
(53904, 'ptBR', 'Os assistentes do vinheiro', 'Fale com Micah Casco Largo, Chefe Mida e Nomi.', 'O Vinheiro Iltheux supervisiona toda a produção de vinho arcano da Horda. \n\nEle está habituado a fazer tudo sozinho, mas a Horda mandou ajuda para acelerar o processo. \n\nGerou o efeito contrário. \n\nTemos que resolver isso. \n\nQue tal você dar uma volta pelo vinhedo para ver como andam as coisas? Eu vou fazer umas perguntinhas ao vinheiro.', '', '', '', '', '', '', 33528),
(53903, 'ptBR', 'O encontro com Meerah', 'Encontre Meerah no Vinhedo do Crepúsculo, em Suramar.', 'Parece que progredimos bastante.\n\nVocê pode ir encontrar a Meerah?\n\nEu quero saber se ela encontrou o vinheiro em Suramar.', '', '', '', '', '', '', 33528),
(53902, 'ptBR', 'O fim da Chamaré', 'Mate a Chamaré Nezara.', 'As proteções de Nezara foram abaixo, mas isso não quer dizer que ela está indefesa. \n\nTem um brutamontes do lado dela que vai dar trabalho. Eu vou apunhalar o sujeito e você cuida da Chamaré.', '', 'Líder das nagas Nazeshi que vem invadindo a Costa de Zuldazar.', 'Chamaré Nezara', '', '', '', 33528),
(53901, 'ptBR', 'Explosão nunca falha', 'Plante os Explosivos Voláteis nos Lançadores de Arpões das nagas, depois detone-os para criar um chamariz.', 'A área em que a Chamaré Nezara se encontra está fortemente protegida. Você vai ter que providenciar um chamariz. \n\nLeve esses explosivos. Plante nos lançadores de arpão das nagas. Assim que forem detonados, os guardas vão sair na maior correria!', '', '', '', '', '', '', 33528),
(53900, 'ptBR', 'Vamos usar as armas delas', 'Recolha $1oa Armamentos Nazeshi das forças situadas no Baixio da Pérola Medonha.', 'Vamos precisar de armas especiais para derrubar a Chamaré Nezara. A boa notícia é que as nagas parecem ter armas especiais de sobra. \n\nVamos virar o feitiço contra as feiticeiras. Disso, eu e você entendemos bastante. \n\nTraga um bocado. Só uma não vai dar.', '', '', '', '', '', '', 33528);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(53899, 'ptBR', 'Pelas beiradas', 'Encontre Nisha no litoral sul de Zuldazar.', 'Se já tiver se resolvido com Comandante, recomendo ir atrás da Nisha. \n\nEla deve estar precisando de ajuda.', '', '', '', '', '', '', 33528),
(53898, 'ptBR', 'Força e honra', 'Enfrente o Encarregado Magrok com força e honra.', 'Os peões estão com a cara boa, não estão? Não tenho a menor sombra de dúvida de que vão pegar no batente amanhã. \n\nMas se o líder sair dessa incontestado, sempre vai haver o risco da revolta. \n\nVocê tem que enfrentá-lo em batalha. \n\nMostrar a ele a força da Horda, e por fim a honra que mora na misericórdia.', '', 'Líder da revolta dos peões em Cachamorra.', '', '', '', '', 33528),
(53897, 'ptBR', 'Uma festa em sua homenagem', 'Informe ao Encarregado Magrok que a Horda vai dar uma festa para os peões.', 'Já tenho tudo de que preciso para fazer da noite de hoje um sucesso. \n\nAgora só falta os peões.\n\nDiga ao líder deles que a Horda vai dar uma festa em sua homenagem. \n\nDuvido muito que recusem uma noite de bebedeira e comida farta de graça.', '', '', '', '', '', '', 33528),
(53895, 'ptBR', 'A promoção dos peões!', 'Promova alguns Peões de Cachamorra no Esconderijo dos Peões.', 'Eu concordo com a luta dos peões. Eles têm que ser recompensados pelo trabalho que fazem.\n\nAcho pouco provável a Horda aumentar o soldo deles, mas não custa nada lhes dar uma promoção. \n\nUm título que não fosse peão já aumentaria um pouco a confiança.', '', '', '', '', '', '', 33528),
(53894, 'ptBR', 'Manutenção necessária', 'Recolha $1oa Minérios Crepusculares para que Kiro conserte as ferramentas dos peões.', 'Os peões estão cobertos de razão: com essas ferramentas é impraticável. \n\nComo querem que eles terminem o serviço sem ferramentas decentes?\n\nEu posso consertá-las, mas vou precisar de um punhado de minério.', '', '', '', '', '', '', 33528),
(53893, 'ptBR', 'Um cadinho de boa vontade', 'Recolha $1oa Costelas de Sabre, $2oa Carnes de Worg e $3oa Iscas de Carcarejo.', 'Parece que os peões não se sentem valorizados. Eles fazem um trabalho importante para a Horda, que acaba não sendo reconhecido. Um cadinho de boa vontade faz toda a diferença. \n\nVamos dar um banquete em homenagem a eles. Vamos precisar de carne aos montes para saciar aquelas barrigas sem fundo. Por sorte, eu tenho um totem que vai ajudar nisso. \n\nVocê busca os ingredientes, e eu garanto um refeição que vai elevar o moral por aqui.', '', '', '', '', '', '', 33528),
(53892, 'ptBR', 'Cadê a peãozada?', 'Descubra para onde foram os peões de Cachamorra.', 'Olhe esse machado, $p O suor sequer secou no cabo. Tinha gente trabalhando aqui não faz muito tempo. \n\nVamos ver se Sasha consegue farejá-los.', '', '', '', '', '', '', 33528),
(53891, 'ptBR', 'Nenhum problema é pequeno demais', 'Encontre Kiro no Planalto do Crepúsculo.', 'Esses problemas parecem coisa pouca, mas vão fazer um estrago com o passar do tempo se não forem resolvidos. \n\nTemos que oferecer ajuda. \n\nOs vulperas resolvem qualquer problema, seja grande ou pequeno.\n\nEu vou investigar o posto avançado. Nisha e Meerah cuidam do resto.\n\nMe encontre no Planalto do Crepúsculo quando estiver pront$Go:a;.', '', '', '', '', '', '', 33528),
(53890, 'ptBR', 'Mais aliados, mais problemas', 'Descubra quais sãos os problemas do Comandante Dresh, da Guarda-lâmina Sonji e da Primeira Arcanista Thalyssra.', 'Baine já tem problemas que chegue. Mais aliados significam mais problemas. \n\nVamos descobrir o que vem atrapalhando a Horda e ver o que podemos fazer para ajudar. \n\nDe repente, quando Baine não estiver tão sobrecarregado, ele consiga enxergar nosso valor.', '', '', '', '', '', '', 33528),
(53889, 'ptBR', 'Claras intenções', 'Ouça o desejo de Kiro de entrar Horda.', 'Nossa caravana está pronta para explorar o mundo que há além das dunas, porém a lâmina de Nisha não pode ser nossa única defesa contra os perigos que nos aguardam. \n\nÉ por isso que viemos aqui. \n\nPara declarar nossa intenção de entrar na Horda.', '', '', '', '', '', '', 33528),
(53870, 'ptBR', 'Visitas no Castelo Grommash', 'Encontre os visitantes no Castelo Grommash.', '$p, eu soube que chegou uma caravana vulperina no Castelo Grommash. Eles têm uma mensagem para a Horda e solicitaram sua presença.\n\nAgora não é o momento ideal para receber visitas, por isso peço que vá vê-los o mais rápido possível.', '', '', '', '', '', '', 33528),
