(52240, 'ptBR', 'Bosque jardineiro', 'Derrote o Retalhador Monstruoso.', 'Malditos sejam esses goblins e aquelas máquinas infernais deles!\n\nEstão usando um retalhador para profanar nosso bosque sagrado.\n\nTemos que acabar com essa monstruosidade!', '', 'Acabe com essa coisa antes que ela destrua o Bosque dos Ancientes!', 'Retalhador Monstruoso', '', '', 'Fale com Delaryn dentro do Bosque dos Ancientes.', 33528),
(52237, 'ptBR', 'Terra Podre: Horror Incansável', '', '', '', '', '', '', '', '', 33528),
