(52024, 'ptBR', 'Informe a Horda', 'Fale com Baine Casco Sangrento.', 'O General Jakra\'zet foi derrotado, mas o plano dele de evocar Mythrax deu certo, apesar dos nossos esforços.\n\nNão fosse pela misericórdia de Sethraliss, duvido que a gente teria escapado com vida de Atul\'Aman.\n\nTemos de informar nossos aliados do ocorrido em Vol\'dun.\n\nEu vou falar com a Princesa Talanji pessoalmente. Você devia entrar em contato com a Horda. Precisamos de toda ajuda possível.\n\nCom certeza, nossos caminhos vão se cruzar novamente, $n. Foi uma honra lutar ao seu lado.', '', '', '', '', '', '', 33528),
