(50321, 'ptBR', 'Traquinagem de mojo', 'Destrua $1oa Frascos de Mojo Viscoso.', 'Os soldados que você resgatou falaram dos saques a Zandalar. Saqueadores sanguitrólicos espumando pela boca, com uma força sobrenatural, sobrepujando os defensores. \n\n Eles disseram que essa força vinha de frascos de mojo que os saqueadores tomavam antes de entrar em combate. A gente não pode deixar os trolls sangrentos com isso.\n\nVai lá no acampamento e destrói todos os frascos que encontrar.', '', '', '', '', '', '', 33528),
(50084, 'ptBR', 'De pé, soldado', 'Arme $1oa Cativos Zandalari.', 'Eu estava pensando que os soldados que a gente encontrar pelo caminho podem estar querendo se vingar, então eu trouxe umas armas extras, por via das dúvidas.\n\nTá vendo ali na frente? Aquelas jaulas ali estão cheias de trolls esperando a hora de morrer. Vamos chegar lá com tudo e ser as respostas das preces deles!\n\nVai e arma o máximo deles que puder, a vingança vai ser o bicho!', '', '', '', '', '', '', 33528),
(49991, 'ptBR', 'Promoção de Pulos Porretas Pé-de-pena!', 'Pague 100 de Ouro a Quirino Pé-de-pena e ele lançará Queda Lenta sempre que você estiver por perto.', 'Boas-vindas a Zuldazar, $gmeu caro:minha cara; $pr!\n\nJá explorei cada canto dessa cidade maravilhosa com estes dois pés aqui. E digo, eles estão cansados!\n\nÉ por isso que decidi fornecer um serviço aos nossos poderosos amigos da Horda: Pulos Porretas Pé-de-pena!\n\nOra, sei o que você está pensando. Para você, queda é sinônimo de grito, dor e morte fora de hora.\n\nMAS NÃO COM PÉS-DE-PENA!\n\nPor uma pequena taxa única, garanto que você sempre descerá deste zigurate $gsão:sã; e salv$go:a;.', '', '', '', '', '', '', 33528),
(49952, 'ptBR', 'A essência de G\'huun', 'Faça o Guardião Titânico Hezrel aplicar a Essência Sintética para permitir sua passagem pelos mortos-vivos.', 'Análise de ossada infusa em sangue completa. Será possível criar essência sintética similar a G\'huun.\n\nObjetivo: passar pelos mortos-vivos sem iniciar combate. Aplicação de essência disponível.\n\nTempo escasso. Forças de G\'huun se aglomeram em torno do templo. Necessário entrar para reativar protocolos de contenção.', '', '', '', '', '', '', 33528),
(49376, 'ptBR', 'Coisinha de nada', 'Capture um crorguinho.', 'Tu apareceu na hora certa! Boto fé que o meu sangue era o próximo na reta.\n\nFoi minha culpa a gente ter parado aqui. O pessoal queria voltar.\n\nNão sei se tu se ligou, mas o problema são esses crorgs. O nascimento de sangue desses bichos é zoado por um treino cruel paca. É facinho influenciar eles e é só chamar que eles seguem.\n\nChama a atenção de um dos pequenos pra mim. Vamos confirmar minha teoria.', '', '', '', '', '', '', 33528),
(49124, 'ptBR', 'Resgatando tortollanos', 'Resgate $1oa Tortollanos Cativos dos trolls sangrentos usando o Pergaminho do Expurgo de Lashk.', 'Se Torga quer que ajudemos você a matar o arauto de G\'huun, então é o que faremos. Mas antes, temos que resgatar nosso povo.\n\nDescobri que os trolls sangrentos estão drenando o sangue dos nossos amigos das redondezas e dando como alimento para os crorgs! \n\nIsso não é jeito de tortollano nenhum morrer, principalmente depois de passar séculos reunindo histórias de Azeroth. \n\nTome este pergaminho. Ele vai purificar qualquer magia de sangue que os trolls sangrentos estiverem usando nos meus amigos.\n\nCuidado com meu pergaminho! Quero ele de volta inteiro.', '', '', '', '', '', '', 33528),
(49123, 'ptBR', 'Crorgs assassinos', 'Mate $1oa Crorgs Sangrentos ou quem os estiver montando.', 'Você ouviu o Torga. A gente precisa encarar os trolls sangrentos de frente para deter esse arauto de G\'huun.\n\nOs trolls estão com os crorgs monstrengos num acampamento perto daqui. Se a gente acabar com eles, os trolls sangrentos ficam mais fracos! \n\nO resto vai na frente para descobrir o que mais esses sangrentos estão aprontando por aqui.', '', '', '', '', '', '', 33528),
(49073, 'ptBR', 'Interrupção ritualística', 'Interrompa $1oa rituais de sangue com o Pergaminho do Expurgo de Kisha.', 'Não consigo acreditar que estamos lidando com um loa da morte, um loa MORTO e trolls sangrentos. Não era isso que eu tinha em mente para hoje!\n\nVeja, alguns dos outros tortollanos disseram que tem rituais do sangue sendo realizados. Eles ficaram com medo e começaram a fugir para o litoral quando viram aquilo.\n\nTome este pergaminho e leia quando estiver perto desses rituais de sangue. Isso deve servir para desbaratá-los.\n\nCuidado com o meu pergaminho, hein! Ele é meio velho e essa edição é difícil de achar.', '', '', '', '', '', '', 33528),
(49055, 'ptBR', 'Auricossário', '', '', '', '', '', '', '', '', 33528),
(48949, 'ptBR', 'Ervas do charco', 'Colete $1oa ramos de Erva-da-tumba no Charco do Medo.', '<Magura abre os olhos, fraca, com sua aproximação.>\n\nMe ajude... fraca... não consigo curar...\n\n<Magura faz um esforço para erguer o braço e apontar uma planta próxima.>\n\nErva-da-tumba... socorro... mais... por favor...', '', '', '', '', '', '', 33528),
(48653, 'ptBR', 'Uma prisão reluzente', 'Devolva o Olho da Eternidade Restaurado ao seu local de repouso no Charco do Medo.', '<No que você contempla a estranha gema, sente uma necessidade súbita de fazer a jornada até os pântanos de Nazmir e devolver a gema ao seu local de direito, onde quer que seja.>', '', '', '', '', '', '', 33528),
(48023, 'ptBR', 'Ordens recebidas', 'Recupere $1oa Ordens Explícitas.', 'A gente tem que descobrir quem é que tá mandando nessas nagas que tão surrupiando todos esses sapinhos fofos. \n\nElas têm uns baús por aqui na região com uns pergaminhos estranhos que ficam lendo. As madames ficam mandando os homens lembrar das ordens.\n\nMe arranja uns pergaminhos desses para a gente dar uma bizoiada em quem é o manda-chuva.', '', '', '', '', '', '', 33528),
(47529, 'ptBR', 'Suporte sobrenatural', 'Escolha de qual loa você deseja obter uma bênção.', 'Os loas podem conceder dádivas poderosas aos seguidores, auxílio que pode fazer a diferença entre vitória e derrota em nossos esforços aqui.\n\nPense muito bem a qual dos dois você pedirá a bênção. Um loa não dará assistência a quem estiver jurado a outro loa.', '', '', '', '', '', '', 33528),
(46817, 'ptBR', 'Queda infernal', '', '', '', '', '', '', '', '', 33528),
