(45405, 'ptBR', 'A Invasão do Sacrário', 'Fale com Oculeth para iniciar o ataque.', 'Chegou a hora. Valtrois está pronta para destruir a barreira que protege a brecha para o Sacrário. Vou teleportar você para a brecha, e então será sua tarefa conquistar a área.$b$bLeve estes orbes de telemancia. Se você perceber que vai precisar de ajuda, use-os para chamar fenecidos.$b$bTemos que atacar antes que o inimigo possa preparar novas defesas. Avise-me quando você puder começar.', '', '', '', '', '', '', 33528),
