(33008, 'ptBR', 'Entrando no Vale', 'Fale com a Madame Vee Luo no Santuário das Duas Luas, que fica no Vale das Flores Eternas.', 'Ah, como esperei sua chegada, viajante.$B$BGostaria de ter conhecido você em tempos melhores, mas infelizmente a situação no Vale é bastante cruel.$B$BVamos deixar essa conversa para depois. Vá visitar a Madame Vee Luo no Santuário das Duas Luas.$B$BEla receberá você.', '', '', '', '', '', '', 33528),
(31679, 'ptBR', 'Expandindo nossa cobertura', 'Ative o Transmissor Ressoante na Ravina Brilhâmbar.', 'Os Klaxxi\'va ouvem outro paragão. Os gritos dele são fracos e estão perdidos nas trevas. O sinal precisa ser fortalecido.$b$bHá uma torre na Ravina Brilhâmbar que tem estado silenciosa por muitos anos. Ela tem de cantar. Os Klaxxi assim exigem!$b$bDesta vez eu irei com você. Você me ajudará a consertá-la.$b$bPegue o cristal ressoante e me encontre em Brilhâmbar.', '', '', '', '', '', '', 33528),
(31526, 'ptBR', 'Um desafio digno: Durand', 'Completar o Modo Desafio do Monastério Escarlate.', '$n, você tem de reunir um grupo corajoso e liderá-lo até o Monastério Escarlate. Lá dentro, ative o Orbe do Desafiante e esmague Durand com fúria justa.$B$BFale novamente comigo ao completar esse desafio, e eu $Go:a; recompensarei magnificamente.', '', '', '', '', '', '', 33528),
(27925, 'ptBR', 'Efficient Excavations', 'Bring \'Efficient Excavations\' to Belloc Brightblade in Schnottz\'s Landing.', 'This manual describes outlandish theories on how to efficiently manage large groups of workers as they engage in the manual labor of various types of excavation.$b$bIt becomes clear to you that the author of the book is the figure in charge of the over-aggressive pillagers here.$b$bPerhaps an introduction is in order.', '', 'You can only assume that this picture is of the self-absorbed author.', '', '', '', '', 33528),
(26983, 'ptBR', 'Perto o suficiente', 'Fale com José, o Desperto.', 'Não se iluda, há muito a ser feito por aqui! Porém, além disso, também precisamos atacar o ponto fraco dos Renegados. O Monastério Escarlate, nas Clareiras de Tirisfal, fica à mesma distância da Cidade Baixa e de Montalvo.$B$BApresente-se a José, o Desperto, na Biblioteca do Monastério. Ele é um cruzado rebelde que poderá nos ajudar a tomar o Monastério como nossa base de operações na região, e quiçá derrotar o Arcanista Doan, um dos magos mais poderosos da cruzada durante o ataque.', '', '', '', '', '', '', 33528),
(24837, 'ptBR', 'Trilhar outro caminho', '', '', '', '', '', '', '', '', 33528),
(9600, 'ptBR', 'Redemption', 'Jol wants you to resurrect a Young Furbolg Shaman with the Symbol of Life and return to her.', 'Your task then, $n, is to aid our new allies, the Stillpine furbolgs.$b$bSeveral of the younger Stillpine shaman stumbled across a Bristlelimb camp and were slaughtered to the last. Take this Symbol of Life and resurrect one of the shaman.$b$bBristlelimb Enclave is located to the east of the road just after you cross the bridge spanning Azuremyst and Bloodmyst Isle. Speak with me when you have done this.', '', '', '', '', '', '', 33528),
(9460, 'ptBR', 'Combining Forces', 'Keltus Darkleaf wants you to pickpocket the Lacy Handkerchief from the Sentinel Leader and bring it to him.', 'Keltus Darkleaf reporting for duty!$b$bOh... who are you, anyhow? If you are here for my report, I insist you help me first.$b$bI am planning to attack the sentinel spies, but I intend to send in my faithful Whisper as a first strike. She just needs a scent to hone in on them.$b$bSurely someone of your skill could sneak in and steal something from the sentinel leader?', '', '', '', '', '', '', 33528),
(9443, 'ptBR', 'The So-Called Mark of the Lightbringer', 'Obtain the Mark of the Lightbringer and return it to Mehlar Dawnblade at the Bulwark in the Western Plaguelands.', 'I was once a pupil of Uther Lightbringer, founder of the Knights of the Silver Hand. I saw how he mishandled Prince Arthas\'s training. It led to the destruction of my homeland, Quel\'Thalas, and I blame Uther and his incompetence for all of it! And now he has a tomb in his honor - how lovely.$B$BMy sources tell me that the scarlet fools are keeping one of his \'holy\' relics atop their guard tower near the gates of Hearthglen.$B$BGo to the Western Plaguelands and retrieve it for me.', '', '', '', '', '', '', 33528),
(8852, 'ptBR', 'Dez sinetes para abastecer a guerra', '', '', '', '', '', '', '', '', 33528),
(8847, 'ptBR', 'Dez sinetes para abastecer a guerra', '', '', '', '', '', '', '', '', 33528),
(8572, 'ptBR', 'Veteran\'s Battlegear', 'Bring 7 Cenarion Combat Badges, 4 Cenarion Logistics Badges and 4 Cenarion Tactical Badges to Vargus at Cenarion Hold in Silithus. You must also attain Honored reputation with Cenarion Circle to be able to complete this quest.', 'The badges you collect from performing combat, logistics and tactical assignments for Cenarion Hold are more than just for show, $n.$B$BYou\'d be wise to hold on to them. As you prove your loyalty to our organization I can offer you some of the gear we reserve for our closest allies in exchange for those badges.', '', '', '', '', '', '', 33528),
(8523, 'ptBR', 'A Aliança precisa de mais bandagens de runatrama!', 'Leve 20 Bandagens de Runatrama ao Guardião Sombraluna na base aérea de Dun Morogh.', 'O acaso quis que voltássemos a discutir questões prementes $c. Mais uma vez obrigado pelos esforços já dispensados; poucos estariam dispostos a doar de forma tão abnega. Contudo, ainda há muito por fazer.$B$B$n, haveria interesse de sua parte em me trazer mais bandagens?', '', '', '', '', '', '', 33528),
(8301, 'ptBR', 'The Path of the Righteous', 'Collect 200 Silithid Carapace Fragments and return to Baristolth.', 'The Brood of Nozdormu are naturally distrusting of the lesser races. While it is true that you have proven to me that you have the potential makings of a hero, the time has come to prove this to my master.$B$BHive\'Ashi, Hive\'Zora, Hive\'Regal: All swarming with activity and all a threat to our existence. Slay silithid at these hives and take from them a fragment of their carapace. When you can carry no more, return to me and I shall strengthen your resolve.', '', '', '', '', '', '', 33528),
(8260, 'ptBR', 'Kit de sobrevivência básico de Arathor', '', '', '', '', '', '', '', '', 33528),
(7943, 'ptBR', 'Mais olhos de morcegos', '', '', '', '', '', '', '', '', 33528),
(7942, 'ptBR', 'Mais trecos de tório', '', '', '', '', '', '', '', '', 33528),
(7941, 'ptBR', 'Mais kits de armadura', '', '', '', '', '', '', '', '', 33528),
(7939, 'ptBR', 'Mais pedras densas de amolar', '', '', '', '', '', '', '', '', 33528),
(7901, 'ptBR', 'Caudas pompom macias', '', '', '', '', '', '', '', '', 33528),
(7896, 'ptBR', 'Fogos de artifício verdes', '', '', '', '', '', '', '', '', 33528),
(7895, 'ptBR', 'Tranqueira Zumbidora de Bronze', '', '', '', '', '', '', '', '', 33528),
(7891, 'ptBR', 'Braçadeiras Verdes de Ferro', '', '', '', '', '', '', '', '', 33528),
(7890, 'ptBR', 'Pedra de Amolar Pesada', '', '', '', '', '', '', '', '', 33528),
(7883, 'ptBR', 'O maior gnomo do mundo!', '', '', '', '', '', '', '', '', 33528),
(7882, 'ptBR', 'Gibões do Festival', '', '', '', '', '', '', '', '', 33528),
(7623, 'ptBR', 'Lord Banehollow', 'Purchase Shadowy Potions from Gorzeeki Wildeyes at the Altar of Storms in the Burning Steppes.$B$BUse the potions to travel through Jaedenar in Felwood, and speak with Lord Banehollow inside the Shadow Hold.', 'Mor\'zul says that you want to open a portal to Xoroth. To do that, you\'ll need Xorothian stardust. That\'s not easy to find on Azeroth!$B$BThere is one being who might have some: Lord Banehollow in Jaedenar, the seat of the Shadow Council! Speak with him and he might part with the stardust.$B$BBut if you\'re going to Jaedenar, then you\'ll need to cloak yourself in the Shadow Council\'s own flavor of evil. That will require some of my shadowy potions, and that will cost you...', '', '', '', '', '', '', 33528),
(7498, 'ptBR', 'Garona: Um Estudo sobre Furtividade e Traição', 'Devolva o livro aos legítimos donos.', 'O livro está marcado com o selo do Ateneu.', '', '', '', '', '', '', 33528),
(6001, 'ptBR', 'Body and Heart', 'Use the Cenarion Moondust on the Moonkin Stone of Auberdine to bring forth Lunaclaw. From there, you must face Lunaclaw and earn the strength of body and heart it possesses.$B$BSpeak with Mathrengyl Bearwalker in Darnassus when you are done.', 'Directly east of Auberdine lay many moonkin caves. The one closest to Auberdine has a Moonkin Stone inside it. Lunaclaw, the defender of the stone, will face you only when Cenarion Moondust is applied to it. Lunaclaw possesses within it a strength that you must use as one of the Claw.$B$BYou\'ve earned the right to use this Cenarion Moondust, $n... now show me that you\'ve earned the right to possess the strength of body and the strength of heart needed as a druid!', 'Face Lunaclaw and earn the strength of body and heart it possesses.', '', '', '', '', 'Return to Mathrengyl Bearwalker at Cenarion Enclave in Darnassus.', 33528),
(4788, 'ptBR', 'The Final Tablets', 'Bring the Fifth and Sixth Mosh\'aru Tablets to Prospector Ironboot in Tanaris.', 'While I look over the third and fourth tablets of Mosh\'aru, you must find the fifth and sixth! It will not be easy, for they are held by the Smolderthorn trolls within Blackrock Spire. The spire is a dark mountain of fire between the Burning Steppes and the Searing Gorge.$B$BGood luck, $n. Blackrock Spire is no place for decent folk...', '', '', '', '', '', '', 33528),
(3786, 'ptBR', 'Morrowgrain Research', 'Use an Evergreen Pouch with a Packet of Tharlendis Seeds and two Un\'Goro Soil samples to try and cultivate samples of Morrowgrain.$B$BBring 10 Morrowgrain to Bashana Runetotem in Thunder Bluff.', 'Here\'s your Evergreen Pouch that you\'ll need to use the Tharlendis seeds with. You also need to have Un\'Goro soil samples on hand to use as fertilizer for the seeds. Just use the pouch when you have everything; the pouch will take care of the rest.$B$BWhen you have enough morrowgrain, bring them to me here on Elder Rise. Please don\'t bother the Arch Druid; he\'ll be very busy with the research, as well as the multitude of concerns he has!', '', '', '', '', '', '', 33528),
(3502, 'ptBR', 'One Draenei\'s Junk...', 'Bring Kum\'isha Imperfect Draenethyst Fragments. Any form of monster in the Blasted Lands could be carrying a fragment.', 'Well, after that display of voracious greed, I feel nauseous.$B$BRegardless, I shall not dwell too long on your material addiction.$B$BFor each imperfect draenethyst fragment you turn in, I shall reward you with more junk. My junk heap gets smaller while your junk heap gets larger. On Draenor we call this a \'win-win\' situation.', '', '', '', '', '', '', 33528),
(2934, 'ptBR', 'Undamaged Venom Sac', 'Bring an Undamaged Venom Sac to Apothecary Lydon in Tarren Mill.', 'I must have a fresh sample of the venom you brought me. The spiders from which it was gathered must dwell in the Hinterlands -- hunt them until you find an undamaged venom sac and bring it to me. You will find many spiders near the troll city of Shadra\'Alor.$B$BDo not tarry, $n, for the venom sac must be fresh when you deliver it.', '', '', '', '', '', '', 33528),
(2586, 'ptBR', 'Salt of the Scorpok', 'Bring three Scorpok Pincers, two Vulture Gizzards, and one Blasted Boar Lung to Bloodmage Drazial.', 'You live! This is good news, indeed. I assume you are back for more of the scorpok assay?$B$BVery well, $n, back to the wasteland with you and do not return until you have collected three scorpok pincers, two vulture gizzards, and one blasted boar lung.', '', '', '', '', '', '', 33528),
(2440, 'ptBR', 'The Platinum Discs', 'Take the reward voucher to Bena Winterhoof in Thunder Bluff.', 'I shall focus my energies on these discs; they will reveal their true workings to me in due time.$B$BAs for you $n, I will now reward you for your diligence in bringing this to my attention. Take this voucher to Bena Winterhoof, the alchemy trainer for Thunder Bluff. She will give you a special item I believe you will find appealing, and she will supply you with a choice of potions from my personal stock.$B$BReturn to me soon, as I sense there is much more at hand for us to do regarding this find.', '', '', '', '', '', '', 33528),
(1444, 'ptBR', 'Return to Fel\'Zerul', 'Return to Fel\'Zerul in Stonard.', 'Jammal\'an the Prophet sentenced me to exile from The Temple of Atal\'Hakkar. I once felt the high priest was a worthy leader.$b$bHis unyielding faith in his prophecy will bring about the destruction of the Atal\'ai. If it hasn\'t already.$b$bWhen I expressed my concerns, I was labeled an infidel and ousted from the temple.$b$bThose artifacts you brought to me are harmless. But if Jammal\'an has found the proper fetish enchantment for the summoning ritual, the world lies in great peril....', '', '', '', '', '', '', 33528),
(731, 'ptBR', 'The Absent Minded Prospector', 'Protect Prospector Remtravel as he searches for the mysterious fossil, then return to Archaeologist Hollee in Auberdine.', 'So then, Hollee... oh that\'s right, you are not Hollee. Where\'s Hollee?$b$bBah, that\'s beside the point. We must find that stone brush... I mean the mysterious fossil! We must find that fossil. The Explorers\' League in Darnassus will want some indication as to what I\'ve been doing.$b$bLet me know when you are ready and we will hunt down that brush.... I mean fossil! We shall find something in writing to satisfy the League.$b$bSo are you ready yet?', 'Escort Prospector Remtravel', '', '', '', '', '', 33528),
(730, 'ptBR', 'Trouble In Darkshore?', 'Travel to Auberdine and look for signs of the dwarven excavation team.', 'How nice it is to see a $c interested in the great archeological wonders of our world.$b$bOftentimes our work is dismissed as mere hobby by our friends in the Alliance. But what many fail to realize is that recent discoveries in Khaz Modan have proven that a great and powerful force threatens all of Azeroth, from Lordaeron to Kalimdor.$b$bI am most worried about my crew that I sent to Darkshore. They haven\'t sent word in weeks.$b$bTravel to Auberdine and look for a clue as to their whereabouts.', '', '', '', '', '', '', 33528),
(727, 'ptBR', 'To Ironforge for Yagyin\'s Digest', 'Give the Sigil of the Hammer to Gerrig Bonegrip in the Forlorn Cavern of Ironforge.', 'The Tablet tells much. But not enough! Not nearly enough!$B$BThere is a book, a digest that Yagyin wrote in ages past. The ... people I fled ... they keep this book in many places. And their most learned study it. It holds vast knowledge. Knowledge to protect us!$B$BGo to Gerrig Bonegrip. He is in a shop in Ironforge, in the Forlorn Cavern. Show him this sigil and he\'ll think you one of them. Ask him for Yagyin\'s Digest ... and bring it to me!', '', '', '', '', '', '', 33528),
(336, 'ptBR', 'Uma bebida para poucos', 'Sirva o Chope Garra Negra para o Barão Quadranilha na Sala de Audiência.', 'O barão Quadranilha, como todo homem, tem lá suas fraquezas. A dele é o gosto pela água que passarinho não bebe. É de uma hipocrisia espantosa. Aquele imbecil moralista passa os dias tentando nos fechar e as noites bebendo na nossa pequena \"taberna\", e ainda por cima pede fiado. Bem, vamos ver o que o Quadranilha acha dessa cerveja especial que eu preparei para ele: Chope Garra Negra. Esse pega pra valer.$b$bSirva a cerveja para o Barão e veja o que ele acha. Ele deve estar trocando as pernas como sempre na Sala de Audiência.', '', '', '', '', '', '', 33528);
